 f  =  1; //right hand side function\n 4 func g  =  0; //boundary condition function\n 5 \n 6 // Mesh\n 7 mesh Th  =  square(nn, nn);\n 8 \n 9 // Fespace\n10 fespace Vh(Th, P1);\n11 Vh uh, vh;\n12 \n13 // Problem\n14 real cpu  =  clock();\n15 problem laplace (uh, vh, solver = Cholesky, tolpivot = 1e-6)\n16      =  int2d(Th)(\n17           dx(uh)*dx(vh)\n18         + dy(uh)*dy(vh)\n19     )\n20     + int2d(Th)(\n21         - f*vh\n22     )\n23     ;\n24 \n25 try{\n26     cout << \"Try Cholesky\" << endl;\n27 \n28     // Solve\n29     laplace;\n30 \n31     // Plot\n32     plot(uh);\n33 \n34     // Display\n35     cout << \"laplacian Cholesky \" << nn << \", x_\" << nn << \" : \" << -cpu+clock() << \" s, max  =  \" << uh[].max << endl;\n36 }\n37 catch(...) { //catch all error\n38     cout << \" Catch cholesky PB \" << endl;\n39 }\n\n\nThe output of this script is:\n1 Try Cholesky\n2 ERREUR choleskypivot (35) =  -6.43929e-15 < 1e-06\n3   current line  =  29\n4 Exec error : FATAL ERREUR dans ./../femlib/MatriceCreuse_tpl.hpp\n5 cholesky line:\n6    -- number :688\n7  catch an erreur in  solve   = >  set  sol  =  0 !!!!!!!\n8  Catch cholesky PB\n\n\n\n\n\n\n\t\t\n\t\t\t Previous topic: Parallelization\n\t\t\tNext topic: Bibliography \n\t\t\n\t","l":"examples/developers.html"},"22":{"t":"Finite Element","p":"\n\t\t\n   \nFinite Element\n\nPeriodic 3D\n 1 load \"msh3\"\n 2 load \"medit\"\n 3 \n 4 // Parameters\n 5 searchMethod = 1; // More safe seach algo\n 6 real a  =  1, d  =  0.5, h  =  0.5;\n 7 int nnb  =  7, nni  =  10;\n 8 int nz  =  3;\n 9 func zmin  =  0;\n10 func zmax  =  h;\n11 \n12 // Mesh 2D\n13 border b1(t = 0.5, -0.5){x = a*t; y = -a/2; label = 1;}\n14 border b2(t = 0.5, -0.5){x = a/2; y = a*t; label = 2;}\n15 border b3(t = 0.5, -0.5){x = a*t; y = a/2; label = 3;}\n16 border b4(t = 0.5, -0.5){x = -a/2; y = a*t; label = 4;}\n17 border i1(t = 0, 2.*pi){x = d/2*cos(t); y = -d/2*sin(t); label = 7;}\n18 mesh Th  =  buildmesh(b1(-nnb) + b3(nnb) + b2(-nnb) + b4(nnb) + i1(nni));\n19 \n20 { // Cleaning the memory correctly\n21     int[int] old2new(0:Th.nv-1);\n22     fespace Vh2(Th, P1);\n23     Vh2 sorder  =  x + y;\n24     sort(sorder[], old2new);\n25     int[int] new2old  =  old2new^-1; // Inverse permutation\n26     Th  =  change(Th, renumv = new2old);\n27     sorder[]  =  0:Th.nv-1;\n28 }\n29 {\n30     fespace Vh2(Th, P1);\n31     Vh2 nu;\n32     nu[]  =  0:Th.nv-1;\n33     plot(nu, cmm = \"nu = \", wait = true);\n34 }\n35 \n36 // Mesh 3D\n37 int[int] rup  =  [0, 5], rlow  =  [0, 6], rmid  =  [1, 1, 2, 2, 3, 3, 4, 4, 7, 7], rtet  =  [0, 41];\n38 mesh3 Th3  =  buildlayers(Th, nz, zbound = [zmin, zmax],\n39     reftet = rtet, reffacemid = rmid, reffaceup = rup, reffacelow = rlow);\n40 for(int i  =  1; i < =  6; ++i)\n41     cout << \" int \" << i << \" : \" << int2d(Th3,i)(1.) << \" \" << int2d(Th3,i)(1./area) << endl;\n42 \n43 plot(Th3, wait = true);\n44 medit(\"Th3\", Th3);\n45 \n46 fespace Vh(Th3, P2, periodic = [[1, x, z], [3, x, z], [2, y, z], [4, y, z], [5, x, y], [6, x, y]]);\n\n\n\n\n\nFig. 206 Periodic mesh\n\n\n\n\nLagrange multipliers\n 1 // Parameters\n 2 func f  =  1 + x - y;\n 3 \n 4 // Mesh\n 5 mesh Th  =  square(10, 10);\n 6 \n 7 // Fespace\n 8 fespace Vh(Th, P1);\n 9 int n  =  Vh.ndof;\n10 int n1  =  n+1;\n11 Vh uh, vh;\n12 \n13 // Problem\n14 varf va (uh, vh)\n15      =  int2d(Th)(\n16           dx(uh)*dx(vh)\n17         + dy(uh)*dy(vh)\n18     )\n19     ;\n20 \n21 varf vL (uh, vh)  =  int2d(Th)(f*vh);\n22 varf vb (uh, vh)  =  int2d(Th)(1.*vh);\n23 \n24 matrix A  =  va(Vh, Vh);\n25 real[int] b  =  vL(0, Vh);\n26 real[int] B  =  vb(0, Vh);\n27 \n28 // Block matrix\n29 matrix AA  =  [ [ A, B ], [ B', 0 ] ];\n30 set(AA, solver = sparsesolver);\n31 \n32 real[int] bb(n+1), xx(n+1), b1(1), l(1);\n33 b1  =  0;\n34 // Builds the right hand side block\n35 bb  =  [b, b1];\n36 \n37 // Solve\n38 xx  =  AA^-1 * bb;\n39 \n40 // Set values\n41 [uh[],l]  =  xx;\n42 \n43 // Display\n44 cout << \" l  =  \" << l(0) << \" , b(u, 1)  = \" << B'*uh[] << endl;\n45 \n46 // Plot\n47 plot(uh);\n\n\n\n\n\nFig. 207 Result\n\n\n\n\n\n\n\t\t\n\t\t\t Previous topic: Mesh Generation\n\t\t\tNext topic: Visualization \n\t\t\n\t","l":"examples/finite-element.html"},"23":{"t":"Examples","p":"\n\t\t\n   \nExamples\n\n\n\n\n\t\t\n\t\t\t Previous topic: Whispering gallery modes\n\t\t\tNext topic: Misc \n\t\t\n\t","l":"examples/index.html"},"24":{"t":"Mesh Generation","p":"\n\t\t\n   \nMesh Generation\n\nSquare mesh\n 1 mesh Th0  =  square(10 ,10);\n 2 \n 3 mesh Th1  =  square(4, 5);\n 4 \n 5 real x0  =  1.2;\n 6 real x1  =  1.8;\n 7 real y0  =  0;\n 8 real y1  =  1;\n 9 int n  =  5;\n10 real m  =  20;\n11 mesh Th2  =  square(n, m, [x0+(x1-x0)*x, y0+(y1-y0)*y]);\n12 \n13 for (int i  =  0; i < 5; ++i){\n14    int[int] labs  =  [11, 12, 13, 14];\n15    mesh Th3  =  square(3, 3, flags = i, label = labs, region = 10);\n16    plot(Th3, wait = 1, cmm = \"square flags  =  \"+i );\n17 }\n\n\n\n\nMesh adaptation\n 1 // Parameters\n 2 real eps  =  0.0001;\n 3 real h  =  1;\n 4 real hmin  =  0.05;\n 5 func f  =  10.0*x^3 + y^3 + h*atan2(eps, sin(5.0*y)-2.0*x);\n 6 \n 7 // Mesh\n 8 mesh Th  =  square(5, 5, [-1+2*x, -1+2*y]);\n 9 \n10 // Fespace\n11 fespace Vh(Th,P1);\n12 Vh fh  =  f;\n13 plot(fh);\n14 \n15 // Adaptmesh\n16 for (int i  =  0; i < 2; i++){\n17    Th  =  adaptmesh(Th, fh);\n18    fh  =  f; //old mesh is deleted\n19    plot(Th, fh, wait = true);\n20 }\n\n\n\n\n\n\nFig. 186 Initial mesh\n\n\n\n\n\nFig. 187 Adapted mesh\n\n\nMesh adaptation\n\n\nMesh adaptation for the Poissons problem\n 1 // Parameters\n 2 real error  =  0.1;\n 3 \n 4 // Mesh\n 5 border ba(t = 0, 1){x = t; y = 0; label = 1;}\n 6 border bb(t = 0, 0.5){x = 1; y = t; label = 1;}\n 7 border bc(t = 0, 0.5){x = 1-t; y = 0.5; label = 1;}\n 8 border bd(t = 0.5, 1){x = 0.5; y = t; label = 1;}\n 9 border be(t = 0.5, 1){x = 1-t; y = 1; label = 1;}\n10 border bf(t = 0, 1){x = 0; y = 1-t; label = 1;}\n11 mesh Th  =  buildmesh(ba(6) + bb(4) + bc(4) + bd(4) + be(4) + bf(6));\n12 \n13 // Fespace\n14 fespace Vh(Th, P1);\n15 Vh u, v;\n16 \n17 // Function\n18 func f  =  1;\n19 \n20 // Problem\n21 problem Poisson(u, v, solver = CG, eps = 1.e-6)\n22     =  int2d(Th)(\n23         dx(u)*dx(v)\n24       + dy(u)*dy(v)\n25    )\n26    - int2d(Th)(\n27         f*v\n28    )\n29    + on(1, u = 0);\n30 \n31 // Adaptmesh loop\n32 for (int i  =  0; i < 4; i++){\n33    Poisson;\n34    Th  =  adaptmesh(Th, u, err = error);\n35    error  =  error/2;\n36 }\n37 \n38 // Plot\n39 plot(u);\n\n\n\n\n\n\nFig. 188 Initial mesh\n\n\n\n\n\nFig. 189 Adapted mesh\n\n\n\n\n\nFig. 190 Solution on adapted mesh\n\n\nMesh adaptation (Poisson)\n\n\nUniform mesh adaptation\n1 mesh Th  =  square(2, 2); // The initial mesh\n2 plot(Th, wait = true);\n3 \n4 Th  =  adaptmesh(Th, 1./30., IsMetric = 1, nbvx = 10000);\n5 plot(Th, wait = true);\n6 \n7 Th  =  adaptmesh(Th, 1./30., IsMetric = 1, nbvx = 10000); // More than one time due to the\n8 Th  =  adaptmesh(Th, 1./30., IsMetric = 1, nbvx = 10000); // adaptation bound `maxsubdiv = `\n9 plot(Th, wait = true);\n\n\n\n\n\n\nFig. 191 Initial mesh\n\n\n\n\n\nFig. 192 Adapted mesh\n\n\nUniform mesh adaptation\n\n\nBorders\n 1 {\n 2    int upper  =  1;\n 3    int others  =  2;\n 4    int inner  =  3;\n 5 \n 6    border C01(t = 0, 1){x = 0; y = -1+t; label = upper;}\n 7    border C02(t = 0, 1){x = 1.5-1.5*t; y = -1; label = upper;}\n 8    border C03(t = 0, 1){x = 1.5; y = -t; label = upper;}\n 9    border C04(t = 0, 1){x = 1+0.5*t; y = 0; label = others;}\n10    border C05(t = 0, 1){x = 0.5+0.5*t; y = 0; label = others;}\n11    border C06(t = 0, 1){x = 0.5*t; y = 0; label = others;}\n12    border C11(t = 0, 1){x = 0.5; y = -0.5*t; label = inner;}\n13    border C12(t = 0, 1){x = 0.5+0.5*t; y = -0.5; label = inner;}\n14    border C13(t = 0, 1){x = 1; y = -0.5+0.5*t; label = inner;}\n15 \n16    int n  =  10;\n17    plot(C01(-n) + C02(-n) + C03(-n) + C04(-n) + C05(-n)\n18       + C06(-n) + C11(n) + C12(n) + C13(n), wait = true);\n19 \n20    mesh Th  =  buildmesh(C01(-n) + C02(-n) + C03(-n) + C04(-n) + C05(-n)\n21       + C06(-n) + C11(n) + C12(n) + C13(n));\n22 \n23    plot(Th, wait = true);\n24 \n25    cout << \"Part 1 has region number \" << Th(0.75, -0.25).region << endl;\n26    cout << \"Part 2 has redion number \" << Th(0.25, -0.25).region << endl;\n27 }\n28 \n29 {\n30    border a(t = 0, 2*pi){x = cos(t); y = sin(t); label = 1;}\n31    border b(t = 0, 2*pi){x = 0.3+0.3*cos(t); y = 0.3*sin(t); label = 2;}\n32    plot(a(50) + b(30)); //to see a plot of the border mesh\n33    mesh Thwithouthole  =  buildmesh(a(50) + b(30));\n34    mesh Thwithhole  =  buildmesh(a(50) + b(-30));\n35    plot(Thwithouthole);\n36    plot(Thwithhole);\n37 }\n38 \n39 {\n40    real r = 1;\n41    border a(t = 0, 2*pi){x = r*cos(t); y = r*sin(t); label = 1;}\n42    r = 0.3;\n43    border b(t = 0, 2*pi){x = r*cos(t); y = r*sin(t); label = 1;}\n44    //  mesh Thwithhole  =  buildmesh(a(50) + b(-30)); // do not do this because the two\n45    // circles have the same radius  =  $0.3$\n46 }\n\n\n\n\n\n\nFig. 193 Mesh with two regions\n\n\n\n\n\nFig. 194 Mesh without a hole\n\n\n\n\n\nFig. 195 Mesh with a hole\n\n\nBorders\n\n\nChange\n 1 verbosity = 3;\n 2 \n 3 // Mesh\n 4 mesh Th1  =  square(10, 10);\n 5 mesh Th2  =  square(20, 10, [x+1, y]);\n 6 \n 7 int[int] r1 = [2, 0];\n 8 plot(Th1, wait = true);\n 9 \n10 Th1  =  change(Th1, label = r1); // Change edges' label from 2 to 0\n11 plot(Th1, wait = true);\n12 \n13 int[int] r2 = [4, 0];\n14 Th2  =  change(Th2, label = r2); // Change edges' label from 4 to 0\n15 plot(Th2, wait = true);\n16 \n17 mesh Th  =  Th1 + Th2; // 'gluing together' Th1 and Th2 meshes\n18 cout << \"nb lab  =  \" << int1d(Th1,1,3,4)(1./lenEdge)+int1d(Th2,1,2,3)(1./lenEdge)\n19    << \"  =  =  \" << int1d(Th,1,2,3,4)(1./lenEdge) << \"  =  =  \" << ((10+20)+10)*2 << endl;\n20 plot(Th, wait = true);\n21 \n22 fespace Vh(Th, P1);\n23 Vh u, v;\n24 \n25 macro Grad(u) [dx(u),dy(u)] // Definition of a macro\n26 \n27 solve P(u, v)\n28     =  int2d(Th)(\n29         Grad(u)'*Grad(v)\n30    )\n31    -int2d(Th)(\n32         v\n33    )\n34    + on(1, 3, u = 0)\n35    ;\n36 \n37 plot(u, wait = 1);\n\n\n\n\n\nFig. 196 Result\n\n\n\n\nCube\n 1 load \"msh3\"\n 2 \n 3 int[int] l6  =  [37, 42, 45, 40, 25, 57];\n 4 int r11  =  11;\n 5 mesh3 Th  =  cube(4, 5, 6, [x*2-1, y*2-1, z*2-1], label = l6, flags  = 3, region = r11);\n 6 \n 7 cout << \"Volume  =  \" << Th.measure << \", border area  =  \" << Th.bordermeasure << endl;\n 8 \n 9 int err  =  0;\n10 for(int i  =  0; i < 100; ++i){\n11    real s  =  int2d(Th,i)(1.);\n12    real sx  =  int2d(Th,i)(x);\n13    real sy  =  int2d(Th,i)(y);\n14    real sz  =  int2d(Th,i)(z);\n15 \n16    if(s){\n17       int ix  =  (sx/s+1.5);\n18       int iy  =  (sy/s+1.5);\n19       int iz  =  (sz/s+1.5);\n20       int ii  =  (ix + 4*(iy+1) + 16*(iz+1) );\n21       //value of ix,iy,iz  = > face min 0, face max 2, no face 1\n22       cout << \"Label  =  \" << i << \", s  =  \" << s << \" \" << ix << iy << iz << \" : \" << ii << endl;\n23       if( i ! =  ii ) err++;\n24    }\n25 }\n26 real volr11  =  int3d(Th,r11)(1.);\n27 cout << \"Volume region  =  \" << 11 << \": \" << volr11 << endl;\n28 if((volr11 - Th.measure )>1e-8) err++;\n29 plot(Th, fill = false);\n30 cout << \"Nb err  =  \" << err << endl;\n31 assert(err =  = 0);\n\n\n\n\n\nFig. 197 Cube\n\n\n\n\nEmpty mesh\n 1 {\n 2    border a(t = 0, 2*pi){x = cos(t); y = sin(t); label = 1;}\n 3    mesh Th  =  buildmesh(a(20));\n 4    Th  =  emptymesh(Th);\n 5    plot(Th);\n 6 }\n 7 {\n 8    mesh Th  =  square(10, 10);\n 9    int[int] ssd(Th.nt);\n10    // Builds the pseudo region numbering\n11    for(int i  =  0; i < ssd.n; i++){\n12       int iq  =  i/2; // Because we have 2 triangles per quad\n13       int ix  =  iq%10;\n14       int iy  =  iq/10;\n15       ssd[i]  =  1 + (ix> = 5) + (iy> = 5)*2;\n16    }\n17    // Builds an emtpy mesh with all edges that satisfy e = T1 cap T2 and ssd[T1] ! =  ssd[T2]\n18    Th  =  emptymesh(Th, ssd);\n19    // Plot\n20    plot(Th);\n21 }\n\n\n\n\n\n\nFig. 198 Empty square\n\n\n\n\n\nFig. 199 Empty diamond\n\n\nEmpty mesh\n\n\n3 points\n 1 // Square for Three-Point Bend Specimens fixed on Fix1, Fix2\n 2 // It will be loaded on Load\n 3 real a  =  1, b  =  5, c  =  0.1;\n 4 int n  =  5, m  =  b*n;\n 5 border Left(t = 0, 2*a){x = -b; y = a-t;}\n 6 border Bot1(t = 0, b/2-c){x = -b+t; y = -a;}\n 7 border Fix1(t = 0, 2*c){x = -b/2-c+t; y = -a;}\n 8 border Bot2(t = 0, b-2*c){x = -b/2+c+t; y = -a;}\n 9 border Fix2(t = 0, 2*c){x = b/2-c+t; y = -a;}\n10 border Bot3(t = 0, b/2-c){x = b/2+c+t; y = -a;}\n11 border Right(t = 0, 2*a){x = b; y = -a+t;}\n12 border Top1(t = 0, b-c){x = b-t; y = a;}\n13 border Load(t = 0, 2*c){x = c-t; y = a;}\n14 border Top2(t = 0, b-c){x = -c-t; y = a;}\n15 \n16 mesh Th  =  buildmesh(Left(n) + Bot1(m/4) + Fix1(5) + Bot2(m/2)\n17    + Fix2(5) + Bot3(m/4) + Right(n) + Top1(m/2) + Load(10) + Top2(m/2));\n18 plot(Th, bw = true);\n\n\n\n\n\nFig. 200 3 Points\n\n\n\n\nBezier\n 1 // A cubic Bezier curve connecting two points with two control points\n 2 func real bzi(real p0, real p1, real q1, real q2, real t){\n 3    return p0*(1-t)^3 + q1*3*(1-t)^2*t + q2*3*(1-t)*t^2 + p1*t^3;\n 4 }\n 5 \n 6 real[int] p00  =  [0, 1], p01  =  [0, -1], q00  =  [-2, 0.1], q01  =  [-2, -0.5];\n 7 real[int] p11  =  [1,-0.9], q10  =  [0.1, -0.95], q11 = [0.5, -1];\n 8 real[int] p21  =  [2, 0.7], q20  =  [3, -0.4], q21  =  [4, 0.5];\n 9 real[int] q30  =  [0.5, 1.1], q31  =  [1.5, 1.2];\n10 border G1(t = 0, 1){\n11    x = bzi(p00[0], p01[0], q00[0], q01[0], t);\n12    y = bzi(p00[1], p01[1], q00[1], q01[1], t);\n13 }\n14 border G2(t = 0, 1){\n15    x = bzi(p01[0], p11[0], q10[0], q11[0], t);\n16    y = bzi(p01[1], p11[1], q10[1], q11[1], t);\n17 }\n18 border G3(t = 0, 1){\n19    x = bzi(p11[0], p21[0], q20[0], q21[0], t);\n20    y = bzi(p11[1], p21[1], q20[1], q21[1], t);\n21 }\n22 border G4(t = 0, 1){\n23    x = bzi(p21[0], p00[0], q30[0], q31[0], t);\n24    y = bzi(p21[1], p00[1], q30[1], q31[1], t);\n25 }\n26 int m  =  5;\n27 mesh Th  =  buildmesh(G1(2*m) + G2(m) + G3(3*m) + G4(m));\n28 plot(Th, bw = true);\n\n\n\n\n\nFig. 201 Bezier\n\n\n\n\nBuild layer mesh\n 1 load \"msh3\"\n 2 load \"tetgen\"\n 3 load \"medit\"\n 4 \n 5 // Parameters\n 6 int C1  =  99;\n 7 int C2  =  98;\n 8 \n 9 // 2D mesh\n10 border C01(t = 0, pi){x = t; y = 0; label = 1;}\n11 border C02(t = 0, 2*pi){ x = pi; y = t; label = 1;}\n12 border C03(t = 0, pi){ x = pi-t; y = 2*pi; label = 1;}\n13 border C04(t = 0, 2*pi){ x = 0; y = 2*pi-t; label = 1;}\n14 \n15 border C11(t = 0, 0.7){x = 0.5+t; y = 2.5; label = C1;}\n16 border C12(t = 0, 2){x = 1.2; y = 2.5+t; label = C1;}\n17 border C13(t = 0, 0.7){x = 1.2-t; y = 4.5; label = C1;}\n18 border C14(t = 0, 2){x = 0.5; y = 4.5-t; label = C1;}\n19 \n20 border C21(t = 0, 0.7){x = 2.3+t; y = 2.5; label = C2;}\n21 border C22(t = 0, 2){x = 3; y = 2.5+t; label = C2;}\n22 border C23(t = 0, 0.7){x = 3-t; y = 4.5; label = C2;}\n23 border C24(t = 0, 2){x = 2.3; y = 4.5-t; label = C2;}\n24 \n25 mesh Th  =  buildmesh(C01(10) + C02(10) + C03(10) + C04(10)\n26    + C11(5) + C12(5) + C13(5) + C14(5)\n27    + C21(-5) + C22(-5) + C23(-5) + C24(-5));\n28 \n29 mesh Ths  =  buildmesh(C01(10) + C02(10) + C03(10) + C04(10)\n30    + C11(5) + C12(5) + C13(5) + C14(5));\n31 \n32 // Construction of a box with one hole and two regions\n33 func zmin  =  0.;\n34 func zmax  =  1.;\n35 int MaxLayer  =  10;\n36 \n37 func XX  =  x*cos(y);\n38 func YY  =  x*sin(y);\n39 func ZZ  =  z;\n40 \n41 int[int] r1  =  [0, 41], r2  =  [98, 98, 99, 99, 1, 56];\n42 int[int] r3  =  [4, 12]; // Change upper surface mesh's triangles labels\n43 // generated by the 2D mesh's triangles Th\n44 // from label 4 to label 12\n45 int[int] r4  =  [4, 45]; // Change lower surface mesh's triangles labels\n46 // generated by the 2D mesh's triangles Th\n47 // from label 4 to label 45\n48 \n49 mesh3 Th3  =  buildlayers(Th, MaxLayer, zbound = [zmin, zmax], region = r1,\n50    labelmid = r2, labelup = r3, labeldown = r4);\n51 medit(\"box 2 regions 1 hole\", Th3);\n52 \n53 // Construction of a sphere with TetGen\n54 func XX1  =  cos(y)*sin(x);\n55 func YY1  =  sin(y)*sin(x);\n56 func ZZ1  =  cos(x);\n57 \n58 real[int] domain  =  [0., 0., 0., 0, 0.001];\n59 string test  =  \"paACQ\";\n60 cout << \"test  =  \" << test << endl;\n61 mesh3 Th3sph  =  tetgtransfo(Ths, transfo = [XX1, YY1, ZZ1],\n62    switch = test, nbofregions = 1, regionlist = domain);\n63 medit(\"sphere 2 regions\", Th3sph);\n\n\n\n\n\n\nFig. 202 Box with a hole\n\n\n\n\n\nFig. 203 Sphere\n\n\nBuild layer mesh\n\n\nSphere\n 1 // Parameter\n 2 real hh  =  0.1;\n 3 \n 4 // Mesh 2D\n 5 mesh Th  =  square(10, 20, [x*pi-pi/2, 2*y*pi]); // ]-pi/2, pi/2[X]0, 2pi[\n 6 // A parametrization of a sphere\n 7 func f1  =  cos(x)*cos(y);\n 8 func f2  =  cos(x)*sin(y);\n 9 func f3  =  sin(x);\n10 // Partial derivative of the parametrization DF\n11 func f1x  =  sin(x)*cos(y);\n12 func f1y  =  -cos(x)*sin(y);\n13 func f2x  =  -sin(x)*sin(y);\n14 func f2y  =  cos(x)*cos(y);\n15 func f3x  =  cos(x);\n16 func f3y  =  0;\n17 //M  =  DF^t DF\n18 func m11  =  f1x^2 + f2x^2 + f3x^2;\n19 func m21  =  f1x*f1y + f2x*f2y + f3x*f3y;\n20 func m22  =  f1y^2 + f2y^2 + f3y^2;\n21 \n22 // Periodic condition\n23 func perio  =  [[4, y], [2, y], [1, x], [3, x]];\n24 \n25 // Mesh adaptation\n26 real vv  =  1/square(hh);\n27 Th  =  adaptmesh(Th, m11*vv, m21*vv, m22*vv, IsMetric = 1, inquire = 1, periodic = perio);\n28 Th  =  adaptmesh(Th, m11*vv, m21*vv, m22*vv, IsMetric = 1, periodic = perio);\n29 Th  =  adaptmesh(Th, m11*vv, m21*vv, m22*vv, IsMetric = 1, periodic = perio);\n30 Th  =  adaptmesh(Th, m11*vv, m21*vv, m22*vv, IsMetric = 1, periodic = perio);\n31 \n32 // Sphere\n33 mesh3 Th3  =  movemesh23(Th, transfo = [f1, f2, f3]);\n34 plot(Th3);\n\n\n\n\n\n\nFig. 204 Initial mesh\n\n\n\n\n\nFig. 205 Sphere\n\n\nSphere\n\n\n\n\n\t\t\n\t\t\t Previous topic: Misc\n\t\t\tNext topic: Finite Element \n\t\t\n\t","l":"examples/mesh-generation.html"},"25":{"t":"Misc","p":"\n\t\t\n   \nMisc\n\nPoissons Equation\n 1 // Parameters\n 2 int nn  =  20;\n 3 real L  =  1.;\n 4 real H  =  1.;\n 5 real l  =  0.5;\n 6 real h  =  0.5;\n 7 \n 8 func f  =  1.;\n 9 func g  =  0.;\n10 \n11 int NAdapt  =  10;\n12 \n13 // Mesh\n14 border b1(t = 0, L){x = t; y = 0;};\n15 border b2(t = 0, h){x = L; y = t;};\n16 border b3(t = L, l){x = t; y = h;};\n17 border b4(t = h, H){x = l; y = t;};\n18 border b5(t = l, 0){x = t; y = H;};\n19 border b6(t = H, 0){x = 0; y = t;};\n20 \n21 mesh Th  =  buildmesh(b1(nn*L) + b2(nn*h) + b3(nn*(L-l)) + b4(nn*(H-h)) + b5(nn*l) + b6(nn*H));\n22 \n23 // Fespace\n24 fespace Vh(Th, P1); // Change P1 to P2 to test P2 finite element\n25 Vh u, v;\n26 \n27 // Macro\n28 macro grad(u) [dx(u), dy(u)] //\n29 \n30 // Problem\n31 problem Poisson (u, v, solver = CG, eps = -1.e-6)\n32     =  int2d(Th)(\n33         grad(u)' * grad(v)\n34    )\n35    + int2d(Th)(\n36         f * v\n37    )\n38    + on(b1, b2, b3, b4, b5, b6, u = g)\n39    ;\n40 \n41 // Mesh adaptation iterations\n42 real error  =  0.1;\n43 real coef  =  0.1^(1./5.);\n44 for (int i  =  0; i < NAdapt; i++){\n45    // Solve\n46    Poisson;\n47 \n48    // Plot\n49    plot(Th, u);\n50 \n51    // Adaptmesh\n52    Th  =  adaptmesh(Th, u, inquire = 1, err = error);\n53    error  =  error * coef;\n54 }\n\n\n\n\n\n\nFig. 181 Adapted mesh\n\n\n\n\n\nFig. 182 Solution on adapted mesh\n\n\nPoisson\n\n\nPoissons equation 3D\n 1 load \"tetgen\"\n 2 \n 3 // Parameters\n 4 real hh  =  0.1;\n 5 func ue  =  2.*x*x + 3.*y*y + 4.*z*z + 5.*x*y + 6.*x*z + 1.;\n 6 func f =  -18.;\n 7 \n 8 // Mesh\n 9 mesh Th  =  square(10, 20, [x*pi-pi/2, 2*y*pi]); // ]-pi/2, pi/2[X]0,2pi[\n10 func f1  =  cos(x)*cos(y);\n11 func f2  =  cos(x)*sin(y);\n12 func f3  =  sin(x);\n13 func f1x  =  sin(x)*cos(y);\n14 func f1y  =  -cos(x)*sin(y);\n15 func f2x  =  -sin(x)*sin(y);\n16 func f2y  =  cos(x)*cos(y);\n17 func f3x  =  cos(x);\n18 func f3y  =  0;\n19 func m11  =  f1x^2 + f2x^2 + f3x^2;\n20 func m21  =  f1x*f1y + f2x*f2y + f3x*f3y;\n21 func m22  =  f1y^2 + f2y^2 + f3y^2;\n22 func perio  =  [[4, y], [2, y], [1, x], [3, x]];\n23 real vv  =  1/square(hh);\n24 Th  =  adaptmesh(Th, m11*vv, m21*vv, m22*vv, IsMetric = 1, periodic = perio);\n25 Th  =  adaptmesh(Th, m11*vv, m21*vv, m22*vv, IsMetric = 1, periodic = perio);\n26 plot(Th);\n27 \n28 real[int] domain  =  [0., 0., 0., 1, 0.01];\n29 mesh3 Th3  =  tetgtransfo(Th, transfo = [f1, f2, f3], nbofregions = 1, regionlist = domain);\n30 plot(Th3);\n31 \n32 border cc(t = 0, 2*pi){x = cos(t); y = sin(t); label = 1;}\n33 mesh Th2  =  buildmesh(cc(50));\n34 \n35 // Fespace\n36 fespace Vh(Th3, P23d);\n37 Vh u, v;\n38 Vh uhe  =  ue;\n39 cout << \"uhe min: \" << uhe[].min << \" - max: \" << uhe[].max << endl;\n40 cout << uhe(0.,0.,0.) << endl;\n41 \n42 fespace Vh2(Th2, P2);\n43 Vh2 u2, u2e;\n44 \n45 // Macro\n46 macro Grad3(u) [dx(u), dy(u), dz(u)] //\n47 \n48 // Problem\n49 problem Lap3d (u, v, solver = CG)\n50      =  int3d(Th3)(\n51           Grad3(v)' * Grad3(u)\n52     )\n53     - int3d(Th3)(\n54           f * v\n55     )\n56     + on(0, 1, u = ue)\n57     ;\n58 \n59 // Solve\n60 Lap3d;\n61 cout << \"u min: \" << u[]. min << \" - max: \" << u[].max << endl;\n62 \n63 // Error\n64 real err  =  int3d(Th3)(square(u-ue));\n65 cout << int3d(Th3)(1.) << \"  =  \" << Th3.measure << endl;\n66 Vh d  =  ue - u;\n67 cout << \" err  =  \" << err << \" - diff l^intfy  =  \" << d[].linfty << endl;\n68 \n69 // Plot\n70 u2  =  u;\n71 u2e  =  ue;\n72 plot(u2, wait = true);\n73 plot(u2, u2e,wait = true);\n\n\n\n\n\nFig. 183 Iso-surfaces of the solution\n\n\n\n\nStokes Equation on a cube\n 1 load \"msh3\"\n 2 load \"medit\" // Dynamically loaded tools for 3D\n 3 \n 4 // Parameters\n 5 int nn  =  8;\n 6 \n 7 // Mesh\n 8 mesh Th0  =  square(nn, nn);\n 9 int[int] rup  =  [0, 2];\n10 int[int] rdown  =  [0, 1];\n11 int[int] rmid  =  [1, 1, 2, 1, 3, 1, 4, 1];\n12 real zmin  =  0, zmax  =  1;\n13 mesh3 Th  =  buildlayers(Th0, nn, zbound = [zmin, zmax],\n14     reffacemid = rmid, reffaceup = rup, reffacelow = rdown);\n15 \n16 medit(\"c8x8x8\", Th); // 3D mesh visualization with medit\n17 \n18 // Fespaces\n19 fespace Vh2(Th0, P2);\n20 Vh2 ux, uz, p2;\n21 \n22 fespace VVh(Th, [P2, P2, P2, P1]);\n23 VVh [u1, u2, u3, p];\n24 VVh [v1, v2, v3, q];\n25 \n26 // Macro\n27 macro Grad(u) [dx(u), dy(u), dz(u)] //\n28 macro div(u1,u2,u3) (dx(u1) + dy(u2) + dz(u3)) //\n29 \n30 // Problem (directly solved)\n31 solve vStokes ([u1, u2, u3, p], [v1, v2, v3, q])\n32      =  int3d(Th, qforder = 3)(\n33           Grad(u1)' * Grad(v1)\n34         + Grad(u2)' * Grad(v2)\n35         + Grad(u3)' * Grad(v3)\n36         - div(u1, u2, u3) * q\n37         - div(v1, v2, v3) * p\n38         + 1e-10 * q * p\n39     )\n40     + on(2, u1 = 1., u2 = 0, u3 = 0)\n41     + on(1, u1 = 0, u2 = 0, u3 = 0)\n42     ;\n43 \n44 // Plot\n45 plot(p, wait = 1, nbiso = 5); // 3D visualization of pressure isolines\n46 \n47 // See 10 plan of the velocity in 2D\n48 for(int i  =  1; i < 10; i++){\n49     // Cut plane\n50     real yy  =  i/10.;\n51     // 3D to 2D interpolation\n52     ux  =  u1(x,yy,y);\n53     uz  =  u3(x,yy,y);\n54     p2  =  p(x,yy,y);\n55     // Plot\n56     plot([ux, uz], p2, cmm = \"cut y  =  \"+yy, wait =  1);\n57 }\n\n\n\n\n\n\nFig. 184 Solution\n\n\n\n\n\nFig. 185 Associated mesh\n\n\nStokes\n\n\nCavity\n 1 //Parameters\n 2 int m  =  300;\n 3 real L  =  1;\n 4 real rho  =  500.;\n 5 real mu  =  0.1;\n 6 \n 7 real uin  =  1;\n 8 func fx  =  0;\n 9 func fy  =  0;\n10 int[int] noslip  =  [1, 2, 4];\n11 int[int] inflow  =  [3];\n12 \n13 real dt  =  0.1;\n14 real T  =  50;\n15 \n16 real eps  =  1e-3;\n17 \n18 //Macros\n19 macro div(u) (dx(u#x) + dy(u#y))//\n20 macro grad(u) [dx(u), dy(u)]//\n21 macro Grad(u) [grad(u#x), grad(u#y)]//\n22 \n23 //Time\n24 real cpu;\n25 real tabcpu;\n26 \n27 //mesh\n28 border C1(t  =  0, L){ x  =  t; y  =  0; label  =  1; }\n29 border C2(t  =  0, L){ x  =  L; y  =  t; label  =  2; }\n30 border C3(t  =  0, L){ x  =  L-t; y  =  L; label  =  3; }\n31 border C4(t  =  0, L){ x  =  0; y  =  L-t; label  =  4; }\n32 mesh th  =  buildmesh( C1(m) + C2(m) + C3(m) + C4(m) );\n33 \n34 fespace UPh(th, [P2,P2,P1]);\n35 UPh [ux, uy, p];\n36 UPh [uhx, uhy, ph];\n37 UPh [upx, upy, pp];\n38 \n39 //Solve\n40 varf navierstokes([ux, uy, p], [uhx, uhy, ph])\n41    =  int2d(th)(\n42       rho/dt* [ux, uy]'* [uhx, uhy]\n43     + mu* (Grad(u):Grad(uh))\n44     - p* div(uh)\n45     - ph* div(u)\n46     - 1e-10 *p*ph\n47     )\n48 \n49   + int2d(th) (\n50       [fx, fy]' * [uhx, uhy]\n51     + rho/dt* [convect([upx, upy], -dt, upx), convect([upx, upy], -dt, upy)]'* [uhx, uhy]\n52     )\n53 \n54   + on(noslip, ux = 0, uy = 0)\n55   + on(inflow, ux = uin, uy = 0)\n56   ;\n57 \n58 //Initialization\n59 [ux, uy, p] = [0, 0, 0];\n60 \n61 matrix<real> NS  =  navierstokes(UPh, UPh, solver = sparsesolver);\n62 real[int] NSrhs  =  navierstokes(0, UPh);\n63 \n64 //Time loop\n65 for(int j  =  0; j < T/dt; j++){\n66   [upx, upy, pp] = [ux, uy, p];\n67 \n68   NSrhs  =  navierstokes(0, UPh);\n69   ux[]  =  NS^-1 * NSrhs;\n70 \n71   plot( [ux,uy], p, wait = 0, cmm = j);\n72 }\n73 \n74 //CPU\n75 cout << \" CPU  =  \" << clock()-cpu << endl ;\n76 tabcpu  =  clock()-cpu;\n\n\n\n\n\n\n\t\t\n\t\t\t Previous topic: Examples\n\t\t\tNext topic: Mesh Generation \n\t\t\n\t","l":"examples/misc.html"},"26":{"t":"Parallelization","p":"\n\t\t\n   \nParallelization\n\nMPI-GMRES 2D\nTo launch this script, use for example:\n1 ff-mpirun -np 12 MPIGMRES2D.edp -d 1 -k 1 -gmres 2 -n 50\n\n\n  1 //usage :\n  2 //ff-mpirun [mpi parameter] MPIGMRES2d.edp [-glut ffglut] [-n N] [-k K] [-d D] [-ns] [-gmres [0|1]\n  3 //arguments:\n  4 //-glut ffglut : to see graphicaly the process\n  5 //-n N: set the mesh cube split NxNxN\n  6 //-d D: set debug flag D must be one for mpiplot\n  7 //-k K: to refined by K all element\n  8 //-ns: remove script dump\n  9 //-gmres\n 10 //0: use iterative schwarz algo.\n 11 //1: Algo GMRES on residu of schwarz algo\n 12 //2: DDM GMRES\n 13 //3: DDM GMRES with coarse grid preconditionner (Good one)\n 14 \n 15 load \"MPICG\"\n 16 load \"medit\"\n 17 load \"metis\"\n 18 include \"getARGV.idp\"\n 19 include \"MPIplot.idp\"\n 20 include \"MPIGMRESmacro.idp\"\n 21 \n 22 searchMethod  =  0; //more safe seach algo (warning can be very expensive in case of lot of ouside point)\n 23 assert(version > =  3.11); //need at least v3.11\n 24 real[int] ttt(10);\n 25 int ittt = 0;\n 26 macro settt {ttt[ittt++]  =  mpiWtime();}//\n 27 \n 28 // Arguments\n 29 verbosity  =  getARGV(\"-vv\", 0);\n 30 int vdebug  =  getARGV(\"-d\", 1);\n 31 int ksplit  =  getARGV(\"-k\", 3);\n 32 int nloc  =  getARGV(\"-n\", 10);\n 33 string sff  =  getARGV(\"-p\", \"\");\n 34 int gmres  =  getARGV(\"-gmres\", 2);\n 35 bool dplot  =  getARGV(\"-dp\", 0);\n 36 int nC  =  getARGV(\"-N\", max(nloc/10, 4));\n 37 \n 38 if (mpirank =  = 0 && verbosity){\n 39     cout << \"ARGV: \";\n 40     for (int i  =  0; i < ARGV.n; ++i)\n 41         cout << ARGV[i] << \" \";\n 42     cout << endl;\n 43 }\n 44 \n 45 if(mpirank =  = 0 && verbosity)\n 46 cout << \" vdebug: \" << vdebug << \", kspilt \"<< ksplit << \", nloc \"<< nloc << \", sff \"<< sff << \".\" << endl;\n 47 \n 48 // Parameters\n 49 int withplot  =  0;\n 50 bool withmetis  =  1;\n 51 bool RAS  =  1;\n 52 string sPk  =  \"P2-2gd\";\n 53 func Pk  =  P2;\n 54 int sizeoverlaps  =  1; //size of overlap\n 55 int[int] l111  =  [1, 1, 1, 1]; //mesh labels\n 56 \n 57 // MPI function\n 58 func bool plotMPIall(mesh &Th, real[int] &u, string cm){\n 59     if(vdebug)\n 60         PLOTMPIALL(mesh, Pk, Th, u, {cmm = cm, nbiso = 20, fill = 1, dim = 3, value = 1});\n 61     return 1;\n 62 }\n 63 \n 64 // MPI\n 65 mpiComm comm(mpiCommWorld,0,0); //trick : make a no split mpiWorld\n 66 \n 67 int npart  =  mpiSize(comm); //total number of partion\n 68 int ipart  =  mpiRank(comm); //current partition number\n 69 \n 70 int njpart  =  0; //Number of part with intersection (a jpart) with ipart without ipart\n 71 int[int] jpart(npart); //list of jpart\n 72 if(ipart =  = 0)\n 73     cout << \" Final N  =  \" << ksplit*nloc << \", nloc  =  \" << nloc << \", split  =  \" << ksplit << endl;\n 74 settt\n 75 \n 76 // Mesh\n 77 mesh Thg  =  square(nloc, nloc, label = l111);\n 78 mesh ThC  =  square(nC, nC, label = l111);// Coarse mesh\n 79 \n 80 mesh Thi, Thin; //with overlap, without olverlap\n 81 \n 82 // Fespace\n 83 fespace Phg(Thg, P0);\n 84 Phg part;\n 85 \n 86 fespace Vhg(Thg, P1);\n 87 Vhg unssd; //boolean function: 1 in the subdomain, 0 elswhere\n 88 \n 89 fespace VhC(ThC, P1); // of the coarse problem\n 90 \n 91 // Partitioning\n 92 {\n 93     int[int] nupart(Thg.nt);\n 94     nupart  =  0;\n 95     if (npart > 1 && ipart  =  =  0)\n 96         metisdual(nupart, Thg, npart);\n 97 \n 98     broadcast(processor(0, comm), nupart);\n 99     for(int i  =  0; i < nupart.n; ++i)\n100         part[][i]  =  nupart[i];\n101 }\n102 \n103 if (withplot > 1)\n104     plot(part, fill = 1, cmm = \"dual\", wait = 1);\n105 \n106 // Overlapping partition\n107 Phg suppi  =  abs(part-ipart) < 0.1;\n108 \n109 Thin  =  trunc(Thg, suppi>0, label = 10); // non-overlapping mesh, interfaces have label 10\n110 int nnn  =  sizeoverlaps*2;// to be sure\n111 AddLayers(Thg, suppi[], nnn, unssd[]); //see above! suppi and unssd are modified\n112 unssd[] * =  nnn; //to put value nnn a 0\n113 real nnn0  =  nnn - sizeoverlaps + 0.001;\n114 Thi  =  trunc(Thg, unssd>nnn0, label = 10); //overlapping mesh, interfaces have label 10\n115 \n116 settt\n117 \n118 // Fespace\n119 fespace Vhi(Thi,P1);\n120 int npij  =  npart;\n121 Vhi[int] pij(npij); //local partition of unit + pii\n122 Vhi pii;\n123 \n124 real nnn1  =  +0.001;\n125 {\n126     /*\n127     construction of the partition of the unit,\n128     let phi_i P1 FE function 1 on Thin and zero ouside of Thi and positive\n129     the partition is build with\n130     p_i  =  phi_i/ \\sum phi_i\n131 \n132     to build the partition of one domain i\n133     we nned to find all j such that supp(phi_j) \\cap supp(phi_j) is not empty\n134     < = > int phi_j\n135     */\n136     //build a local mesh of thii such that all computation of the unit partition are\n137     //exact in thii\n138     mesh Thii  =  trunc(Thg, unssd>nnn1, label = 10); //overlapping mesh, interfaces have label 10\n139 \n140     {\n141         //find all j mes (supp(p_j) cap supp(p_i)) >0\n142         //compute all phi_j on Thii\n143         //remark: supp p_i include in Thi\n144 \n145         // Fespace\n146         fespace Phii(Thii, P0);\n147         fespace Vhii(Thii, P1);\n148         Vhi sumphi  =  0;\n149         Vhii phii  =  0;\n150 \n151         jpart  =  0;\n152         njpart  =  0;\n153         int nlayer  =  RAS ? 1 : sizeoverlaps;\n154         if (ipart  =  =  0)\n155             cout << \"nlayer  =  \" << nlayer << endl;\n156         pii  =  max(unssd-nnn+nlayer, 0.)/nlayer;\n157         if(dplot)\n158             plot(pii, wait = 1, cmm = \" 0000\");\n159         sumphi[] + =  pii[];\n160         if(dplot)\n161             plot(sumphi, wait = 1, cmm = \" summ 0000\");\n162 \n163         real epsmes  =  1e-10*Thii.area;\n164         for (int i  =  0; i < npart; ++i)\n165             if (i ! =  ipart){\n166             Phii suppii  =  abs(i-part) < 0.2;\n167             if (suppii[].max > 0.5){\n168                 AddLayers(Thii, suppii[], nlayer, phii[]);\n169                 assert(phii[].min > =  0);\n170                 real interij  =  int2d(Thi)(phii);\n171                 if (interij > epsmes){\n172                     pij[njpart]  =  abs(phii);\n173                     if(vdebug > 2)\n174                         cout << \" ***** \" << int2d(Thi)(real(pij[njpart])<0) << \" \" <<pij[njpart][].min << \" \" << phii[].min << endl;\n175                     assert(int2d(Thi)(real(pij[njpart]) < 0)  =  =  0);\n176                     if(dplot)\n177                         plot(pij[njpart], wait = 1, cmm = \" j  =  \"+ i + \" \" + njpart);\n178                     sumphi[] + =  pij[njpart][];\n179                     if(dplot)\n180                         plot(sumphi, wait = 1, cmm = \" sum j  =  \"+ i + \" \" + njpart);\n181                     jpart[njpart++]  =  i;\n182                 }\n183             }\n184         }\n185 \n186         if(dplot)\n187             plot(sumphi, wait = 1, dim = 3, cmm = \"sum \", fill = 1);\n188         pii[]  =  pii[] ./ sumphi[];\n189         for (int j  =  0; j < njpart; ++j)\n190             pij[j][]  =  pij[j][] ./ sumphi[];\n191         jpart.resize(njpart);\n192         for (int j  =  0; j < njpart; ++j)\n193             assert(pij[j][].max < =  1);\n194         {\n195             cout << ipart << \" number of jpart \" << njpart << \" : \";\n196             for (int j  =  0; j < njpart; ++j)\n197                 cout << jpart[j] << \" \";\n198             cout << endl;\n199         }\n200         sumphi[]  =  pii[];\n201         for (int j  =  0; j < njpart; ++j)\n202             sumphi[] + =  pij[j][];\n203         if(vdebug > 2)\n204             cout << \"sum min \" << sumphi[].min << \" \" << sumphi[].max << endl;\n205         assert(sumphi[].min > 1.-1e-6 && sumphi[].max < 1.+1e-6);\n206     }\n207 } //Thii is remove here\n208 // end of the construction of the local partition of the unity ...\n209 // on Thi\n210 if (ipart  =  =  0)\n211     cout << \"End build partition\" << endl;\n212 \n213 // Computation of number of intersection\n214 //here pii and the pij is the local partition of the unit on\n215 //Thi (mesh with overlap)\n216 if ( dplot){\n217     plot(Thi, wait = 1);\n218     for(int j  =  0; j < njpart; ++j)\n219         plot(pij[j], cmm = \" j = \"+j, wait = 1);\n220 }\n221 \n222 //Partition of the unity on Thi\n223 //computation of message\n224 //all j > we have to receive\n225 //data on intersection of the support of pij[0] and pij[j]\n226 settt\n227 \n228 if(vdebug)\n229     plotMPIall(Thi, pii[], \"pi_i\");\n230 \n231 mesh[int] aThij(njpart);\n232 matrix Pii;\n233 matrix[int] sMj(njpart); //M of send to j\n234 matrix[int] rMj(njpart); //M to recv from j\n235 fespace Whi(Thi, Pk);\n236 mesh Thij  =  Thi;\n237 fespace Whij(Thij, Pk);//\n238 \n239 //construction of the mesh intersect i,j part\n240 for(int jp  =  0; jp < njpart; ++jp)\n241     aThij[jp]  =  trunc(Thi, pij[jp] > 1e-6, label = 10); //mesh of the supp of pij\n242 \n243 for(int jp  =  0; jp < njpart; ++jp)\n244     aThij[jp]  =  trunc(aThij[jp], 1, split = ksplit);\n245 \n246 Thi  =  trunc(Thi, 1, split = ksplit);\n247 \n248 settt\n249 \n250 if (ipart  =  =  0)\n251     cout << \"End build mesh intersection\" << endl;\n252 \n253 // Construction of transfert matrix\n254 {\n255     Whi wpii  =  pii;\n256     Pii  =  wpii[];\n257     for(int jp  =  0; jp < njpart; ++jp){\n258         int j  =  jpart[jp];\n259         Thij  =  aThij[jp];\n260         matrix I  =  interpolate(Whij, Whi); //Whji <- Whi\n261         sMj[jp]  =  I*Pii; //Whi -> s Whij\n262         rMj[jp]  =  interpolate(Whij, Whi, t = 1); //Whji -> Whi\n263         if(vdebug > 10){\n264             {Whi uuu = 1; Whij vvv = -1; vvv[]+ = I*uuu[]; cout << jp << \" %%% \" << vvv[].linfty << endl; assert(vvv[].linfty < 1e-6);}\n265             {Whi uuu = 1; Whij vvv = -1; vvv[]+ = rMj[jp]'*uuu[]; cout << jp << \" ### \" << vvv[].linfty << endl; assert(vvv[].linfty < 1e-6);}\n266         }\n267     }\n268 }\n269 if (ipart  =  =  0)\n270     cout << \"End build transfert matrix\" << endl;\n271 \n272 // Allocate array of send and recv data\n273 InitU(njpart, Whij, Thij, aThij, Usend) //initU(n, Vh, Th, aTh, U)\n274 InitU(njpart, Whij, Thij, aThij, Vrecv)\n275 if (ipart  =  =  0)\n276     cout << \"End init data for send/revc\" << endl;\n277 \n278 Whi ui, vi;\n279 \n280 func bool Update(real[int] &ui, real[int] &vi){\n281     for(int j  =  0; j < njpart; ++j)\n282         Usend[j][]  =  sMj[j]*ui;\n283     SendRecvUV(comm, jpart, Usend, Vrecv)\n284     vi  =  Pii*ui;\n285     for(int j  =  0; j < njpart; ++j)\n286         vi + =  rMj[j]*Vrecv[j][];\n287     return true;\n288 }\n289 \n290 // Definition of the Problem\n291 func G  =  x*0.1;\n292 func F  =  1.;\n293 macro grad(u) [dx(u),dy(u)] //\n294 varf vBC (U, V)  =  on(1, U = G);\n295 varf vPb (U, V)  =  int2d(Thi)(grad(U)'*grad(V)) + int2d(Thi)(F*V) + on(10, U = 0) + on(1, U = G);\n296 varf vPbC (U, V)  =  int2d(ThC)(grad(U)'*grad(V)) + on(1, U = 0);\n297 varf vPbon (U, V)  =  on(10, U = 1) + on(1, U = 1);\n298 varf vPbon10only (U, V)  =  on(10, U = 1) + on(1, U = 0);\n299 //remark the order is important we want 0 part on 10 and 1\n300 \n301 matrix Ai  =  vPb(Whi, Whi, solver = sparsesolver);\n302 matrix AC, Rci, Pci;\n303 \n304 if (mpiRank(comm)  =  =  0)\n305     AC  =  vPbC(VhC, VhC, solver = sparsesolver);\n306 \n307 Pci  =  interpolate(Whi, VhC);\n308 Rci  =  Pci'*Pii;\n309 \n310 real[int] onG10  =  vPbon10only(0, Whi);\n311 real[int] onG  =  vPbon(0, Whi);\n312 real[int] Bi = vPb(0, Whi);\n313 \n314 int kiter  =  -1;\n315 \n316 func bool CoarseSolve(real[int] &V, real[int] &U, mpiComm &comm){\n317     //solving the coarse probleme\n318     real[int] Uc(Rci.n), Bc(Uc.n);\n319     Uc  =  Rci*U;\n320     mpiReduce(Uc, Bc, processor(0, comm), mpiSUM);\n321     if (mpiRank(comm)  =  =  0)\n322         Uc  =  AC^-1*Bc;\n323     broadcast(processor(0, comm), Uc);\n324     V  =  Pci*Uc;\n325 }\n326 \n327 func real[int] DJ (real[int] &U){\n328     ++kiter;\n329     real[int] V(U.n);\n330     V  =  Ai*U;\n331     V  =  onG10 ? 0.: V; //remove internal boundary\n332     return V;\n333 }\n334 \n335 func real[int] PDJ (real[int] &U){\n336     real[int] V(U.n);\n337 \n338     real[int] b  =  onG10 ? 0. : U;\n339     V  =  Ai^-1*b;\n340     Update(V, U);\n341     return U;\n342 }\n343 \n344 func real[int] PDJC (real[int] &U){\n345     real[int] V(U.n);\n346     CoarseSolve(V, U, comm);\n347     V  =  -V; //-C2*Uo\n348     U + =  Ai*V; //U  =  (I-A C2) Uo\n349     real[int] b  =  onG10 ? 0. : U;\n350     U  =  Ai^-1*b; // (C1( I -A C2) Uo\n351     V  =  U -V;\n352     Update(V, U);\n353     return U;\n354 }\n355 \n356 func real[int] DJ0(real[int] &U){\n357     ++kiter;\n358     real[int] V(U.n);\n359     real[int] b  =  onG .* U;\n360     b  =  onG ? b : Bi ;\n361     V  =  Ai^-1*b;\n362     Update(V, U);\n363     V - =  U;\n364     return V;\n365 }\n366 \n367 Whi u  =  0, v;\n368 { //verification\n369     Whi u  =  1, v;\n370     Update(u[], v[]);\n371     u[] - =  v[];\n372     assert(u[].linfty < 1e-6);\n373 }\n374 \n375 settt\n376 u[]  =  vBC(0, Whi, tgv = 1); //set u with tgv BC value\n377 \n378 real epss  =  1e-6;\n379 int rgmres  =  0;\n380 if (gmres  =  =  1){\n381     rgmres  =  MPIAffineGMRES(DJ0, u[], veps = epss, nbiter = 300, comm = comm, dimKrylov = 100, verbosity = ipart ? 0: 50);\n382     real[int] b  =  onG .* u[];\n383     b  =  onG ? b : Bi;\n384     v[]  =  Ai^-1*b;\n385     Update(v[], u[]);\n386 }\n387 else if (gmres  =  =  2)\n388     rgmres  =  MPILinearGMRES(DJ, precon = PDJ, u[], Bi, veps = epss, nbiter = 300, comm = comm, dimKrylov = 100, verbosity = ipart ? 0: 50);\n389 else if (gmres  =  =  3)\n390     rgmres  =  MPILinearGMRES(DJ, precon = PDJC, u[], Bi, veps = epss, nbiter = 300, comm = comm, dimKrylov = 100, verbosity = ipart ? 0: 50);\n391 else //algo Shwarz for demo\n392     for(int iter  =  0; iter < 10; ++iter){\n393         real[int] b  =  onG .* u[];\n394         b  =  onG ? b : Bi ;\n395         v[]  =  Ai^-1*b;\n396 \n397         Update(v[], u[]);\n398         if(vdebug)\n399             plotMPIall(Thi, u[], \"u-\"+iter);\n400         v[] - =  u[];\n401 \n402         real err  =  v[].linfty;\n403         real umax  =  u[].max;\n404         real[int] aa  =  [err, umax], bb(2);\n405         mpiAllReduce(aa, bb, comm, mpiMAX);\n406         real errg  =  bb[0];\n407         real umaxg  =  bb[1];\n408 \n409         if (ipart  =  =  0)\n410             cout << ipart << \" err  =  \" << errg << \" u. max \" << umaxg << endl;\n411         if (errg < 1e-5) break;\n412     }\n413 \n414 if (vdebug)\n415     plotMPIall(Thi, u[], \"u-final\");\n416 \n417 settt\n418 \n419 real errg  =  1, umaxg;\n420 {\n421     real umax  =  u[].max, umaxg;\n422     real[int] aa  =  [umax], bb(1);\n423     mpiAllReduce(aa, bb, comm, mpiMAX);\n424     errg  =  bb[0];\n425     if (ipart  =  =  0)\n426         cout << \"umax global  =  \" << bb[0] << \" Wtime  =  \" << (ttt[ittt-1]-ttt[ittt-2]) << \" s \" << \" \" << kiter << endl;\n427 }\n428 \n429 if (sff ! =  \"\"){\n430     ofstream ff(sff+\".txt\", append);\n431     cout << \" ++++ \";\n432     cout << mpirank << \"/\" << mpisize << \" k = \" << ksplit << \" n =  \" << nloc << \" \" << sizeoverlaps << \" it =  \" << kiter;\n433     for (int i  =  1; i < ittt; ++i)\n434         cout << \" \" << ttt[i]-ttt[i-1] << \" \";\n435     cout << epss << \" \" << Ai.nbcoef << \" \" << Ai.n << endl;\n436 \n437     /*\n438     1 mpirank\n439     2 mpisize\n440     3 ksplit\n441     4 nloc\n442     5 sizeoverlaps\n443     6 kiter\n444     7 mesh & part build\n445     8 build the partion\n446     9 build mesh, transfere , and the fine mesh ..\n447     10 build the matrix, the trans matrix, factorizatioon\n448     11 GMRES\n449     */\n450 \n451     ff << mpirank << \" \" << mpisize << \" \" << sPk << \" \";\n452     ff << ksplit << \" \" << nloc << \" \" << sizeoverlaps << \" \" << kiter;\n453     for (int i  =  1; i < ittt; ++i)\n454         ff << \" \" << ttt[i]-ttt[i-1] << \" \";\n455     ff << epss << \" \" << Ai.nbcoef << \" \" << Ai.n << \" \" << gmres << endl;\n456 }\n\n\n\n\n\nFig. 220 Results\n\n\n\n\nMPI-GMRES 3D\n\nTodo\ntodo\n\n\n\nDirect solvers\n 1 load \"MUMPS_FreeFem\"\n 2 //default solver: real-> MUMPS, complex -> MUMPS\n 3 load \"real_SuperLU_DIST_FreeFem\"\n 4 default solver: real-> SuperLU_DIST, complex -> MUMPS\n 5 load \"real_pastix_FreeFem\"\n 6 //default solver: real-> pastix, complex -> MUMPS\n 7 \n 8 // Solving with pastix\n 9 {\n10     matrix A  = \n11         [[1, 2, 2, 1, 1],\n12         [ 2, 12, 0, 10 , 10],\n13         [ 2, 0, 1, 0, 2],\n14         [ 1, 10, 0, 22, 0.],\n15         [ 1, 10, 2, 0., 22]];\n16 \n17     real[int] xx  =  [1, 32, 45, 7, 2], x(5), b(5), di(5);\n18     b  =  A*xx;\n19     cout << \"b  =  \" << b << endl;\n20     cout << \"xx  =  \" << xx << endl;\n21 \n22     set(A, solver = sparsesolver, datafilename = \"ffpastix_iparm_dparm.txt\");\n23     cout << \"solve\" << endl;\n24     x  =  A^-1*b;\n25     cout << \"b  =  \" << b << endl;\n26     cout << \"x  =  \" << endl;\n27     cout << x << endl;\n28     di  =  xx - x;\n29     if (mpirank  =  =  0){\n30         cout << \"x-xx  =  \" << endl;\n31         cout << \"Linf  =  \" << di.linfty << \", L2  =  \" << di.l2 << endl;\n32     }\n33 }\n34 \n35 // Solving with SuperLU_DIST\n36 realdefaulttoSuperLUdist();\n37 //default solver: real-> SuperLU_DIST, complex -> MUMPS\n38 {\n39     matrix A  = \n40         [[1, 2, 2, 1, 1],\n41         [ 2, 12, 0, 10 , 10],\n42         [ 2, 0, 1, 0, 2],\n43         [ 1, 10, 0, 22, 0.],\n44         [ 1, 10, 2, 0., 22]];\n45 \n46     real[int] xx  =  [1, 32, 45, 7, 2], x(5), b(5), di(5);\n47     b  =  A*xx;\n48     cout << \"b  =  \" << b << endl;\n49     cout << \"xx  =  \" << xx << endl;\n50 \n51     set(A, solver = sparsesolver, datafilename = \"ffsuperlu_dist_fileparam.txt\");\n52     cout << \"solve\" << endl;\n53     x  =  A^-1*b;\n54     cout << \"b  =  \" << b << endl;\n55     cout << \"x  =  \" << endl;\n56     cout << x << endl;\n57     di  =  xx - x;\n58     if (mpirank  =  =  0){\n59         cout << \"x-xx  =  \" << endl;\n60         cout << \"Linf  =  \" << di.linfty << \", L2  =  \" << di.l2 << endl;\n61     }\n62 }\n63 \n64 // Solving with MUMPS\n65 defaulttoMUMPS();\n66 //default solver: real-> MUMPS, complex -> MUMPS\n67 {\n68     matrix A  = \n69         [[1, 2, 2, 1, 1],\n70         [ 2, 12, 0, 10 , 10],\n71         [ 2, 0, 1, 0, 2],\n72         [ 1, 10, 0, 22, 0.],\n73         [ 1, 10, 2, 0., 22]];\n74 \n75     real[int] xx  =  [1, 32, 45, 7, 2], x(5), b(5), di(5);\n76     b  =  A*xx;\n77     cout << \"b  =  \" << b << endl;\n78     cout << \"xx  =  \" << xx << endl;\n79 \n80     set(A, solver = sparsesolver, datafilename = \"ffmumps_fileparam.txt\");\n81     cout << \"solving solution\" << endl;\n82     x  =  A^-1*b;\n83     cout << \"b  =  \" << b << endl;\n84     cout << \"x  =  \" << endl;\n85     cout << x << endl;\n86     di  =  xx - x;\n87     if (mpirank  =  =  0){\n88         cout << \"x-xx  =  \" << endl;\n89         cout << \"Linf  =  \" << di.linfty << \", L2 \" << di.l2 << endl;\n90     }\n91 }\n\n\n\n\nSolver MUMPS\n  1 load \"MUMPS_FreeFem\"\n  2 \n  3 // Parameters\n  4 int[int] ICNTL(40); //declaration of ICNTL parameter for MUMPS\n  5 \n  6 //get value of ICNTL from file\n  7 if (mpirank  =  =  0){\n  8     ifstream ff(\"ffmumps_fileparam.txt\");\n  9     string line;\n 10     getline(ff, line);\n 11     getline(ff, line);\n 12     for (int iii  =  0; iii < 40; iii++){\n 13         ff >> ICNTL[iii];\n 14         getline(ff, line);\n 15     }\n 16 }\n 17 \n 18 broadcast(processor(0), ICNTL);\n 19 \n 20 // Given data of MUMPS solver in array lparams(SYM, PAR, ICNTL)\n 21 // There is no symmetric storage for a matrix associated with a sparse solver.\n 22 // Therefore, the matrix will be considered unsymmetric for parallel sparse solver even if symmetric.\n 23 {\n 24     // Problem\n 25     int SYM  =  0;\n 26     int PAR  =  1;\n 27     matrix A  = \n 28         [\n 29             [40, 0, 45, 0, 0],\n 30             [0, 12, 0, 0, 0],\n 31             [0, 0, 40, 0, 0],\n 32             [12, 0, 0, 22, 0],\n 33             [0, 0, 20, 0, 22]\n 34         ];\n 35 \n 36     // Construction of integer parameter for MUMPS\n 37     int[int] MumpsLParams(42);\n 38     MumpsLParams[0]  =  SYM;\n 39     MumpsLParams[1]  =  PAR;\n 40     for (int ii  =  0; ii < 40; ii++)\n 41         MumpsLParams[ii+2]  =  ICNTL[ii]; //ICNTL begin with index 0 here\n 42 \n 43     real[int] xx  =  [1, 32, 45, 7, 2], x(5), b(5), di(5);\n 44     b  =  A*xx;\n 45     if (mpirank  =  =  0)\n 46         cout << \"xx  =  \" << xx << endl;\n 47 \n 48     set(A, solver = sparsesolver, lparams = MumpsLParams); //we take the default value for CNTL MUMPS parameter\n 49 \n 50     // Solve\n 51     if (mpirank  =  =  0)\n 52         cout << \"Solve\" << endl;\n 53     x  =  A^-1*b;\n 54     if (mpirank  =  =  0)\n 55         cout << \"b  =  \" << b << endl;\n 56     if (mpirank  =  =  0)\n 57         cout << \"x  =  \" << endl; cout << x << endl;\n 58     di  =  xx-x;\n 59     if (mpirank  =  =  0){\n 60         cout << \"x-xx  =  \" << endl;\n 61         cout << \"Linf  =  \" << di.linfty << \", L2  =  \" << di.l2 << endl;\n 62     }\n 63 }\n 64 \n 65 // Read parameter of MUMPS solver in file ffmumps_fileparam.txt\n 66 {\n 67     // Problem\n 68     matrix A  = \n 69         [\n 70             [40, 0, 45, 0, 0],\n 71             [0, 12, 0, 0 , 0],\n 72             [0, 0, 40, 0, 0],\n 73             [12, 0, 0, 22, 0],\n 74             [0, 0, 20, 0, 22]\n 75         ];\n 76 \n 77     real[int] xx  =  [1, 32, 45, 7000, 2], x(5), b(5), di(5);\n 78     b  =  A*xx;\n 79     if (mpirank  =  =  0){\n 80         cout << \"b  =  \" << b << endl;\n 81         cout << \"xx  =  \" << xx << endl;\n 82     }\n 83 \n 84     set(A, solver = sparsesolver, datafilename = \"ffmumps_fileparam.txt\");\n 85 \n 86     // Solve\n 87     if (mpirank  =  =  0)\n 88         cout << \"Solve\" << endl;\n 89     x  =  A^-1*b;\n 90 \n 91     if (mpirank  =  =  0){\n 92         cout << \"b  =  \" << b << endl;\n 93         cout << \"x  =  \" << x << endl;\n 94     }\n 95     di  =  xx-x;\n 96     if (mpirank  =  =  0){\n 97         cout << \"x-xx  =  \" << endl;\n 98         cout << \"Linf  =  \" << di.linfty << \", L2  =  \" << di.l2 << endl;\n 99     }\n100 }\n\n\n\n\nSolver superLU_DIST\n\nTodo\nwrite code (SuperLU_DIST seems to have a bug)\n\n\n\nSolver PaStiX\n\nTodo\nwrite code (PaStiX seems to have a bug)\n\n\n\n\n\n\t\t\n\t\t\t Previous topic: Algorithms & Optimizations\n\t\t\tNext topic: Developers \n\t\t\n\t","l":"examples/parallelization.html"},"27":{"t":"Visualization","p":"\n\t\t\n   \nVisualization\n\nPlot\n 1 mesh Th  =  square(5,5);\n 2 fespace Vh(Th, P1);\n 3 \n 4 // Plot scalar and vectorial FE function\n 5 Vh uh = x*x+y*y, vh = -y^2+x^2;\n 6 plot(Th, uh, [uh, vh], value = true, wait = true);\n 7 \n 8 // Zoom on box defined by the two corner points [0.1,0.2] and [0.5,0.6]\n 9 plot(uh, [uh, vh], bb = [[0.1, 0.2], [0.5, 0.6]],\n10     wait = true, grey = true, fill = true, value = true);\n11 \n12 // Compute a cut\n13 int n  =  10;\n14 real[int] xx(10), yy(10);\n15 for (int i  =  0; i < n; i++){\n16     x  =  i/real(n);\n17     y  =  i/real(n);\n18     xx[i]  =  i;\n19     yy[i]  =  uh; // Value of uh at point (i/10., i/10.)\n20 }\n21 plot([xx, yy], wait = true);\n22 \n23 { // File for gnuplot\n24     ofstream gnu(\"plot.gp\");\n25     for (int i  =  0; i < n; i++)\n26         gnu << xx[i] << \" \" << yy[i] << endl;\n27 }\n28 \n29 // Calls the gnuplot command, waits 5 seconds and generates a postscript plot (UNIX ONLY)\n30 exec(\"echo 'plot \\\"plot.gp\\\" w l \\n pause 5 \\n set term postscript \\n set output \\\"gnuplot.eps\\\" \\n replot \\n quit' | gnuplot\");\n\n\n\n\n\n\nFig. 208 First plot\n\n\n\n\n\nFig. 209 Second plot\n\n\n\n\n\nFig. 210 Gnuplot\n\n\nPlot\n\n\nHSV\n 1 // From: http://en.wikipedia.org/wiki/HSV_color_space\n 2 // The HSV (Hue, Saturation, Value) model defines a color space\n 3 // in terms of three constituent components:\n 4 // HSV color space as a color wheel\n 5 // Hue, the color type (such as red, blue, or yellow):\n 6 // Ranges from 0-360 (but normalized to 0-100% in some applications like here)\n 7 // Saturation, the \"vibrancy\" of the color: Ranges from 0-100%\n 8 // The lower the saturation of a color, the more \"grayness\" is present\n 9 // and the more faded the color will appear.\n10 // Value, the brightness of the color: Ranges from 0-100%\n11 \n12 mesh Th  =  square(10, 10, [2*x-1, 2*y-1]);\n13 \n14 fespace Vh(Th, P1);\n15 Vh uh = 2-x*x-y*y;\n16 \n17 real[int] colorhsv = [ // Color hsv model\n18     4./6., 1 , 0.5, // Dark blue\n19     4./6., 1 , 1, // Blue\n20     5./6., 1 , 1, // Magenta\n21     1, 1. , 1, // Red\n22     1, 0.5 , 1 // Light red\n23     ];\n24  real[int] viso(31);\n25 \n26  for (int i  =  0; i < viso.n; i++)\n27     viso[i]  =  i*0.1;\n28 \n29  plot(uh, viso = viso(0:viso.n-1), value = true, fill = true, wait = true, hsv = colorhsv);\n\n\n\n\n\nFig. 211 Result\n\n\n\n\nMedit\n 1 load \"medit\"\n 2 \n 3 mesh Th  =  square(10, 10, [2*x-1, 2*y-1]);\n 4 \n 5 fespace Vh(Th, P1);\n 6 Vh u = 2-x*x-y*y;\n 7 \n 8 medit(\"u\", Th, u);\n 9 \n10 // Old way\n11 savemesh(Th, \"u\", [x, y, u*.5]); // Saves u.points and u.faces file\n12 // build a u.bb file for medit\n13 {\n14     ofstream file(\"u.bb\");\n15     file << \"2 1 1 \" << u[].n << \" 2 \\n\";\n16     for (int j  =  0; j < u[].n; j++)\n17         file << u[][j] << endl;\n18 }\n19 // Calls medit command\n20 exec(\"ffmedit u\");\n21 // Cleans files on unix-like OS\n22 exec(\"rm u.bb u.faces u.points\");\n\n\n\n\n\n\nFig. 212 2D plot\n\n\n\n\n\nFig. 213 Plot with elevation\n\n\nMedit\n\n\nParaview\n 1 load \"iovtk\"\n 2 \n 3 mesh Th  =  square(10, 10, [2*x-1, 2*y-1]);\n 4 \n 5 fespace Vh(Th, P1);\n 6 Vh u = 2-x*x-y*y;\n 7 \n 8 int[int] Order  =  [1];\n 9 string DataName  =  \"u\";\n10 savevtk(\"u.vtu\", Th, u, dataname = DataName, order = Order);\n\n\n\n\n\nFig. 214 Result\n\n\n\n\n\n\n\t\t\n\t\t\t Previous topic: Finite Element\n\t\t\tNext topic: Algorithms & Optimizations \n\t\t\n\t","l":"examples/visualization.html"},"28":{"t":"Welcome to FreeFEM documentation","p":"\n\t\t\n   \nWelcome to FreeFEM documentation\n\n\n\n\n\t\t\n\t\t\tNext topic: Introduction \n\t\t\n\t","l":"index.html"},"29":{"t":"Authors","p":"\n\t\t\n   \nAuthors\n\n\n\n\n\nFrdric Hecht\n\n\n\nProfessor at Laboratoire Jacques Louis Lions\n(LJLL), Sorbonne University, Paris\n\nfrederic.hecht@sorbonne-universite.fr\n\nhttps://www.ljll.math.upmc.fr/hecht/\n\n\n\n\n\n\n\n\nSylvain Auliac\n\n\n\nFormer PhD student at LJLL, optimization interface with\nnlopt,\nipopt,\ncmaes, \n\nhttps://www.ljll.math.upmc.fr/auliac/\n\n\n\n\n\n\n\n\nOlivier Pironneau\n\n\n\nProfessor of numerical analysis at the Paris VI university and at\nLJLL, numerical methods in fluid\n\nMember of the Institut Universitaire de\nFrance and Academie des\nSciences\n\nhttps://www.ljll.math.upmc.fr/pironneau/\n\n\n\n\n\n\n\n\nJacques Morice\n\n\n\nFormer Post-Doc at LJLL, three dimensions mesh generation and\ncoupling with\nmedit\n\n\n\n\n\n\n\n\nAntoine Le Hyaric\n\n\n\nCNRS research engineer at Laboratoire Jacques Louis\nLions, expert in\nsoftware engineering for scientific applications, electromagnetics\nsimulations, parallel computing and three-dimensionsal visualization\n\nhttps://www.ljll.math.upmc.fr/lehyaric/\n\n\n\n\n\n\n\n\nKohji Ohtsuka\n\n\n\nProfessor at Hiroshima Kokusai Gakuin\nUniversity, Japan and chairman of the\nWorld Scientific and Engineering Academy and\nSociety, Japan. Fracture dynamic, modeling\nand computing\n\nhttps://sites.google.com/a/comfos.org/comfos/\n\n\n\n\n\n\n\n\nPierre-Henri Tournier\n\n\n\nCNRS research engineer at Laboratoire Jacques Louis\nLions (LJLL), Sorbonne University, Paris\n\n\n\n\n\n\n\n\nPierre Jolivet\n\n\n\nCNRS researcher, MPI interface with PETSc, HPDDM, \n\nhttp://jolivet.perso.enseeiht.fr/\n\n\n\n\n\n\n\n\nFrdric Nataf\n\n\n\nCNRS senior researcher at Laboratoire Jacques Louis\nLions (LJLL), Sorbonne University, Paris\n\nhttps://www.ljll.math.upmc.fr/nataf/\n\n\n\n\n\n\n\n\nSimon Garnotel\n\n\n\nReasearch engineer at Airthium\n\nhttps://github.com/sgarnotel\n\n\n\n\n\n\n\n\nKarla Prez\n\n\n\nDeveloper, Airthium internship\n\nhttps://github.com/karlaprzbr\n\n\n\n\n\n\n\n\nLoan Cannard\n\n\n\nWeb designer, Airthium internship\n\nhttps://www.linkedin.com/in/loancannard\n\n\n\nAnd all the dedicated Github contributors\n\n\n\n\t\t\n\t\t\t Previous topic: Citation\n\t\t\tNext topic: Contributing \n\t\t\n\t","l":"introduction/authors.html"},"30":{"t":"Citation","p":"\n\t\t\n   \nCitation\n\nIf you use FreeFEM, please cite the following reference in your work:\n\nBibTeX\n 1 @article{MR3043640,\n 2   AUTHOR  =  {Hecht, F.},\n 3   TITLE  =  {New development in FreeFem++},\n 4   JOURNAL  =  {J. Numer. Math.},\n 5   FJOURNAL  =  {Journal of Numerical Mathematics},\n 6   VOLUME  =  {20}, YEAR  =  {2012},\n 7   NUMBER  =  {3-4}, PAGES  =  {251--265},\n 8   ISSN  =  {1570-2820},\n 9   MRCLASS  =  {65Y15},\n10   MRNUMBER  =  {3043640},\n11   URL  =  {https://freefem.org/}\n12 }\n\n\n\n\nAPA\n1 Hecht, F. (2012). New development in FreeFem++. Journal of numerical mathematics, 20(3-4), 251-266.\n\n\n\n\nISO690\n1 HECHT, Frdric. New development in FreeFem++. Journal of numerical mathematics, 2012, vol. 20, no 3-4, p. 251-266.\n\n\n\n\nMLA\n1 Hecht, Frdric. \"New development in FreeFem++.\" Journal of numerical mathematics 20.3-4 (2012): 251-266.\n\n\n\n\n\n\n\n\t\t\n\t\t\t Previous topic: History\n\t\t\tNext topic: Authors \n\t\t\n\t","l":"introduction/citation.html"},"31":{"t":"Contributing","p":"\n\t\t\n   \nContributing\n\nBug report\n\nConcerning the FreeFEM documentation\nOpen an Issue on FreeFem-doc repository.\n\n\nConcerning the FreeFEM compilation or usage\nOpen an Issue on FreeFem-sources repository.\n\n\n\nImprove content\nAsk one of the contributors for Collaborator Access or make a Pull Request.\n\n\n\n\n\t\t\n\t\t\t Previous topic: Authors\n\t\t\tNext topic: Learning by Examples \n\t\t\n\t","l":"introduction/contributing.html"},"32":{"t":"Download","p":"\n\t\t\n   \nDownload\n\nLatest binary packages\nFreeFEM v4.6 runs under macOS, Ubuntu, and 64-bit Windows.\n\n\n\n\n\n\n\n\nOperating System\nFreeFEM Version\nSize\nDate\n\n\n\nmacOS 10.10.5 or higher\n4.5\n412 MB\nFeb 11, 2020\n\nUbuntu 16.04 or higher\n4.6\n212 MB\nMar 02, 2020\n\n64-bit Windows             | 4.6           |  185 MB\nMar 02, 2020\n\nDocker image\n4.6\n487 MB\nMar 02, 2020\n\nSource 4.6\n4.6\n12.4 MB\nMar 02, 2020\n\nprevious releases\n-\n-\n-\n\n\n\nThe source code is available on the FreeFEM GitHub Repository.\n\nNote\nThe support ended for all releases under Windows 32 bits.\n\n\n\n\n\n\n\nSyntax highlighters\n\n\n\n\n\n\n\nLexer type\nVersion\nDescription\n\n\n\nEmacs\n0.3\nfreefem-mode.el\n\nTextmate 2\n1.0\nFreeFem.tmbundle\n\nGedit\n1.0\nffpp.lang\n\nAtom\n0.3\nlanguage-freefem or via the Atom package manager\n\nPygments\n1.0\nfreefem.py\n\nVim\n0.1\nedp.vim\n\n\n\n\n\n\n\n\t\t\n\t\t\t Previous topic: Installation guide\n\t\t\tNext topic: History \n\t\t\n\t","l":"introduction/download.html"},"33":{"t":"History","p":"\n\t\t\n   \nHistory\n\nThe project has evolved from MacFem, PCfem, written in Pascal.\nThe first C version lead to freefem 3.4; it offered mesh adaptivity on a single mesh only.\nA thorough rewriting in C++ led to freefem+ (freefem+ 1.2.10 was its last release), which included interpolation over multiple meshes (functions defined on one mesh can be used on any other mesh); this software is no longer maintained but is still in use because it handles a problem description using the strong form of the PDEs.\nImplementing the interpolation from one unstructured mesh to another was not easy because it had to be fast and non-diffusive; for each point, one had to find the containing triangle.\nThis is one of the basic problems of computational geometry (see [PREPARATA1985] for example).\nDoing it in a minimum number of operations was the challenge.\nOur implementation is \\(\\mathcal{O}(n log n)\\) and based on a quadtree.\nThis version also grew out of hand because of the evolution of the template syntax in C++.\nWe have been working for a few years now on FreeFEM , entirely re-written again in C++ with a thorough usage of template and generic programming for coupled systems of unknown size at compile time.\nLike all versions of freefem, it has a high level user friendly input language which is not too far from the mathematical writing of the problems.\nThe freefem language allows for a quick specification of any partial differential system of equations.\nThe language syntax of FreeFEM is the result of a new design which makes use of the STL [STROUSTRUP2000], templates, and bison for its implementation; more details can be found in [HECHT2002].\nThe outcome is a versatile software in which any new finite elements can be included in a few hours; but a recompilation is then necessary.\nTherefore the library of finite elements available in FreeFEM will grow with the version number and with the number of users who program more new elements.\nSo far we have discontinuous \\(P_0\\) elements,linear \\(P_1\\) and quadratic \\(P_2\\) Lagrangian elements, discontinuous \\(P_1\\) and Raviart-Thomas elements and a few others like bubble elements.\n\n\n\n\n\n\nThe development of FreeFEM through more than 30 years\n\n\n\n1987\n\nMacFem/PCFem the old ones (O. Pironneau in Pascal) no free.\n\n1992\n\nFreeFem rewrite in C++ (P1,P0 one mesh ) O. Pironneau, D. Bernardi, F.Hecht (mesh adaptation , bamg) , C. Prudhomme .\n\n1996\n\nFreeFem+ rewrite in C++ (P1,P0 more mesh) O. Pironneau, D. Bernardi, F.Hecht (algebra of function).\n\n1998\n\nFreeFem++ rewrite with an other finite element kernel and an new language F. Hecht, O. Pironneau, K.Ohtsuka.\n\n1999\n\nFreeFem 3d (S. Del Pino),  a fist 3d version base on fictitious domaine method.\n\n2008\n\nFreeFem++ v3 use a new finite element kernel multidimensionnels: 1d,2d,3d\n\n2014\n\nFreeFem++ v3.34 parallel version\n\n2017\n\nFreeFem++ v3.57 parallel version\n\n2018\n\nFreeFem++ v4: New matrix type, Surface element, New Parallel tools \n\n\n\n\n\t\t\n\t\t\t Previous topic: Download\n\t\t\tNext topic: Citation \n\t\t\n\t","l":"introduction/history.html"},"34":{"t":"Introduction","p":"\n\t\t\n   \n\n\n\n\n\n\n  FreeFEM  \n Fourth edition, Version 4.8 \n\n\n\n\n\n      \n        Frdric Hecht  \n\n            Laboratoire Jacques-Louis Lions, Sorbonne University, Paris\n      \n      \n  \n     The user manual is available \n  \n      \n      \n      \n    \n      The FreeFEM v3 PDF is archived (not up to date)\n    \n    \n      Official version (English)\n      Spanish version, by Eliseo Chacn Vera \n      Chinese version () \n              Japanese version, by Kohji Ohtsuka\n    \n  \n\n\n\n\n\n\n\nIntroduction\nFreeFEM is a partial differential equation solver for non-linear multi-physics systems in 1D, 2D, 3D and 3D border domains (surface and curve).\nProblems involving partial differential equations from several branches of physics, such as fluid-structure interactions, require interpolations of data on several meshes and their manipulation within one program.\nFreeFEM includes a fast interpolation algorithm and a language for the manipulation of data on multiple meshes.\nFreeFEM is written in C++ and its language is a C++ idiom.\n\n\n\n\nFreeFEM currently interfaces to the following libraries:\n\nARPACK\nBLAS\nOpenBLAS\nFFTW 3.3.2\nIpopt 3.12.4\nGmm++ 4.2\nfreeYams\nMETIS\n\n\nParMETIS\nMmg\nmshmet\nMUMPS\nNLopt 2.2.4\nScaLAPACK\nScotch\nSuiteSparse\n\n\nSuperLU\nTetGen\nPETSc\nSLEPc\nHTool\nHPDDM\nBemTool\nParMmg\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n        \n\n\n\n\t\t\n\t\t\t Previous topic: Welcome to FreeFEM documentation\n\t\t\tNext topic: Version 4.5: new features \n\t\t\n\t","l":"introduction/index.html"},"35":{"t":"Installation guide","p":"\n\t\t\n   \nInstallation guide\nTo use FreeFEM, two installation methods are available: user access (binary package) and access developers (from the source code).\nFollow the section corresponding to your type of installation.\n\nNote\nSince the version 4.5, FreeFEM relese provides with the last version of PETSc.\n\n\n\n\n\n\nUsing binary package\nFirst, open the following web page download page and choose your platform: Linux, MacOS or Windows.\n\nNote\nBinary packages are available for Microsoft Windows, MacOS and some Linux distributions. Since the release 4.5, FreeFEM binaries provide with the current version of PETSc.\n\nInstall FreeFEM by double-clicking on the appropriate file. Under Linux and MacOS the install directory is one of the following /usr/local/bin, /usr/local/share/freefem++, /usr/local/lib/ff++\n\nWindows installation\n\nNote\nThe windows package is build for Window 7 64bits. The support ended for all releases under Windows 32 bits since the V4.\n\nFirst download the windows installation executable, then double click to install FreeFEM.\nInstall MSMPI for parallel version under window64 MS MPI V10.1.2, and install both msmpisdk.msi and MSMpiSetup.exe.\nIn most cases just answer yes (or type return) to all questions.\nOtherwise in the Additional Task windows, check the box Add application directory to your system path. This is required otherwise the program ffglut.exe will not be found.\nBy now you should have two new icons on your desktop:\n\nFreeFem++ (VERSION).exe, the freefem++ application.\nFreeFem++ (VERSION) Examples, a link to the freefem++ examples folder.\n\nwhere (VERSION) is the version of the files (for example 4.5).\nBy default, the installed files are in C:\\Programs Files\\FreeFem++. In this directory, you have all the .dll files and other applications: FreeFem++-nw.exe, ffglut.exe,  The syntax for the command-line tools are the same as those of FreeFem.exe.\nTo use FreeFEM binaries under Windows, two methods are possible:\n\nUse the FreeFEM launcher (launchff++.exe)\n\nWarning: if you launch FreeFEM without filename script by double-clicking, your get a error due (it is bug of usage GetOpenFileName in win64).\n\nIn shell terminal (cmd, powershell, bash,  ):\n\nTo launch sequential version:\n\n1 C:\\>\"Program Files (x86)\\FreeFem++\\FreeFem++.exe\" <mySequentialScript.edp>\n\n\n\nTo launch parallel version:\n\n1 C:\\>\"Program Files\\Microsoft MPI\\Bin\\mpiexec.exe\" -n <nbProcs> C:\\>\"Program Files (x86)\\FreeFem++\\FreeFem++-mpi.exe\" <myParallelScript.edp>\n\n\n\n\n\n\nmacOS X installation\nDownload the macOS X binary version file, extract all the files by double clicking on the icon of the file, go the the directory and put the FreeFem++.app application in the /Applications directory.\nIf you want terminal access to FreeFEM just copy the file FreeFem++ in a directory of your $PATH shell environment variable.\n\n\nUbuntu installation\n\nNote\nThe Debian package is built for Ubuntu 16.04\n\nBeforehand, install the following dependances libraries using the apt tool:\n1 sudo apt-get install libgsl-dev libhdf5-dev\n2              liblapack-dev libopenmpi-dev freeglut3-dev\n\n\nDownload the package FreeFEM .deb, install it by the command\n1 dpkg -i FreeFEM_VERSION_Ubuntu_withPETSc_amd64.deb\n\n\nFreeFEM is directly available in your terminal by the command FreeFem++.\n\n\nArch AUR package\nAn up-to-date package of FreeFEM for Arch is available on the Archlinux user repository.\nTo install it:\n1 git clone https://aur.archlinux.org/freefem++-git.git\n2 cd freefem++-git\n3 makepkg -si\n\n\n\nNote\nThanks to Stephan Husmann\n\n\n\nFedora installation\nPackages are available in the\nFedora Repositories,\nand they are managed by the\nFedora SciTech special interest group.\nThe packages are usually recent builds, but may not be the latest released version.\nYou can install them using the dnf tool, for both the serial and parallel (MPI)\nversions. :\n1 sudo dnf install freefem++\n2 sudo dnf install freefem++-openmpi\n3 sudo dnf install freefem++-mpich\n\n\nFreeFEM is directly available in your terminal by the command FreeFem++.\nTo use the OpenMPI version, in your terminal first load the OpenMPI module,\nfor example using\n1 module load mpi/openmpi-x86_64\n\n\nand then the command FreeFem++-mpi_openmpi will be available in your\nterminal. To use the MPICH version, in your terminal first load the MPICH\nmodule using\n1 module load mpi/mpich-x86_64\n\n\nand then the command FreeFem++-mpi_mpich will be available in your\nterminal.\n\n\n\nCompiling source code\n\nVarious versions of FreeFEM are possible:\nsequential and without plugins (contains in 3rdparty)\nparallel with plugins (and with PETSc).\n\n\n\nNote\nWe advise you to use the package manager for macOS Homebrew to get the different packages required avalaible here\n\n\n\n\n\nCompilation on OSX (> = 10.13)\n\nInstall Xcode, Xcode Command Line tools and Xcode Additional Tools from the Apple website\nInstall gfortran from Homebrew\n1  brew cask install gfortran\n\n\n\n\n\nNote\nIf you have installed gcc via brew, gfortran comes with it and you do not need this line\n\n\nTo use FreeFEM parallel version, install openmpi  or  mpich\n1  # to install openmpi\n2  curl -L https://download.open-mpi.org/release/open-mpi/v4.0/openmpi-4.0.1.tar.gz --output openmpi-4.0.1.tar.gz\n3  tar xf openmpi-4.0.1\n4  cd openmpi-4.0.1/\n5  # to install mpich\n6  curl -L http://www.mpich.org/static/downloads/3.3.2/mpich-3.3.2.tar.gz --output mpich-3.3.2.tar.gz\n7  tar xf mpich-3.3.2\n8  cd mpich-3.3.2\n\n\n4  # with brew gcc gfortran compilers\n5  ./configure CC = clang CXX = clang++ FC = gfortran-9 F77 = gfortran-9 --prefix = /where/you/want/to/have/files/installed\n6 \n7  # with LLVM gcc and brew gfortran compilers\n8  ./configure CC = gcc-9 CXX = g++-9 FC = gfortran-9 F77 = gfortran-9 --prefix = /where/you/want/to/have/files/installed\n\n\n5  make -j<nbProcs>\n6  make -j<nbProcs> install\n\n\n\nInstall the minimal libraries for FreeFEM\n1 brew install m4 git flex bison\n\n\n\nIf you want build your own configure according your system, install autoconf and automake from Homebrew (optional, see note in step 10)\n1 brew install autoconf automake\n\n\n\nTo use FreeFEM with its plugins, install from Homebrew suitesparse, hdf5, cmake, wget\n1 brew install suitesparse hdf5 cmake wget\n\n\n\nInstall gsl\n1 curl -O http://mirror.cyberbits.eu/gnu/gsl/gsl-2.5.tar.gz\n2 tar zxvf gsl-2.5.tar.gz\n3 cd gsl-2.5\n4 ./configure\n5 make -j<nbProcs>\n6 make -j<nbProcs> install --prefix = /where/you/want/to/have/files/installed\n\n\n\nDownload the latest Git for Mac installer git and the FreeFEM source from the repository\n1 git clone https://github.com/FreeFem/FreeFem-sources.git\n\n\n\nConfigure your source code\n1  cd FreeFem-sources\n2  autoreconf -i\n\n\n\nNote\nif your autoreconf version is too old, do tar zxvf AutoGeneratedFile.tar.gz\n\n\nfollowing your compilers\n\n3 // with brew gcc gfortran compilers\n4 ./configure --enable-download CC = clang CXX = clang++ F77 = gfortran-9\n5     FC = gfortran-9 --prefix = /where/you/want/to/have/files/installed\n6 \n7 // with LLVM gcc and brew gfortran compilers\n8 ./configure --enable-download CC = clang CXX = clang++ F77 = gfortran-9\n9     FC = gfortran-9 --prefix = /where/you/want/to/have/files/installed\n\n\n\nDownload the 3rd party packages to use FreeFEM plugins\n\n\n1 ./3rdparty/getall -a\n\n\n\nNote\nAll the third party packages have their own licence\n\n\n\nIf you want use PETSc/SLEPc and HPDDM (High Performance Domain Decomposition Methods)\n\n\n1 cd 3rdparty/ff-petsc\n2 make petsc-slepc // add SUDO = sudo if your installation directory is the default /usr/local\n3 cd -\n4 ./reconfigure\n\n\n\n\nBuild your FreeFEM library and executable\n\n\n1 make -j<nbProcs>\n2 make -j<nbProcs> check\n\n\n\nNote\nmake check is optional, but advised to check the validity of your FreeFEM build\n\n\n\n\nInstall the FreeFEM apllicationmake install // add SUDO = sudo might be necessary\n\n\n\n\n\n\nNote\nit isnt necessary to execute this last command, FreeFEM executable is avalaible here your_installation/src/nw/FreeFem++ and mpi executable here your_installation/src/mpi/ff-mpirun.\n\n\n\n\nCompilation on Ubuntu\n\nInstall the following packages on your system\n1 sudo apt-get update && sudo apt-get upgrade\n2 sudo apt-get install cpp freeglut3-dev g++ gcc gfortran \\\n3     m4 make patch pkg-config wget python unzip \\\n4     liblapack-dev libhdf5-dev libgsl-dev \\\n5     autoconf automake autotools-dev bison flex gdb git cmake\n6 \n7 # mpich is required for the FreeFEM parallel computing version\n8 sudo apt-get install mpich\n\n\n\nWarning\nIn the oldest distribution of Ubuntu, libgsl-dev does not exist, use libgsl2-dev instead\n\n\nDownload FreeFEM source from the repository\n1 git clone https://github.com/FreeFem/FreeFem-sources.git\n\n\n\nAutoconf\n1 cd FreeFem-sources\n2 autoreconf -i\n\n\n\nNote\nif your autoreconf version is too old, do tar zxvf AutoGeneratedFile.tar.gz\n\n\nConfigure\n1 ./configure --enable-download --enable-optim\n2     --prefix = /where/you/want/to/have/files/installed\n\n\n\nNote\nTo see all the options, type ./configure --help\n\n\nDownload the 3rd party packages\n1 ./3rdparty/getall -a\n\n\n\nNote\nAll the third party packages have their own licence\n\n\nIf you want use PETSc/SLEPc and HPDDM (High Performance Domain Decomposition Methods) for massively parallel computing\n1 cd 3rdparty/ff-petsc\n2 make petsc-slepc // add SUDO = sudo if your installation directory is the default /usr/local\n3 cd -\n4 ./reconfigure\n\n\n\nBuild your FreeFEM library and executable\n1 make -j<nbProcs>\n2 make -j<nbProcs> check\n\n\n\nNote\nmake check is optional, but advised to check the validity of your FreeFEM build\n\n\nInstall the executable\n1 make install\n\n\n\nNote\nit isnt necessary to execute this last command, FreeFEM executable is avalaible here your_installation/src/nw/FreeFem++ and mpi executable here your_installation/src/mpi/ff-mpirun\n\n\n\n\n\nCompilation on Arch Linux\n\nWarning\nAs Arch is in rolling release, the following information can be quickly outdated !\n\n\nWarning\nFreeFEM fails to compile using the newest version of gcc 8.1.0, use an older one instead.\n\n\nInstall the following dependencies:\n1 pacman -Syu\n2 pacman -S git openmpi gcc-fortran wget python\n3     freeglut m4 make patch gmm\n4     blas lapack hdf5 gsl fftw arpack suitesparse\n5     gnuplot autoconf automake bison flex gdb\n6     valgrind cmake texlive-most\n\n\n\nDownload the FreeFEM source from the repository\n1 git clone https://github.com/FreeFem/FreeFem-sources.git\n\n\n\nAutoconf\n1 cd FreeFem-sources\n2 autoreconf -i\n\n\n\nConfigure\n1 ./configure --enable-download --enable-optim\n\n\n\nNote\nTo see all the options, type ./configure --help\n\n\nDownload the packages\n1 ./3rdparty/getall -a\n\n\n\nNote\nAll the third party packages have their own licence\n\n\nIf you want use HPDDM (High Performance Domain Decomposition Methods) for massively parallel computing, install PETSc/SLEPc\n1 cd 3rdparty/ff-petsc\n2 make petsc-slepc SUDO = sudo\n3 cd -\n4 ./reconfigure\n\n\n\nCompile the FreeFEM source\n1 make\n\n\n\nNote\nIf your computer has many threads, you can run make in parallel using make -j16 for 16 threads, for example.\n\n\nNote\nOptionally, check the compilation with make check\n\n\nInstall the FreeFEM application\n1 sudo make install\n\n\n\n\n\n\nCompilation on Fedora\n\nInstall the following packages on your system\n 1 sudo dnf update\n 2 sudo dnf install freeglut-devel gcc-gfortran gcc-c++ gcc \\\n 3                   m4 make wget python2 python3 unzip \\\n 4                   lapack-devel hdf5-devel gsl gsl-devel \\\n 5                   autoconf automake bison flex gdb git cmake\n 6 \n 7 # MPICH or OpenMPI is required for the FreeFEM parallel computing version\n 8 sudo dnf install mpich-devel\n 9 sudo dnf install openmpi-devel\n10 \n11 # Then load one of the modules, for example\n12 module load mpi/mpich-x86_64\n13 # or\n14 module load mpi/openmpi-x86_64\n\n\n\nDownload FreeFEM source from the repository\n1 git clone https://github.com/FreeFem/FreeFem-sources.git\n\n\n\nAutoconf\n1 cd FreeFem-sources\n2 autoreconf -i\n\n\n\nNote\nif your autoreconf version is too old, do tar zxvf AutoGeneratedFile.tar.gz\n\n\nConfigure\n1 ./configure --enable-download --enable-optim\n2     --prefix = /where/you/want/to/have/files/installed\n\n\n\nNote\nTo see all the options, type ./configure --help\n\n\nDownload the 3rd party packages\n1 ./3rdparty/getall -a\n\n\n\nNote\nAll the third party packages have their own licence\n\n\nIf you want use PETSc/SLEPc and HPDDM (High Performance Domain Decomposition Methods) for massively parallel computing\n1 cd 3rdparty/ff-petsc\n2 make petsc-slepc // add SUDO = sudo if your installation directory is the default /usr/local\n3 cd -\n4 ./reconfigure\n\n\n\nBuild your FreeFEM library and executable\n1 make -j<nbProcs>\n2 make -j<nbProcs> check\n\n\n\nNote\nmake check is optional, but advised to check the validity of your FreeFEM build\n\n\nInstall the executable\n1 make install\n\n\n\nNote\nit isnt necessary to execute this last command, FreeFEM executable is avalaible here your_installation/src/nw/FreeFem++ and mpi executable here your_installation/src/mpi/ff-mpirun\n\n\n\n\n\nCompilation on Linux with Intel software tools\nFollow the guide\n\n\nCompilation on Windows\n\nWarning\nThe support ended for all releases under Windows 32 bits since the V4.\nWe assume your development machine is 64-bit, and you want your compiler to target 64-bit windows by default.\n\n\nInstall the Microsoft MPI v10.1.2 (archived) (msmpisdk.msi and MSMpiSetup.exe)\nDownload msys2-x86_64-latest.exe (x86_64 version) and run it.\nInstall the version control system Git for Windows\n\n4. In the MSYS2 shell, execute the following.\nHint: if you right click the title bar, go to Options -> Keys and tick Ctrl+Shift+letter shortcuts you can use Ctrl+Shift+V to paste in the MSYS shell.\n\n1 pacman -Syuu\n\n\n\nClose the MSYS2 shell once youre asked to. There are now 3 MSYS subsystems installed: MSYS2, MinGW32 and MinGW64.\nThey can respectively be launched from C:devmsys64msys2.exe, C:devmsys64mingw32.exe and C:devmsys64mingw64.exe\nReopen MSYS2 (doesnt matter which version, since were merely installing packages).\nRepeatedly run the following command until it says there are no further updates. You might have to restart your shell again.\n\n1 pacman -Syuu\n\n\n\n\nNow that MSYS2 is fully up-to-date, install the following dependancies\n\nfor 64 bit systems:\n\n1 pacman -S autoconf make automake-wrapper bison git \\\n2   mingw-w64-x86_64-freeglut mingw-w64-x86_64-toolchain \\\n3   mingw-w64-x86_64-openblas patch python perl pkg-config pkgfile \\\n4   rebase tar time tzcode unzip which mingw-w64-x86_64-libmicroutils \\\n5   --ignore mingw-w64-x86_64-gcc-ada --ignore mingw-w64-x86_64-gcc-objc \\\n6   --ignore mingw-w64-x86_64-gdb mingw-w64-x86_64-cmake --noconfirm\n\n\n\nfor 32 bit systems (FreeFEM lower than version 4):\n\n1 pacman -S autoconf automake-wrapper bash bash-completion \\\n2   bison bsdcpio bsdtar bzip2 coreutils curl dash file filesystem \\\n3   findutils flex gawk gcc gcc-fortran gcc-libs grep gzip inetutils \\\n4   info less lndir make man-db git mingw-w64-i686-freeglut \\\n5   mingw-w64-i686-toolchain mingw-w64-i686-gsl mingw-w64-i686-hdf5 \\\n6   mingw-w64-i686-openblas mintty msys2-keyring msys2-launcher-git \\\n7   msys2-runtime ncurses pacman pacman-mirrors pactoys-git patch pax-git \\\n8   perl pkg-config pkgfile rebase sed tar tftp-hpa time tzcode unzip \\\n9   util-linux which\n\n\n\nOpen a MingW64 terminal (or MingW32 for old 32 bit FreeFEM version) and compile the FreeFEM source\n1 git clone https://github.com/FreeFem/FreeFem-sources\n2 cd FreeFem-sources\n3 autoreconf -i\n4 ./configure --enable-generic --enable-optim \\\n5   --enable-download --enable-maintainer-mode \\\n6   CXXFLAGS = -mtune = generic CFLAGS = -mtune = generic \\\n7   FFLAGS = -mtune = generic --enable-download --disable-hips\n8           --prefix = /where/you/want/to/have/files/installed\n\n\n\nIf you want use HPDDM (High Performance Domain Decomposition Methods) for massively parallel computing, install PETSc/SLEPc\n1 cd 3rdparty/ff-petsc\n2 make petsc-slepc SUDO = sudo\n3 cd -\n4 ./reconfigure\n\n\n\nDownload the 3rd party packages and build your FreeFEM library and executable\n1 ./3rdparty/getall -a\n2 make\n3 make check\n4 make install\n\n\n\nNote\nThe FreeFEM executable (and some other like ffmedit, ) are in C:\\msys64\\mingw64\\bin (or C:\\msys32\\mingw32\\bin).\n\n\n\n\n\n\nFreeFEM continuous integration\nThe Inria Jenkins platform is used for the CI/CD integration of the source code.\nCompilation results of the develop branch by OS type and configuration of FreeFEM are here\n\n\n\n\n\n\n\n\n\n\nBranch\nLinux 16.04\nLinux 18.04\nMacOS 10.10.5\nMacOS 10.13.5\nWindows 7\n\n\n\nDevelop\n\n\n\n\n\n\nDevelop\nmpich and PETSc/SLEPc\n\n\n\n\n\nMSMPI V10.1.2\n\nDevelop\nopenmpi and PETSc/SLEPc\n\n\n\n\n\n\n\n\n\n\nEnvironment variables and init file\nFreeFEM reads a users init file named freefem++.pref to initialize global variables: verbosity, includepath, loadpath.\n\nNote\nThe variable verbosity changes the level of internal printing (0: nothing unless there are syntax errors, 1: few, 10: lots, etc. ), the default value is 2.\nThe included files are found in the includepath list and the load files are found in the loadpath list.\n\nThe syntax of the file is:\n1 verbosity  =  5\n2 loadpath + =  \"/Library/FreeFem++/lib\"\n3 loadpath + =  \"/Users/hecht/Library/FreeFem++/lib\"\n4 includepath + =  \"/Library/FreeFem++/edp\"\n5 includepath + =  \"/Users/hecht/Library/FreeFem++/edp\"\n6 # This is a comment\n7 load + =  \"funcTemplate\"\n8 load + =  \"myfunction\"\n9 load + =  \"MUMPS_seq\"\n\n\nThe possible paths for this file are\n\nunder Unix and MacOs\n\n1 /etc/freefem++.pref\n2 $(HOME)/.freefem++.pref\n3 freefem++.pref\n\n\n\nunder windows\n\n1 freefem++.pref\n\n\nWe can also use shell environment variables to change verbosity and the search rule before the init files.\n1 export FF_VERBOSITY = 50\n2 export FF_INCLUDEPATH = \"dir;;dir2\"\n3 export FF_LOADPATH = \"dir;;dir3\"\n\n\n\nNote\nThe separator between directories must be ; and not : because : is used under Windows.\n\n\nNote\nTo show the list of init of FreeFEM , do\n1 export FF_VERBOSITY = 100;\n2 ./FreeFem++-nw\n\n\n\n\n\n\n\n\n\nColoring Syntax FreeFem++\n\nAtom\nIn order to get the syntax highlighting in Atom, you have to install the FreeFEM language support.\nYou can do it directly in Atom: Edit -> Preferences -> Install, and search for language-freefem-offical.\nTo launch scripts directly from Atom, you have to install the atom-runner package. Once installed, modify the Atom configuration file (Edit -> Config) to have something like that:\n1 \"*\":\n2    ...\n3 \n4    runner:\n5       extensions:\n6          edp: \"FreeFem++\"\n7       scopes:\n8          \"Freefem++\": \"FreeFem++\"\n\n\nReboot Atom, and use Alt+R to run a FreeFem++ script.\n\n\nGedit\nIn order to get the syntax highlighting in Gedit, you have to downlaod the Gedit parser and copy it in /usr/share/gtksourceview-3.0/language-specs/.\n\n\nTextmate 2, an editor under macOS\nTo use the coloring FreeFEM syntax with the Textmate 2 editor on Mac 10.7 or better, download from macromates.com and download the textmate freefem++ syntax here (version june 2107). To install this parser, unzip Textmate2-ff++.zip and follow the explanation given in file How_To.rtf.\nrom www.freefem.org/ff++/Textmate2-ff++.zip (version june 2107) unzip Textmate2-\n\n\nNotepad++,an editor under windows\nRead and follow the instruction, FREEFEM++ COLOR SYNTAX OF WINDOWS .\n\n\nEmacs editor\nFor emacs editor you can download ff++-mode.el .\n\n\n\n\n\n\t\t\n\t\t\t Previous topic: Version 4.5: new features\n\t\t\tNext topic: Download \n\t\t\n\t","l":"introduction/installation.html"},"36":{"t":"Version 4.5: new features","p":"\n\t\t\n   \nVersion 4.5: new features\n\n\n\n\n\nRelease, binaries packages\n\nSince the version 4.5, the FreeFEM binary packages provides with a compiled PETSc library.\nFreeFEM is now interfaced with ParMmg.\n\n\n\nNew meshes and FEM border\nAfter Surface FEM, Line FEM is possible with a new mesh type meshL, P0 P1 P2 P1dc FE, basic FEM, mesh generation.\nThis new development allows to treat a 1d problem, such as a problem described on a 3d curve.\n\nAbstract about Line FEM in FreeFEM.\n\nnew meshL type, refer to the section The type meshL in 3 dimension\n\nnew type of surface mesh: meshL\nthe functionalities on the meshL type, it is necessary to load the plugin msh3.\ngenerator of meshL segment, define multi border and buildmesh function.\nbasic transformation are avalaible: movemesh, trunc, extract, checkmesh, change, AddLayers, glue of meshL.\nIt is possible to build the underlying meshL from a meshS with the function buildBdMesh: ThS = buildBdMesh(ThS) builds the boundary domain associated to the meshS ThS and extract it by the command meshL ThL = ThS. Gamma.\n\n\n\nnew finite element space with curve finite element type\n\n\n\nFESpace P0 P1, P2, P1dc Lagrange finite elements and possible to add a custumed finite element with the classical method (like a plugin).\n\n\n\nas in the standard 2d, 3d, surface 3d case, the variational problem associated to surface PDE can be defined by using the keywords\n\nproblem\nvarf to access to matrix and RHS vector\navailable operators are int1d, on and the operator int0d to define a Neumann boundary condition\n\n\nvisualisation tools\n\nplot with plot of ffglut, medit meshes meshL and solutions\n2d or 3d view, with in 3d the option to visualize the elememt Normals at element (touch T) and the deformed domain according to it (touch 2).\nloading, saving of meshes and solution at FreeFEMs format\n\n.mesh  mesh format file of Medit (P. Frey LJLL)\n.msh for mesh and .sol data solution at freefem format\n.msh data file of Gmsh (Mesh generator) (load  gmsh)\nvtk format for meshes and solutions (load iovtk and use the .vtu extension)\n\n\n\n\n\n\n\n\nBoundary Element Method\nAllows to define and solve a 2d/3d BEM formulation and rebuild the associated potential.\nThe document is in construction.\n\n\n\n\n\t\t\n\t\t\t Previous topic: Introduction\n\t\t\tNext topic: Installation guide \n\t\t\n\t","l":"introduction/new-features.html"},"37":{"t":"Compressible Neo-Hookean materials","p":"\n\t\t\n   \nCompressible Neo-Hookean materials\nAuthor: Alex Sadovsky\n\nNotation\nIn what follows, the symbols \\(\\mathbf{u}, \\bF, \\bB, \\bC, \\stress\\) denote, respectively, the displacement field, the deformation gradient, the left Cauchy-Green strain tensor \\(\\bB  =  \\bF \\bF^T\\), the right Cauchy-Green strain tensor \\(\\bC  = \\bF^T \\bF\\), and the Cauchy stress tensor.\nWe also introduce the symbols \\(I_1 : =  \\tr \\bC\\) and \\(J : =  \\det\\bF\\).\nUse will be made of the identity:\n\n\\[{\\p J \\over \\p \\bC}  =  J \\bC^{-1}\\]\nThe symbol \\(\\Id\\) denotes the identity tensor.\nThe symbol \\(\\Omega_{0}\\) denotes the reference configuration of the body to be deformed.\nThe unit volume in the reference (resp., deformed) configuration is denoted \\(dV\\) (resp., \\(dV_{0}\\)); these two are related by:\n\n\\[dV  =  J dV_{0},\\]\nwhich allows an integral over \\(\\Omega\\) involving the Cauchy stress \\(\\bT\\) to be rewritten as an integral of the Kirchhoff stress \\(\\kappa  =  J \\bT\\) over \\(\\Omega_{0}\\).\n\n\nRecommended References\nFor an exposition of nonlinear elasticity and of the underlying linear and tensor algebra, see [OGDEN1984].\nFor an advanced mathematical analysis of the Finite Element Method, see [RAVIART1998].\n\n\nA Neo-Hookean Compressible Material\nConstitutive Theory and Tangent Stress Measures\nThe strain energy density function is given by:\n\n\\[W  =  {\\mu \\over 2}(I_1 - \\tr \\Id - 2 \\ln J)\\]\n(see [HORGAN2004], formula (12)).\nThe corresponding 2nd Piola-Kirchoff stress tensor is given by:\n\n\\[\\bS_{n} : =  {\\p W \\over \\p\\bE} (\\bF_{n})\n = \n\\mu (\\Id - \\bC^{-1})\\]\nThe Kirchhoff stress, then, is:\n\n\\[\\kappa\n =  \\bF \\bS \\bF^{T}\n =  \\mu (\\bB - \\Id)\\]\nThe tangent Kirchhoff stress tensor at \\(\\bF_{n}\\) acting on \\(\\delta \\bF_{n+1}\\) is, consequently:\n\n\\[{\\p \\kappa \\over \\p \\bF} (\\bF_{n}) \\delta \\bF_{n+1}\n = \n\\mu\n\\left[\n\\bF_{n} (\\delta \\bF_{n+1})^T\n+\n\\delta \\bF_{n+1} (\\bF_{n})^T\n\\right]\\]\nThe Weak Form of the BVP in the Absence of Body (External) Forces\nThe \\(\\Omega_0\\) we are considering is an elliptical annulus, whose boundary consists of two concentric ellipses (each allowed to be a circle as a special case), with the major axes parallel.\nLet \\(P\\) denote the dead stress load (traction) on a portion \\(\\partial \\Omega_0^{t}\\) ( =  the inner ellipse) of the boundary \\(\\partial \\Omega_0\\).\nOn the rest of the boundary, we prescribe zero displacement.\nThe weak formulation of the boundary value problem is:\n\n\\[\\begin{split}\\arr{lll}\n0\n&  =  &\n\\int_{\\Omega_0}\n\\kappa[\\bF]\n\\:\n:\n\\:\n\\left\\{\n(\\Grad \\otimes \\mathbf{w}) (\\bF)^{-1}\n\\right\\}\\\\\n& - & \\int_{\\p \\Omega_0^{t}} P \\cdot \\hat{N}_0\\\\\n\\rra\\end{split}\\]\nFor brevity, in the rest of this section we assume \\(P  =  0\\).\nThe provided FreeFEM code, however, does not rely on this assumption and allows for a general value and direction of \\(P\\).\nGiven a Newton approximation \\(\\mathbf{u}_n\\) of the displacement field \\(\\mathbf{u}\\) satisfying the BVP, we seek the correction \\(\\delta \\mathbf{u}_{n+1}\\) to obtain a better approximation:\n\n\\[\\mathbf{u}_{n+1}  =  \\mathbf{u}_{n} + \\delta \\mathbf{u}_{n+1}\\]\nby solving the weak formulation:\n\n\\[\\begin{split}\\arr{lll}\n    0 & = & \\int_{\\Omega_0}\\kappa[\\bF_{n} + \\delta \\bF_{n+1}]\\: :\\: \\left\\{(\\Grad \\otimes \\mathbf{w}) (\\bF_{n} + \\delta\\bF_{n+1})^{-1}\\right\\}- \\int_{\\p \\Omega_0} P \\cdot \\hat{N}_0\\\\\n    & = & \\int_{\\Omega_0}\\left\\{\\kappa[\\bF_{n}] + {\\p \\kappa \\over \\p \\bF}[\\bF_{n}]\\delta \\bF_{n+1}\\right\\}\\: :\\: \\left\\{(\\Grad \\otimes \\mathbf{w})(\\bF_{n} + \\delta \\bF_{n+1})^{-1}\\right\\}\\\\\n    & = & \\int_{\\Omega_0}\\left\\{\\kappa[\\bF_{n}] + {\\p \\kappa \\over \\p \\bF}[\\bF_{n}]\\delta \\bF_{n+1}\\right\\}\\: :\\: \\left\\{(\\Grad \\otimes \\mathbf{w}) (\\bF_{n}^{-1} + \\bF_{n}^{-2} \\delta \\bF_{n+1})\\right\\}\\\\\n    \\\\\n    & = & \\int_{\\Omega_0}\\kappa[\\bF_{n}]\\: :\\: \\left\\{(\\Grad \\otimes \\mathbf{w})\\bF_{n}^{-1}\\right\\}\\\\\n    &-& \\int_{\\Omega_0}\\kappa[\\bF_{n}]\\: :\\: \\left\\{(\\Grad \\otimes \\mathbf{w})(\\bF_{n}^{-2} \\delta \\bF_{n+1})\\right\\}\\\\\n    &+& \\int_{\\Omega_0}\\left\\{{\\p \\kappa \\over \\p \\bF}[\\bF_{n}]\\delta \\bF_{n+1}\\right\\}\\: :\\: \\left\\{(\\Grad \\otimes \\mathbf{w})\n\\bF_{n}^{-1}\n\\right\\}\n\\\\\n\\rra\n\\quad\n\\mbox{for all test functions} \\mathbf{w},\\end{split}\\]\nwhere we have taken:\n\n\\[\\delta \\bF_{n+1}  =  \\Grad \\otimes \\delta \\mathbf{u}_{n+1}\\]\n\nNote\nContrary to standard notational use, the symbol \\(\\delta\\) here bears no variational context.\nBy \\(\\delta\\) we mean simply an increment in the sense of Newtons Method.\nThe role of a variational virtual displacement here is played by \\(\\mathbf{w}\\).\n\n\n\nAn Approach to Implementation in FreeFEM\nIntroducing the code-like notation, where a string in \\(< >\\)s is to be read as one symbol, the individual components of the tensor:\n\n\\[<TanK>\n : = \n{\\p \\kappa \\over \\p \\bF}[\\bF_{n}]\n\\delta \\bF_{n+1}\\]\nwill be implemented as the macros \\(<TanK11>\\), \\(<TanK12>\\), \nThe individual components of the tensor quantities:\n\n\\[\\bD_{1} : = \n\\bF_{n} (\\delta \\bF_{n+1})^T\n+\n\\delta \\bF_{n+1} (\\bF_{n})^T,\\]\n\n\\[\\bD_{2} : = \n\\bF_{n}^{-T} \\delta \\bF_{n+1},\\]\n\n\\[\\bD_{3} : = \n(\\Grad \\otimes \\mathbf{w})\n\\bF_{n}^{-2} \\delta \\bF_{n+1},\\]\nand\n\n\\[\\bD_{4} : = \n(\\Grad \\otimes \\mathbf{w})\n\\bF_{n}^{-1},\\]\nwill be implemented as the macros:\n\n\\[\\begin{split}\\arr{l}\n<d1Aux11>, <d1Aux12>, \\quad \\ldots \\quad, <d1Aux22>,\\\\\n<d2Aux11>, <d2Aux12>, \\quad \\ldots \\quad, <d2Aux22>\\\\\n<d3Aux11>, <d3Aux12>, \\quad \\ldots \\quad, <d3Aux22>\\\\\n<d4Aux11>, <d4Aux12>, \\quad \\ldots \\quad, <d4Aux22>\\\\\n\\rra,\\end{split}\\]\nrespectively.\nIn the above notation, the tangent Kirchhoff stress term becomes\n\n\\[{\\p \\kappa \\over \\p \\bF} (\\bF_{n})\n\\: \\delta \\bF_{n+1}\n = \n\\mu\n\\: \\bD_{1}\\]\nwhile the weak BVP formulation acquires the form:\n\n\\[\\begin{split}\\arr{lll}\n0 &  =  &\n\\int_{\\Omega_0}\n\\kappa[\\bF_{n}]\n\\:\n:\n\\:\n\\bD_{4}\n\\\\\n&-&\n\\int_{\\Omega_0}\n\\kappa[\\bF_{n}]\n\\:\n:\n\\:\n\\bD_{3}\n\\\\\n&+&\n\\int_{\\Omega_0}\n\\left\\{\n{\\p \\kappa \\over \\p \\bF}[\\bF_{n}]\n\\delta \\bF_{n+1}\n\\right\\}\n\\:\n:\n\\:\n\\bD_{4}\n\\\\\n\\rra\n\\quad\n\\mbox{for all test functions} \\mathbf{w}\\end{split}\\]\n  1 // Macro\n  2 //Macros for the gradient of a vector field (u1, u2)\n  3 macro grad11(u1, u2) (dx(u1)) //\n  4 macro grad21(u1, u2) (dy(u1)) //\n  5 macro grad12(u1, u2) (dx(u2)) //\n  6 macro grad22(u1, u2) (dy(u2)) //\n  7 \n  8 //Macros for the deformation gradient\n  9 macro F11(u1, u2) (1.0 + grad11(u1, u2)) //\n 10 macro F12(u1, u2) (0.0 + grad12(u1, u2)) //\n 11 macro F21(u1, u2) (0.0 + grad21(u1, u2)) //\n 12 macro F22(u1, u2) (1.0 + grad22(u1, u2)) //\n 13 \n 14 //Macros for the incremental deformation gradient\n 15 macro dF11(varu1, varu2) (grad11(varu1, varu2)) //\n 16 macro dF12(varu1, varu2) (grad12(varu1, varu2)) //\n 17 macro dF21(varu1, varu2) (grad21(varu1, varu2)) //\n 18 macro dF22(varu1, varu2) (grad22(varu1, varu2)) //\n 19 \n 20 //Macro for the determinant of the deformation gradient\n 21 macro J(u1, u2) (\n 22       F11(u1, u2)*F22(u1, u2)\n 23     - F12(u1, u2)*F21(u1, u2)\n 24 ) //\n 25 \n 26 //Macros for the inverse of the deformation gradient\n 27 macro Finv11 (u1, u2) (\n 28       F22(u1, u2) / J(u1, u2)\n 29 ) //\n 30 macro Finv22 (u1, u2) (\n 31       F11(u1, u2) / J(u1, u2)\n 32 ) //\n 33 macro Finv12 (u1, u2) (\n 34     - F12(u1, u2) / J(u1, u2)\n 35 ) //\n 36 macro Finv21 (u1, u2) (\n 37     - F21(u1, u2) / J(u1, u2)\n 38 ) //\n 39 \n 40 //Macros for the square of the inverse of the deformation gradient\n 41 macro FFinv11 (u1, u2) (\n 42       Finv11(u1, u2)^2\n 43     + Finv12(u1, u2)*Finv21(u1, u2)\n 44 ) //\n 45 \n 46 macro FFinv12 (u1, u2) (\n 47       Finv12(u1, u2)*(Finv11(u1, u2)\n 48     + Finv22(u1, u2))\n 49 ) //\n 50 \n 51 macro FFinv21 (u1, u2) (\n 52       Finv21(u1, u2)*(Finv11(u1, u2)\n 53     + Finv22(u1, u2))\n 54 ) //\n 55 \n 56 macro FFinv22 (u1, u2) (\n 57       Finv12(u1, u2)*Finv21(u1, u2)\n 58     + Finv22(u1, u2)^2\n 59 ) //\n 60 \n 61 //Macros for the inverse of the transpose of the deformation gradient\n 62 macro FinvT11(u1, u2) (Finv11(u1, u2)) //\n 63 macro FinvT12(u1, u2) (Finv21(u1, u2)) //\n 64 macro FinvT21(u1, u2) (Finv12(u1, u2)) //\n 65 macro FinvT22(u1, u2) (Finv22(u1, u2)) //\n 66 \n 67 //The left Cauchy-Green strain tensor\n 68 macro B11(u1, u2) (\n 69       F11(u1, u2)^2 + F12(u1, u2)^2\n 70 )//\n 71 \n 72 macro B12(u1, u2) (\n 73       F11(u1, u2)*F21(u1, u2)\n 74     + F12(u1, u2)*F22(u1, u2)\n 75 )//\n 76 \n 77 macro B21(u1, u2) (\n 78       F11(u1, u2)*F21(u1, u2)\n 79     + F12(u1, u2)*F22(u1, u2)\n 80 )//\n 81 \n 82 macro B22(u1, u2)(\n 83       F21(u1, u2)^2 + F22(u1, u2)^2\n 84 )//\n 85 \n 86 //The macros for the auxiliary tensors (D0, D1, D2, ...): Begin\n 87 //The tensor quantity D0  =  F{n} (delta F{n+1})^T\n 88 macro d0Aux11 (u1, u2, varu1, varu2) (\n 89       dF11(varu1, varu2) * F11(u1, u2)\n 90     + dF12(varu1, varu2) * F12(u1, u2)\n 91 )//\n 92 \n 93 macro d0Aux12 (u1, u2, varu1, varu2) (\n 94       dF21(varu1, varu2) * F11(u1, u2)\n 95     + dF22(varu1, varu2) * F12(u1, u2)\n 96 )//\n 97 \n 98 macro d0Aux21 (u1, u2, varu1, varu2) (\n 99       dF11(varu1, varu2) * F21(u1, u2)\n100     + dF12(varu1, varu2) * F22(u1, u2)\n101 )//\n102 \n103 macro d0Aux22 (u1, u2, varu1, varu2) (\n104       dF21(varu1, varu2) * F21(u1, u2)\n105     + dF22(varu1, varu2) * F22(u1, u2)\n106 )//\n107 \n108 ///The tensor quantity D1  =  D0 + D0^T\n109 macro d1Aux11 (u1, u2, varu1, varu2) (\n110       2.0 * d0Aux11 (u1, u2, varu1, varu2)\n111 )//\n112 \n113 macro d1Aux12 (u1, u2, varu1, varu2) (\n114       d0Aux12 (u1, u2, varu1, varu2)\n115     + d0Aux21 (u1, u2, varu1, varu2)\n116 )//\n117 \n118 macro d1Aux21 (u1, u2, varu1, varu2) (\n119       d1Aux12 (u1, u2, varu1, varu2)\n120 )//\n121 \n122 macro d1Aux22 (u1, u2, varu1, varu2)(\n123       2.0 * d0Aux22 (u1, u2, varu1, varu2)\n124 )//\n125 \n126 ///The tensor quantity D2  =  F^{-T}_{n} dF_{n+1}\n127 macro d2Aux11 (u1, u2, varu1, varu2) (\n128       dF11(varu1, varu2) * FinvT11(u1, u2)\n129     + dF21(varu1, varu2) * FinvT12(u1, u2)\n130 )//\n131 \n132 macro d2Aux12 (u1, u2, varu1, varu2) (\n133       dF12(varu1, varu2) * FinvT11(u1, u2)\n134     + dF22(varu1, varu2) * FinvT12(u1, u2)\n135 )//\n136 \n137 macro d2Aux21 (u1, u2, varu1, varu2) (\n138       dF11(varu1, varu2) * FinvT21(u1, u2)\n139     + dF21(varu1, varu2) * FinvT22(u1, u2)\n140 )//\n141 \n142 macro d2Aux22 (u1, u2, varu1, varu2) (\n143       dF12(varu1, varu2) * FinvT21(u1, u2)\n144     + dF22(varu1, varu2) * FinvT22(u1, u2)\n145 )//\n146 \n147 ///The tensor quantity D3  =  F^{-2}_{n} dF_{n+1}\n148 macro d3Aux11 (u1, u2, varu1, varu2, w1, w2) (\n149       dF11(varu1, varu2) * FFinv11(u1, u2) * grad11(w1, w2)\n150     + dF21(varu1, varu2) * FFinv12(u1, u2) * grad11(w1, w2)\n151     + dF11(varu1, varu2) * FFinv21(u1, u2) * grad12(w1, w2)\n152     + dF21(varu1, varu2) * FFinv22(u1, u2) * grad12(w1, w2)\n153 )//\n154 \n155 macro d3Aux12 (u1, u2, varu1, varu2, w1, w2) (\n156       dF12(varu1, varu2) * FFinv11(u1, u2) * grad11(w1, w2)\n157     + dF22(varu1, varu2) * FFinv12(u1, u2) * grad11(w1, w2)\n158     + dF12(varu1, varu2) * FFinv21(u1, u2) * grad12(w1, w2)\n159     + dF22(varu1, varu2) * FFinv22(u1, u2) * grad12(w1, w2)\n160 )//\n161 \n162 macro d3Aux21 (u1, u2, varu1, varu2, w1, w2) (\n163       dF11(varu1, varu2) * FFinv11(u1, u2) * grad21(w1, w2)\n164     + dF21(varu1, varu2) * FFinv12(u1, u2) * grad21(w1, w2)\n165     + dF11(varu1, varu2) * FFinv21(u1, u2) * grad22(w1, w2)\n166     + dF21(varu1, varu2) * FFinv22(u1, u2) * grad22(w1, w2)\n167 )//\n168 \n169 macro d3Aux22 (u1, u2, varu1, varu2, w1, w2) (\n170       dF12(varu1, varu2) * FFinv11(u1, u2) * grad21(w1, w2)\n171     + dF22(varu1, varu2) * FFinv12(u1, u2) * grad21(w1, w2)\n172     + dF12(varu1, varu2) * FFinv21(u1, u2) * grad22(w1, w2)\n173     + dF22(varu1, varu2) * FFinv22(u1, u2) * grad22(w1, w2)\n174 )//\n175 \n176 ///The tensor quantity D4  =  (grad w) * Finv\n177 macro d4Aux11 (w1, w2, u1, u2) (\n178       Finv11(u1, u2)*grad11(w1, w2)\n179     + Finv21(u1, u2)*grad12(w1, w2)\n180 )//\n181 \n182 macro d4Aux12 (w1, w2, u1, u2) (\n183       Finv12(u1, u2)*grad11(w1, w2)\n184     + Finv22(u1, u2)*grad12(w1, w2)\n185 )//\n186 \n187 macro d4Aux21 (w1, w2, u1, u2) (\n188       Finv11(u1, u2)*grad21(w1, w2)\n189     + Finv21(u1, u2)*grad22(w1, w2)\n190 )//\n191 \n192 macro d4Aux22 (w1, w2, u1, u2) (\n193       Finv12(u1, u2)*grad21(w1, w2)\n194     + Finv22(u1, u2)*grad22(w1, w2)\n195 )//\n196 //The macros for the auxiliary tensors (D0, D1, D2, ...): End\n197 \n198 //The macros for the various stress measures: BEGIN\n199 //The Kirchhoff stress tensor\n200 macro StressK11(u1, u2) (\n201       mu * (B11(u1, u2) - 1.0)\n202 )//\n203 \n204 //The Kirchhoff stress tensor\n205 macro StressK12(u1, u2) (\n206       mu * B12(u1, u2)\n207 )//\n208 \n209 //The Kirchhoff stress tensor\n210 macro StressK21(u1, u2) (\n211       mu * B21(u1, u2)\n212 )//\n213 \n214 //The Kirchhoff stress tensor\n215 macro StressK22(u1, u2) (\n216       mu * (B22(u1, u2) - 1.0)\n217 )//\n218 \n219 //The tangent Kirchhoff stress tensor\n220 macro TanK11(u1, u2, varu1, varu2) (\n221       mu * d1Aux11(u1, u2, varu1, varu2)\n222 )//\n223 \n224 macro TanK12(u1, u2, varu1, varu2) (\n225       mu * d1Aux12(u1, u2, varu1, varu2)\n226 )//\n227 \n228 macro TanK21(u1, u2, varu1, varu2) (\n229       mu * d1Aux21(u1, u2, varu1, varu2)\n230 )//\n231 \n232 macro TanK22(u1, u2, varu1, varu2) (\n233       mu * d1Aux22(u1, u2, varu1, varu2)\n234 )//\n235 //The macros for the stress tensor components: END\n236 \n237 // Parameters\n238 real mu  =  5.e2; //Elastic coefficients (kg/cm^2)\n239 real D  =  1.e3; //(1 / compressibility)\n240 real Pa  =  -3.e2; //Stress loads\n241 \n242 real InnerRadius  =  1.e0; //The wound radius\n243 real OuterRadius  =  4.e0; //The outer (truncated) radius\n244 real tol  =  1.e-4; //Tolerance (L^2)\n245 real InnerEllipseExtension  =  1.e0; //Extension of the inner ellipse ((major axis) - (minor axis))\n246 \n247 int m  =  40, n  =  20;\n248 \n249 // Mesh\n250 border InnerEdge(t = 0, 2.*pi){x = (1.0 + InnerEllipseExtension)*InnerRadius*cos(t); y = InnerRadius*sin(t); label = 1;}\n251 border OuterEdge(t = 0, 2.*pi){x = (1.0 + 0.0*InnerEllipseExtension)*OuterRadius*cos(t); y = OuterRadius*sin(t); label = 2;}\n252 mesh Th  =  buildmesh(InnerEdge(-m) + OuterEdge(n));\n253 int bottom  =  1, right  =  2, upper  =  3, left  =  4;\n254 plot(Th);\n255 \n256 // Fespace\n257 fespace Wh(Th, P1dc);\n258 fespace Vh(Th, [P1, P1]);\n259 Vh [w1, w2], [u1n,u2n], [varu1, varu2];\n260 Vh [ehat1x, ehat1y], [ehat2x, ehat2y];\n261 Vh [auxVec1, auxVec2]; //The individual elements of the total 1st Piola-Kirchoff stress\n262 Vh [ef1, ef2];\n263 \n264 fespace Sh(Th, P1);\n265 Sh p, ppp;\n266 Sh StrK11, StrK12, StrK21, StrK22;\n267 Sh u1, u2;\n268 \n269 // Problem\n270 varf vfMass1D(p, q)  =  int2d(Th)(p*q);\n271 matrix Mass1D  =  vfMass1D(Sh, Sh, solver = CG);\n272 \n273 p[]  =  1;\n274 ppp[]  =  Mass1D * p[];\n275 \n276 real DomainMass  =  ppp[].sum;\n277 cout << \"DomainMass  =  \" << DomainMass << endl;\n278 \n279 varf vmass ([u1, u2], [v1, v2], solver = CG)\n280      =  int2d(Th)( (u1*v1 + u2*v2) / DomainMass );\n281 \n282 matrix Mass  =  vmass(Vh, Vh);\n283 \n284 matrix Id  =  vmass(Vh, Vh);\n285 \n286 //Define the standard Euclidean basis functions\n287 [ehat1x, ehat1y]  =  [1.0, 0.0];\n288 [ehat2x, ehat2y]  =  [0.0, 1.0];\n289 \n290 real ContParam, dContParam;\n291 \n292 problem neoHookeanInc ([varu1, varu2], [w1, w2], solver = LU)\n293      =  int2d(Th, qforder = 1)(\n294         - (\n295               StressK11 (u1n, u2n) * d3Aux11(u1n, u2n, varu1, varu2, w1, w2)\n296             + StressK12 (u1n, u2n) * d3Aux12(u1n, u2n, varu1, varu2, w1, w2)\n297             + StressK21 (u1n, u2n) * d3Aux21(u1n, u2n, varu1, varu2, w1, w2)\n298             + StressK22 (u1n, u2n) * d3Aux22(u1n, u2n, varu1, varu2, w1, w2)\n299         )\n300         + TanK11 (u1n, u2n, varu1, varu2) * d4Aux11(w1, w2, u1n, u2n)\n301         + TanK12 (u1n, u2n, varu1, varu2) * d4Aux12(w1, w2, u1n, u2n)\n302         + TanK21 (u1n, u2n, varu1, varu2) * d4Aux21(w1, w2, u1n, u2n)\n303         + TanK22 (u1n, u2n, varu1, varu2) * d4Aux22(w1, w2, u1n, u2n)\n304     )\n305     + int2d(Th, qforder = 1)(\n306           StressK11 (u1n, u2n) * d4Aux11(w1, w2, u1n, u2n)\n307         + StressK12 (u1n, u2n) * d4Aux12(w1, w2, u1n, u2n)\n308         + StressK21 (u1n, u2n) * d4Aux21(w1, w2, u1n, u2n)\n309         + StressK22 (u1n, u2n) * d4Aux22(w1, w2, u1n, u2n)\n310     )\n311     //Choose one of the following two boundary conditions involving Pa:\n312     // Load vectors normal to the boundary:\n313     - int1d(Th, 1)(\n314           Pa * (w1*N.x + w2*N.y)\n315     )\n316     //Load vectors tangential to the boundary:\n317     //- int1d(Th, 1)(\n318     //    Pa * (w1*N.y - w2*N.x)\n319     //)\n320     + on(2, varu1 = 0, varu2 = 0)\n321     ;\n322 \n323 //Auxiliary variables\n324 matrix auxMat;\n325 \n326 // Newton's method\n327 ContParam  =  0.;\n328 dContParam  =  0.01;\n329 \n330 //Initialization:\n331 [varu1, varu2]  =  [0., 0.];\n332 [u1n, u2n]  =  [0., 0.];\n333 real res  =  2. * tol;\n334 real eforceres;\n335 int loopcount  =  0;\n336 int loopmax  =  45;\n337 \n338 // Iterations\n339 while (loopcount < =  loopmax && res > =  tol){\n340     loopcount ++;\n341     cout << \"Loop \" << loopcount << endl;\n342 \n343     // Solve\n344     neoHookeanInc;\n345 \n346     // Update\n347     u1  =  varu1;\n348     u2  =  varu2;\n349 \n350     // Residual\n351     w1[]  =  Mass*varu1[];\n352     res  =  sqrt(w1[]' * varu1[]); //L^2 norm of [varu1, varu2]\n353     cout << \" L^2 residual  =  \" << res << endl;\n354 \n355     // Newton\n356     u1n[] + =  varu1[];\n357 \n358     // Plot\n359     plot([u1n,u2n], cmm = \"displacement\");\n360 }\n361 \n362 // Plot\n363 plot(Th, wait = true);\n364 \n365 // Movemesh\n366 mesh Th1  =  movemesh(Th, [x+u1n, y+u2n]);\n367 \n368 // Plot\n369 plot(Th1, wait = true);\n370 plot([u1n,u2n]);\n\n\n\n\n\n\n\t\t\n\t\t\t Previous topic: Non-linear elasticity\n\t\t\tNext topic: Whispering gallery modes \n\t\t\n\t","l":"models/compressible-neo-hookean-materials.html"},"38":{"t":"Domain decomposition","p":"\n\t\t\n   \nDomain decomposition\nWe present three classic examples of domain decomposition technique: first, Schwarz algorithm with overlapping, second Schwarz algorithm without overlapping (also call Shur complement), and last we show to use the conjugate gradient to solve the boundary problem of the Shur complement.\n\nSchwarz overlapping\nTo solve:\n\n\\[-\\Delta u  = f,\\;\\mbox{in}\\;\\Omega = \\Omega_1\\cup\\Omega_2\\quad u|_\\Gamma = 0\\]\nthe Schwarz algorithm runs like this:\n\n\\[\\begin{split}\\begin{array}{rcl}\n    -\\Delta u^{n+1}_1& = &f\\;\\mbox{in}\\;\\Omega_1\\quad\n    u^{n+1}_1|_{\\Gamma_1} = u^n_2\\\\\n    -\\Delta u^{n+1}_2& = &f\\;\\mbox{in}\\;\\Omega_2\\quad\n    u^{n+1}_2|_{\\Gamma_2} = u^n_1\n\\end{array}\\end{split}\\]\nwhere \\(\\Gamma_i\\) is the boundary of \\(\\Omega_i\\) and on the condition that \\(\\Omega_1\\cap\\Omega_2\\neq\\emptyset\\) and that \\(u_i\\) are zero at iteration 1.\nHere we take \\(\\Omega_1\\) to be a quadrangle, \\(\\Omega_2\\) a disk and we apply the algorithm starting from zero.\n\n\n\nFig. 165 The 2 overlapping mesh TH and th\n\n\n\nTip\nSchwarz overlapping\n 1 // Parameters\n 2 int inside  = 2; //inside boundary\n 3 int outside  =  1; //outside boundary\n 4 int n  =  4;\n 5 \n 6 // Mesh\n 7 border a(t = 1, 2){x = t; y = 0; label = outside;}\n 8 border b(t = 0, 1){x = 2; y = t; label = outside;}\n 9 border c(t = 2, 0){x = t; y = 1; label = outside;}\n10 border d(t = 1, 0){x = 1-t; y = t; label = inside;}\n11 border e(t = 0, pi/2){x = cos(t); y = sin(t); label = inside;}\n12 border e1(t = pi/2, 2*pi){x = cos(t); y = sin(t); label = outside;}\n13 mesh th  =  buildmesh(a(5*n) + b(5*n) + c(10*n) + d(5*n));\n14 mesh TH  =  buildmesh(e(5*n) + e1(25*n));\n15 plot(th, TH, wait = true); //to see the 2 meshes\n16 \n17 // Fespace\n18 fespace vh(th, P1);\n19 vh u = 0, v;\n20 \n21 fespace VH(TH, P1);\n22 VH U, V;\n23 \n24 // Problem\n25 int i  =  0;\n26 problem PB (U, V, init = i, solver = Cholesky)\n27     =  int2d(TH)(\n28          dx(U)*dx(V)\n29        + dy(U)*dy(V)\n30    )\n31    + int2d(TH)(\n32        - V\n33    )\n34    + on(inside, U = u)\n35    + on(outside, U = 0)\n36    ;\n37 \n38 problem pb (u, v, init = i, solver = Cholesky)\n39     =  int2d(th)(\n40          dx(u)*dx(v)\n41        + dy(u)*dy(v)\n42    )\n43    + int2d(th)(\n44        - v\n45    )\n46    + on(inside, u = U)\n47    + on(outside, u = 0)\n48    ;\n49 \n50 // Calculation loop\n51 for (i  =  0 ; i < 10; i++){\n52    // Solve\n53    PB;\n54    pb;\n55 \n56    // Plot\n57    plot(U, u, wait = true);\n58 }\n\n\n\n\n\n\nFig. 166 Isovalues of the solution at iteration 0\n\n\n\n\n\nFig. 167 Isovalues of the solution at iteration 0\n\n\nSchwarz overlapping\n\n\n\nSchwarz non overlapping Scheme\nTo solve:\n\n\\[-\\Delta u  = f\\;\\mbox{in}\\;\\Omega = \\Omega_1\\cup\\Omega_2\\quad u|_\\Gamma = 0\\]\nthe Schwarz algorithm for domain decomposition without overlapping runs like this\n\n\n\nFig. 168 The two none overlapping mesh TH and th\n\n\nLet introduce \\(\\Gamma_i\\) is common the boundary of \\(\\Omega_1\\) and \\(\\Omega_2\\) and \\(\\Gamma_e^i =  \\partial \\Omega_i \\setminus \\Gamma_i\\).\nThe problem find \\(\\lambda\\) such that \\((u_1|_{\\Gamma_i} = u_2|_{\\Gamma_i})\\) where \\(u_i\\) is solution of the following Laplace problem:\n\n\\[-\\Delta u_i = f\\;\\mbox{in}\\;\\Omega_i\\quad\nu_i|_{\\Gamma_i} = \\lambda \\quad\nu_i|_{\\Gamma_e^i}  =  0\\]\nTo solve this problem we just make a loop with upgrading \\(\\lambda\\) with\n\n\\[\\lambda  =  \\lambda {\\pm} \\frac{(u_1-u_2)}{2}\\]\nwhere the sign \\(+\\) or \\(-\\) of \\({\\pm}\\) is choose to have convergence.\n\nTip\nSchwarz non-overlapping\n 1 // Parameters\n 2 int inside  =  2; int outside  =  1; int n  =  4;\n 3 \n 4 // Mesh\n 5 border a(t = 1, 2){x = t; y = 0; label = outside;};\n 6 border b(t = 0, 1){x = 2; y = t; label = outside;};\n 7 border c(t = 2, 0){x = t; y = 1; label = outside;};\n 8 border d(t = 1, 0){x = 1-t; y = t; label = inside;};\n 9 border e(t = 0, 1){x = 1-t; y = t; label = inside;};\n10 border e1(t = pi/2, 2*pi){x = cos(t); y = sin(t); label = outside;};\n11 mesh th  =  buildmesh(a(5*n) + b(5*n) + c(10*n) + d(5*n));\n12 mesh TH  =  buildmesh(e(5*n) + e1(25*n));\n13 plot(th, TH, wait = true);\n14 \n15 // Fespace\n16 fespace vh(th, P1);\n17 vh u = 0, v;\n18 vh lambda = 0;\n19 \n20 fespace VH(TH, P1);\n21 VH U, V;\n22 \n23 // Problem\n24 int i  =  0;\n25 problem PB (U, V, init = i, solver = Cholesky)\n26      =  int2d(TH)(\n27           dx(U)*dx(V)\n28         + dy(U)*dy(V)\n29     )\n30     + int2d(TH)(\n31         - V\n32     )\n33     + int1d(TH, inside)(\n34           lambda*V\n35     )\n36     + on(outside, U =  0 )\n37     ;\n38 \n39 problem pb (u, v, init = i, solver = Cholesky)\n40      =  int2d(th)(\n41           dx(u)*dx(v)\n42         + dy(u)*dy(v)\n43     )\n44     + int2d(th)(\n45         - v\n46     )\n47     + int1d(th, inside)(\n48         - lambda*v\n49     )\n50     + on(outside, u = 0)\n51     ;\n52 \n53 for (i  =  0; i < 10; i++){\n54     // Solve\n55     PB;\n56     pb;\n57     lambda  =  lambda - (u-U)/2;\n58 \n59     // Plot\n60     plot(U,u,wait = true);\n61 }\n62 \n63 // Plot\n64 plot(U, u);\n\n\n\n\n\n\nFig. 169 Isovalues of the solution at iteration 0 without overlapping\n\n\n\n\n\nFig. 170 Isovalues of the solution at iteration 9 without overlapping\n\n\n\n\n\nSchwarz conjuguate gradient\nTo solve \\(-\\Delta u  = f \\;\\mbox{in}\\;\\Omega = \\Omega_1\\cup\\Omega_2\\quad u|_\\Gamma = 0\\) the Schwarz algorithm for domain decomposition without overlapping runs like this\nLet introduce \\(\\Gamma_i\\) is common the boundary of \\(\\Omega_1\\) and \\(\\Omega_2\\) and \\(\\Gamma_e^i =  \\partial \\Omega_i \\setminus \\Gamma_i\\).\nThe problem find \\(\\lambda\\) such that \\((u_1|_{\\Gamma_i} = u_2|_{\\Gamma_i})\\) where \\(u_i\\) is solution of the following Laplace problem:\n\n\\[-\\Delta u_i = f\\;\\mbox{in}\\;\\Omega_i\\quad\nu_i|_{\\Gamma_i} = \\lambda \\quad\nu_i|_{\\Gamma_e^i}  =  0\\]\nThe version of this example uses the Shur complement.\nThe problem on the border is solved by a conjugate gradient method.\n\nTip\nSchwarz conjugate gradient\nFirst, we construct the two domains:\n 1 // Parameters\n 2 int inside  =  2; int outside  =  1; int n  =  4;\n 3 \n 4 // Mesh\n 5 border Gamma1(t = 1, 2){x = t; y = 0; label = outside;}\n 6 border Gamma2(t = 0, 1){x = 2; y = t; label = outside;}\n 7 border Gamma3(t = 2, 0){x = t; y = 1; label = outside;}\n 8 border GammaInside(t = 1, 0){x = 1-t; y = t; label = inside;}\n 9 border GammaArc(t = pi/2, 2*pi){x = cos(t); y = sin(t); label = outside;}\n10 mesh Th1  =  buildmesh(Gamma1(5*n) + Gamma2(5*n) + GammaInside(5*n) + Gamma3(5*n));\n11 mesh Th2  =  buildmesh(GammaInside(-5*n) + GammaArc(25*n));\n12 plot(Th1, Th2);\n\n\nNow, define the finite element spaces:\n1 // Fespace\n2 fespace Vh1(Th1, P1);\n3 Vh1 u1, v1;\n4 Vh1 lambda;\n5 Vh1 p = 0;\n6 \n7 fespace Vh2(Th2,P1);\n8 Vh2 u2, v2;\n\n\n\nNote\nIt is impossible to define a function just on a part of boundary, so the \\(\\lambda\\) function must be defined on the all domain \\(\\Omega_1\\) such as:\n1 Vh1 lambda;\n\n\n\nThe two Poissons problems:\n 1 problem Pb1 (u1, v1, init = i, solver = Cholesky)\n 2      =  int2d(Th1)(\n 3           dx(u1)*dx(v1)\n 4         + dy(u1)*dy(v1)\n 5     )\n 6     + int2d(Th1)(\n 7         - v1\n 8     )\n 9     + int1d(Th1, inside)(\n10           lambda*v1\n11     )\n12     + on(outside, u1 = 0)\n13     ;\n14 \n15 problem Pb2 (u2, v2, init = i, solver = Cholesky)\n16      =  int2d(Th2)(\n17           dx(u2)*dx(v2)\n18         + dy(u2)*dy(v2)\n19     )\n20     + int2d(Th2)(\n21         - v2\n22     )\n23     + int1d(Th2, inside)(\n24         - lambda*v2\n25     )\n26     + on(outside, u2 = 0)\n27     ;\n\n\nAnd, we define a border matrix, because the \\(\\lambda\\) function is none zero inside the domain \\(\\Omega_1\\):\n1 varf b(u2, v2, solver = CG)  =  int1d(Th1, inside)(u2*v2);\n2 matrix B  =  b(Vh1, Vh1, solver = CG);\n\n\nThe boundary problem function,\n\n\\[\\lambda \\longrightarrow \\int_{\\Gamma_i }(u_1-u_2) v_{1}\\]\n 1 // Boundary problem function\n 2 func real[int] BoundaryProblem (real[int] &l){\n 3    lambda[]  =  l; //make FE function form l\n 4    Pb1;\n 5    Pb2;\n 6    i++; //no refactorization i ! =  0\n 7    v1  =  -(u1-u2);\n 8    lambda[]  =  B*v1[];\n 9    return lambda[];\n10 }\n\n\n\nNote\nThe difference between the two notations v1 and v1[] is: v1 is the finite element function and v1[] is the vector in the canonical basis of the finite element function v1.\n\n1 // Solve\n2 real cpu = clock();\n3 LinearCG(BoundaryProblem, p[], eps = 1.e-6, nbiter = 100);\n4 //compute the final solution, because CG works with increment\n5 BoundaryProblem(p[]); //solve again to have right u1, u2\n6 \n7 // Display & Plot\n8 cout << \" -- CPU time schwarz-gc:\" << clock()-cpu << endl;\n9 plot(u1, u2);\n\n\n\n\n\n\n\n\t\t\n\t\t\t Previous topic: Variational Inequality\n\t\t\tNext topic: Fluid-structure coupled problem \n\t\t\n\t","l":"models/domain-decomposition.html"},"39":{"t":"Eigen value problems","p":"\n\t\t\n   \nEigen value problems\nThis section depends on your installation of FreeFEM; you need to have compiled ARPACK.\nThis tool is available in FreeFEM if the word eigenvalue appears in line Load:, like:\n1 -- FreeFem++ v*.** (date *** *** ** **:**:** CET ****)\n2  file : ***.edp\n3  Load: lg_fem lg_mesh eigenvalue\n\n\nThis tool is based on arpack++, the object-oriented version of ARPACK eigenvalue package [LEHOUCQ1998].\nThe function EigenValue computes the generalized eigenvalue of \\(A u  =  \\lambda B u\\).\nThe Shift-invert method is used by default, with sigma  = \\(\\sigma\\) the shift of the method.\nThe matrix \\(OP\\) is defined with \\(A - \\sigma B\\).\nThe return value is the number of converged eigenvalues (can be greater than the number of requested eigenvalues nev = )\n1 int k  =  EigenValue(OP, B, nev = Nev, sigma = Sigma);\n\n\nwhere the matrix \\(OP =  A - \\sigma B\\) with a solver and boundary condition, and the matrix \\(B\\).\nThere is also a functional interface:\n1 int k  =  EigenValue(n, FOP1, FB, nev = Nev, sigma = Sigma);\n\n\nwhere \\(n\\) is the size of the problem, and the operators are now defined through functions, defining respectively the matrix product of \\(OP^{-1}\\) and \\(B\\), as in\n1 int n  =  OP1.n;\n2 func real[int] FOP1(real[int] & u){ real[int] Au  =  OP^-1*u; return Au; }\n3 func real[int] FB(real[int] & u){ real[int] Au  =  B*u; return Au; }\n\n\nIf you want finer control over the method employed in ARPACK, you can specify which mode ARPACK will work with (mode =  , see ARPACK documentation [LEHOUCQ1998]). The operators necessary for the chosen mode can be passed through the optional parameters A = , A1 = , B = , B1 = , (see below).\n\nmode = 1: Regular mode for solving \\(A u  =  \\lambda u\\)\n1 int k  =  EigenValue(n, A = FOP, mode = 1, nev = Nev);\n\n\nwhere the function FOP defines the matrix product of A\n\nmode = 2: Regular inverse mode for solving \\(A u  =  \\lambda B u\\)\n1 int k  =  EigenValue(n, A = FOP, B = FB, B1 = FB1, mode = 2, nev = Nev);\n\n\nwhere the functions FOP, FB and FB1 define respectively the matrix product of \\(A\\), \\(B\\) and \\(B^{-1}\\)\n\nmode = 3: Shift-invert mode for solving \\(A u  =  \\lambda B u\\)\n1 int k  =  EigenValue(n, A1 = FOP1, B = FB, mode = 3, sigma = Sigma, nev = Nev);\n\n\nwhere the functions FOP1 and FB define respectively the matrix product of \\(OP^{-1}  =  (A - \\sigma B)^{-1}\\) and \\(B\\)\n\n\nYou can also specify which subset of eigenvalues you want to compute (which = ).\nThe default value is which = \"LM\", for eigenvalues with largest magnitude.\n\"SM\" is for smallest magnitude, \"LA\" for largest algebraic value, \"SA\" for smallest algebraic value, and \"BE\" for both ends of the spectrum.\nRemark: For complex problems, you need to use the keyword complexEigenValue instead of EigenValue when passing operators through functions.\n\nNote\nBoundary condition and Eigenvalue Problems\nThe locking (Dirichlet) boundary condition is make with exact penalization so we put 1e30 = tgv on the diagonal term of the locked degree of freedom (see Finite element chapter). So take Dirichlet boundary condition just on \\(A\\) and not on \\(B\\) because we solve \\(w = OP^{-1}*B*v\\).\nIf you put locking (Dirichlet) boundary condition on \\(B\\) matrix (with key work on) you get small spurious modes \\((10^{-30})\\), due to boundary condition, but if you forget the locking boundary condition on \\(B\\) matrix (no keywork on) you get huge spurious \\((10^{30})\\) modes associated to these boundary conditons. We compute only small mode, so we get the good one in this case.\n\n\nsym =  The problem is symmetric (all the eigen value are real)\nnev =  The number desired eigenvalues (nev) close to the shift.\nvalue =  The array to store the real part of the eigenvalues\nivalue =  The array to store the imaginary part of the eigenvalues\nvector =  The FE function array to store the eigenvectors\nrawvector =  An array of type real[int,int] to store eigenvectors by column.\nFor real non symmetric problems, complex eigenvectors are given as two consecutive vectors, so if eigenvalue \\(k\\) and \\(k+1\\) are complex conjugate eigenvalues, the \\(k\\)th vector will contain the real part and the \\(k+1\\)th vector the imaginary part of the corresponding complex conjugate eigenvectors.\n\ntol =  The relative accuracy to which eigenvalues are to be determined;\nsigma =  The shift value;\nmaxit =  The maximum number of iterations allowed;\nncv =  The number of Arnoldi vectors generated at each iteration of ARPACK;\nmode =  The computational mode used by ARPACK (see above);\nwhich =  The requested subset of eigenvalues (see above).\n\n\nTip\nLaplace eigenvalue\nIn the first example, we compute the eigenvalues and the eigenvectors of the Dirichlet problem on square \\(\\Omega = ]0,\\pi[^2\\).\nThe problem is to find: \\(\\lambda\\), and \\(\\nabla u_{\\lambda}\\) in \\(\\mathbb{R}{\\times} H^1_0(\\Omega)\\)\n\n\\[\\int_\\Omega \\nabla u_{\\lambda} \\nabla v  =  \\lambda \\int_\\Omega u v \\quad \\forall v \\in H^1_0(\\Omega)\\]\nThe exact eigenvalues are \\(\\lambda_{n,m}  = (n^2+m^2), (n,m)\\in {\\mathbb{N}_*}^2\\) with the associated eigenvectors are \\(u_{{m,n}} = \\sin(nx)*\\sin(my)\\).\nWe use the generalized inverse shift mode of the arpack++ library, to find 20 eigenvalues and eigenvectors close to the shift value \\(\\sigma = 20\\).\n 1 // Parameters\n 2 verbosity = 0;\n 3 real sigma  =  20; //value of the shift\n 4 int nev  =  20; //number of computed eigen value close to sigma\n 5 \n 6 // Mesh\n 7 mesh Th  =  square(20, 20, [pi*x, pi*y]);\n 8 \n 9 // Fespace\n10 fespace Vh(Th, P2);\n11 Vh u1, u2;\n12 \n13 // Problem\n14 // OP  =  A - sigma B ; // the shifted matrix\n15 varf op (u1, u2)\n16      =  int2d(Th)(\n17           dx(u1)*dx(u2)\n18         + dy(u1)*dy(u2)\n19         - sigma* u1*u2\n20     )\n21     + on(1, 2, 3, 4, u1 = 0)\n22     ;\n23 \n24 varf b ([u1], [u2])  =  int2d(Th)(u1*u2); //no boundary condition\n25 \n26 matrix OP  =  op(Vh, Vh, solver = Crout, factorize = 1); //crout solver because the matrix in not positive\n27 matrix B  =  b(Vh, Vh, solver = CG, eps = 1e-20);\n28 \n29 // important remark:\n30 // the boundary condition is make with exact penalization:\n31 // we put 1e30 = tgv on the diagonal term of the lock degree of freedom.\n32 // So take Dirichlet boundary condition just on $a$ variational form\n33 // and not on $b$ variational form.\n34 // because we solve $ w = OP^-1*B*v $\n35 \n36 // Solve\n37 real[int] ev(nev); //to store the nev eigenvalue\n38 Vh[int] eV(nev); //to store the nev eigenvector\n39 \n40 int k  =  EigenValue(OP, B, sym = true, sigma = sigma, value = ev, vector = eV,\n41     tol = 1e-10, maxit = 0, ncv = 0);\n42 \n43 // Display & Plot\n44 for (int i  =  0; i < k; i++){\n45     u1  =  eV[i];\n46     real gg  =  int2d(Th)(dx(u1)*dx(u1) + dy(u1)*dy(u1));\n47     real mm  =  int2d(Th)(u1*u1) ;\n48     cout << \"lambda[\" << i << \"]  =  \" << ev[i] << \", err =  \" << int2d(Th)(dx(u1)*dx(u1) + dy(u1)*dy(u1) - (ev[i])*u1*u1) << endl;\n49     plot(eV[i], cmm = \"Eigen Vector \"+i+\" value  = \"+ev[i], wait = true, value = true);\n50 }\n\n\nThe output of this example is:\n 1 lambda[0]  =  5.0002, err =  -1.46519e-11\n 2 lambda[1]  =  8.00074, err =  -4.05158e-11\n 3 lambda[2]  =  10.0011, err =  2.84925e-12\n 4 lambda[3]  =  10.0011, err =  -7.25456e-12\n 5 lambda[4]  =  13.002, err =  -1.74257e-10\n 6 lambda[5]  =  13.0039, err =  1.22554e-11\n 7 lambda[6]  =  17.0046, err =  -1.06274e-11\n 8 lambda[7]  =  17.0048, err =  1.03883e-10\n 9 lambda[8]  =  18.0083, err =  -4.05497e-11\n10 lambda[9]  =  20.0096, err =  -2.21678e-13\n11 lambda[10]  =  20.0096, err =  -4.16212e-14\n12 lambda[11]  =  25.014, err =  -7.42931e-10\n13 lambda[12]  =  25.0283, err =  6.77444e-10\n14 lambda[13]  =  26.0159, err =  3.19864e-11\n15 lambda[14]  =  26.0159, err =  -4.9652e-12\n16 lambda[15]  =  29.0258, err =  -9.99573e-11\n17 lambda[16]  =  29.0273, err =  1.38242e-10\n18 lambda[17]  =  32.0449, err =  1.2522e-10\n19 lambda[18]  =  34.049, err =  3.40213e-11\n20 lambda[19]  =  34.0492, err =  2.41751e-10\n\n\n\n\n\n\nFig. 157 Isovalue of 11th eigenvector \\(u_{4,3}-u_{3,4}\\)\n\n\n\n\n\nFig. 158 Isovalue of 12th eigenvector \\(u_{4,3}+u_{3,4}\\)\n\n\n\n\n\n\n\t\t\n\t\t\t Previous topic: Non-linear static problems\n\t\t\tNext topic: Evolution problems \n\t\t\n\t","l":"models/eigen-value-problems.html"},"40":{"t":"Elasticity","p":"\n\t\t\n   \nElasticity\nConsider an elastic plate with undeformed shape \\(\\Omega\\times ]-h,h[\\) in \\(\\mathbb{R}^3\\), \\(\\Omega\\subset\\mathbb{R}^2\\).\nBy the deformation of the plate, we assume that a point \\(P(x_1,x_2,x_3)\\) moves to \\({\\cal P}(\\xi_1,\\xi_2,\\xi_3)\\).\nThe vector \\(\\mathbf{u} = (u_1,u_2,u_3) = (\\xi_1-x_1,\\xi_2-x_2,\\xi_3-x_3)\\) is called the displacement vector.\nBy the deformation, the line segment \\(\\overline{\\mathbf{x},\\mathbf{x}+\\tau\\Delta\\mathbf{x}}\\) moves approximately to \\(\\overline{\\mathbf{x}+\\mathbf{u}(\\mathbf{x}),\\mathbf{x}+\\tau\\Delta\\mathbf{x} +\\mathbf{u}(\\mathbf{x}+\\tau\\Delta\\mathbf{x})}\\) for small \\(\\tau\\), where \\(\\mathbf{x} = (x_1,x_2,x_3),\\, \\Delta\\mathbf{x}  = (\\Delta x_1,\\Delta x_2,\\Delta x_3)\\).\nWe now calculate the ratio between two segments:\n\n\\[\\eta(\\tau) = \\tau^{-1}|\\Delta\\mathbf{x}|^{-1}\n\\left(|\\mathbf{u}(\\mathbf{x}+\\tau\\Delta\\mathbf{x})\n-\\mathbf{u}(\\mathbf{x})+\\tau\\Delta\\mathbf{x}|-\\tau|\\Delta\\mathbf{x}|\\right)\\]\nthen we have (see e.g.[NECAS2017], p.32)\n\n\\[\\lim_{\\tau\\to 0}\\eta(\\tau) = (1+2e_{ij}\\nu_i\\nu_j)^{1/2}-1,\n\\quad 2e_{ij} = \\frac{\\partial u_k}{\\partial x_i}\\frac{\\partial u_k}{\\partial x_j}+\\left(\\frac{\\partial u_i}{\\partial x_j}+\n\\frac{\\partial u_j}{\\partial x_i}\\right)\\]\nwhere \\(\\nu_i = \\Delta x_i|\\Delta\\mathbf{x}|^{-1}\\).\nIf the deformation is small, then we may consider that:\n\n\\[(\\partial u_k/\\partial x_i)(\\partial u_k/\\partial x_i)\\approx 0\\]\nand the following is called small strain tensor:\n\n\\[\\varepsilon_{ij}(u) = \\frac{1}{2}\\left(\\frac{\\partial u_i}{\\partial x_j}+\n\\frac{\\partial u_j}{\\partial x_i}\\right)\\]\nThe tensor \\(e_{ij}\\) is called finite strain tensor.\nConsider the small plane \\(\\Delta \\Pi(\\mathbf{x})\\) centered at \\(\\mathbf{x}\\) with the unit normal direction \\(\\mathbf{n} = (n_1,n_2,n_3)\\), then the surface on \\(\\Delta \\Pi(\\mathbf{x})\\) at \\(\\mathbf{x}\\) is:\n\n\\[(\\sigma_{1j}(\\mathbf{x})n_j, \\sigma_{2j}(\\mathbf{x})n_j, \\sigma_{3j}(\\mathbf{x})n_j)\\]\nwhere \\(\\sigma_{ij}(\\mathbf{x})\\) is called stress tensor at \\(\\mathbf{x}\\).\nHookes law is the assumption of a linear relation between \\(\\sigma_{ij}\\) and \\(\\varepsilon_{ij}\\) such as:\n\n\\[\\sigma_{ij}(\\mathbf{x}) = c_{ijkl}(\\mathbf{x})\\varepsilon_{ij}(\\mathbf{x})\\]\nwith the symmetry \\(c_{ijkl} = c_{jikl}, c_{ijkl} = c_{ijlk}, c_{ijkl} = c_{klij}\\).\nIf Hookes tensor \\(c_{ijkl}(\\mathbf{x})\\) do not depend on the choice of coordinate system, the material is called isotropic at \\(\\mathbf{x}\\).\nIf \\(c_{ijkl}\\) is constant, the material is called homogeneous.\nIn homogeneous isotropic case, there is Lam constants \\(\\lambda, \\mu\\) (see e.g.[NECAS2017], p.43) satisfying\n\n\\[\\sigma_{ij} = \\lambda\\delta_{ij}\\textrm{div}\\mathbf{u}+2\\mu \\varepsilon_{ij}\\]\nwhere \\(\\delta_{ij}\\) is Kroneckers delta.\nWe assume that the elastic plate is fixed on \\(\\Gamma_D\\times ]-h,h[,\\, \\Gamma_D\\subset \\partial\\Omega\\).\nIf the body force \\(\\mathbf{f} = (f_1,f_2,f_3)\\) is given in \\(\\Omega\\times]-h,h[\\) and surface force \\(\\mathbf{g}\\) is given in \\(\\Gamma_N\\times]-h,h[, \\Gamma_N = \\partial\\Omega\\setminus\\overline{\\Gamma_D}\\), then the equation of equilibrium is given as follows:\n\n(45)\\[\\begin{split}\\begin{array}{rcl}\n    -\\partial_j \\sigma_{ij}& = &f_i~~\\textrm{in }\\Omega\\times ]-h,h[,\\quad\n    i = 1,2,3\\\\\n    \\sigma_{ij}n_j& = &g_i~~\\textrm{on }\\Gamma_N\\times ]-h,h[,\\quad\n    u_i = 0~~\\textrm{on }\\Gamma_D\\times ]-h,h[,\\quad i = 1,2,3\n\\end{array}\\end{split}\\]\nWe now explain the plain elasticity.\n\nPlain strain:\nOn the end of plate, the contact condition \\(u_3 = 0,\\, g_3 = \\) is satisfied.\nIn this case, we can suppose that \\(f_3 = g_3 = u_3 = 0\\) and \\(\\mathbf{u}(x_1,x_2,x_3) = \\overline{u}(x_1,x_2)\\) for all \\(-h<x_3<h\\).\n\nPlain stress:\nThe cylinder is assumed to be very thin and subjected to no load on the ends \\(x_3 = \\pm h\\), that is,\n\n\\[\\sigma_{3i} = 0,\\quad x_3 = \\pm h,\\quad i~1,2,3\\]\nThe assumption leads that \\(\\sigma_{3i} = 0\\) in \\(\\Omega\\times ]-h,h[\\) and \\(\\mathbf{u}(x_1,x_2,x_3) = \\overline{u}(x_1,x_2)\\) for all \\(-h<x_3<h\\).\n\nGeneralized plain stress:\nThe cylinder is subjected to no load at \\(x_3 = \\pm h\\).\nIntroducing the mean values with respect to thickness,\n\n\\[\\overline{u}_i(x_1,x_2) = \\frac{1}{2h}\\int_{-h}^h{u(x_1,x_2,x_3)dx_3}\\]\nand we derive \\(\\overline{u}_3\\equiv 0\\).\nSimilarly we define the mean values \\(\\overline{f},\\overline{g}\\) of the body force and surface force as well as the mean values \\(\\overline{\\varepsilon}_{ij}\\) and \\(\\overline{\\sigma}_{ij}\\) of the components of stress and strain, respectively.\n\n\nIn what follows we omit the overlines of \\(\\overline{u}, \\overline{f},\\overline{g}, \\overline{\\varepsilon}_{ij}\\) and \\(\\overline{\\varepsilon}_{ij}\\).\nThen we obtain similar equation of equilibrium given in (45) replacing \\(\\Omega\\times ]-h,h[\\) with \\(\\Omega\\) and changing \\(i = 1,2\\).\nIn the case of plane stress, \\(\\sigma_{ij} = \\lambda^* \\delta_{ij}\\textrm{div}u+2\\mu\\varepsilon_{ij}, \\lambda^* = (2\\lambda \\mu)/(\\lambda+\\mu)\\).\nThe equations of elasticity are naturally written in variational form for the displacement vector \\(\\mathbf{u}(\\mathbf{x})\\in V\\) as:\n\n\\[\\int_\\Omega [2\\mu\\epsilon_{ij}(\\mathbf{u})\\epsilon_{ij}(\\mathbf{v})\n+\\lambda \\epsilon_{ii}(\\mathbf{u})\\epsilon_{jj}(\\mathbf{v})]\n = \\int_\\Omega \\mathbf{f}\\cdot \\mathbf{v} +\\int_\\Gamma \\mathbf{g}\\cdot \\mathbf{v},\n\\forall \\mathbf{v}\\in V\\]\nwhere \\(V\\) is the linear closed subspace of \\(H^1(\\Omega)^2\\).\n\nTip\nBeam\nConsider an elastic plate with the undeformed rectangle shape \\(]0,10[\\times ]0,2[\\).\nThe body force is the gravity force \\(\\mathbf{f}\\) and the boundary force \\(\\mathbf{g}\\) is zero on lower and upper side.\nOn the two vertical sides of the beam are fixed.\n 1 // Parameters\n 2 real E  =  21.5;\n 3 real sigma  =  0.29;\n 4 real gravity  =  -0.05;\n 5 \n 6 // Mesh\n 7 border a(t = 2, 0){x = 0; y = t; label = 1;}\n 8 border b(t = 0, 10){x = t; y = 0; label = 2;}\n 9 border c(t = 0, 2){ x = 10; y = t; label = 1;}\n10 border d(t = 0, 10){ x = 10-t; y = 2; label = 3;}\n11 mesh th  =  buildmesh(b(20) + c(5) + d(20) + a(5));\n12 \n13 // Fespace\n14 fespace Vh(th, [P1, P1]);\n15 Vh [uu, vv];\n16 Vh [w, s];\n17 \n18 // Macro\n19 real sqrt2  =  sqrt(2.);\n20 macro epsilon(u1, u2) [dx(u1), dy(u2), (dy(u1)+dx(u2))/sqrt2] //\n21 macro div(u,v) (dx(u) + dy(v)) //\n22 \n23 // Problem\n24 real mu  =  E/(2*(1+sigma));\n25 real lambda  =  E*sigma/((1+sigma)*(1-2*sigma));\n26 solve Elasticity ([uu, vv], [w, s])\n27      =  int2d(th)(\n28           lambda*div(w,s)*div(uu,vv)\n29         + 2.*mu*( epsilon(w,s)'*epsilon(uu,vv) )\n30     )\n31     + int2d(th)(\n32         - gravity*s\n33     )\n34     + on(1, uu = 0, vv = 0)\n35 ;\n36 \n37 // Plot\n38 plot([uu, vv], wait = true);\n39 plot([uu,vv], wait = true, bb = [[-0.5, 2.5], [2.5, -0.5]]);\n40 \n41 // Movemesh\n42 mesh th1  =  movemesh(th, [x+uu, y+vv]);\n43 plot(th1, wait = true);\n\n\n\n\nTip\nBeam 3D\nConsider elastic box with the undeformed parallelepiped shape \\(]0,5[\\times ]0,1[\\times]0,1[\\).\nThe body force is the gravity force \\(\\mathbf{f}\\) and the boundary force \\(\\mathbf{g}\\) is zero on all face except one the one vertical left face where the beam is fixed.\n 1 include \"cube.idp\"\n 2 \n 3 // Parameters\n 4 int[int] Nxyz  =  [20, 5, 5];\n 5 real [int, int] Bxyz  =  [[0., 5.], [0., 1.], [0., 1.]];\n 6 int [int, int] Lxyz  =  [[1, 2], [2, 2], [2, 2]];\n 7 \n 8 real E  =  21.5e4;\n 9 real sigma  =  0.29;\n10 real gravity  =  -0.05;\n11 \n12 // Mesh\n13 mesh3 Th  =  Cube(Nxyz, Bxyz, Lxyz);\n14 \n15 // Fespace\n16 fespace Vh(Th, [P1, P1, P1]);\n17 Vh [u1, u2, u3], [v1, v2, v3];\n18 \n19 // Macro\n20 real sqrt2  =  sqrt(2.);\n21 macro epsilon(u1, u2, u3) [\n22     dx(u1), dy(u2), dz(u3),\n23     (dz(u2) + dy(u3))/sqrt2,\n24     (dz(u1) + dx(u3))/sqrt2,\n25     (dy(u1) + dx(u2))/sqrt2] //\n26 macro div(u1, u2, u3) (dx(u1) + dy(u2) + dz(u3)) //\n27 \n28 // Problem\n29 real mu  =  E/(2*(1+sigma));\n30 real lambda  =  E*sigma/((1+sigma)*(1-2*sigma));\n31 \n32 solve Lame ([u1, u2, u3], [v1, v2, v3])\n33      =  int3d(Th)(\n34           lambda*div(u1, u2, u3)*div(v1, v2, v3)\n35         + 2.*mu*( epsilon(u1, u2, u3)'*epsilon(v1, v2, v3) )\n36     )\n37     - int3d(Th)(\n38           gravity*v3\n39     )\n40     + on(1, u1 = 0, u2 = 0, u3 = 0)\n41     ;\n42 \n43 // Display\n44 real dmax  =  u1[].max;\n45 cout << \"max displacement  =  \" << dmax << endl;\n46 \n47 // Movemesh\n48 real coef  =  0.1/dmax;\n49 int[int] ref2  =  [1, 0, 2, 0];\n50 mesh3 Thm  =  movemesh3(Th, transfo = [x+u1*coef, y+u2*coef, z+u3*coef], label = ref2);\n51 Thm  =  change(Thm, label = ref2);\n52 \n53 // Plot\n54 plot(Th, Thm, wait = true, cmm = \"coef amplification  =  \"+coef);\n\n\n\n\n\nFig. 148 3d Beam deformed and undeformed box\n\n\n\n\nFracture Mechanics\nConsider the plate with the crack whose undeformed shape is a curve \\(\\Sigma\\) with the two edges \\(\\gamma_1,\\, \\gamma_2\\).\nWe assume the stress tensor \\(\\sigma_{ij}\\) is the state of plate stress regarding \\((x,y)\\in \\Omega_{\\Sigma} = \\Omega\\setminus \\Sigma\\).\nHere \\(\\Omega\\) stands for the undeformed shape of elastic plate without crack.\nIf the part \\(\\Gamma_N\\) of the boundary \\(\\partial\\Omega\\) is fixed and a load \\({\\cal L} = (\\mathbf{f},\\mathbf{g})\\in L^2(\\Omega)^2\\times L^2(\\Gamma_N)^2\\) is given, then the displacement \\(\\mathbf{u}\\) is the minimizer of the potential energy functional:\n\n\\[{\\cal E}(\\mathbf{v};{\\cal L},\\Omega_{\\Sigma})\n = \\int_{\\Omega_{\\Sigma}}\n\\{w(x,\\mathbf{v})-\\mathbf{f}\\cdot \\mathbf{v}\\}\n-\\int_{\\Gamma_N}\\mathbf{g}\\cdot \\mathbf{v}\\]\nover the functional space \\(V(\\Omega_{\\Sigma})\\),\n\n\\[V(\\Omega_{\\Sigma})\n = \\left\\{ \\mathbf{v}\\in H^1(\\Omega_{\\Sigma})^2;\\;\n\\mathbf{v} = 0\\quad \\hbox{ on }\n\\Gamma_D = \\partial\\Omega\\setminus\\overline{\\Gamma_N}\\right\\},\\]\nwhere \\(w(x,\\mathbf{v}) = \\sigma_{ij}(\\mathbf{v})\\varepsilon_{ij}(\\mathbf{v})/2\\),\n\n\\[\\sigma_{ij}(\\mathbf{v}) = C_{ijkl}(x)\\varepsilon_{kl}(\\mathbf{v}),\\quad\n\\varepsilon_{ij}(\\mathbf{v}) = (\\partial v_i/\\partial x_j+\n\\partial v_j/\\partial x_i)/2,\n\\qquad (C_{ijkl}:\\quad \\hbox{Hooke's tensor}).\\]\nIf the elasticity is homogeneous isotropic, then the displacement \\(\\mathbf{u}(x)\\) is decomposed in an open neighborhood \\(U_k\\) of \\(\\gamma_k\\) as in (see e.g.[OHTSUKA2000])\n\n(46)\\[\\mathbf{u}(x)  = \n\\sum_{l = 1}^2 K_l(\\gamma_k) r_k^{1/2} S^C_{kl}(\\theta_k)\n+ \\mathbf{u}_{k,R}(x)\n\\quad \\mbox{for }x\\in \\Omega_{\\Sigma}\\cap U_k,\\, k = 1,2\\]\nwith \\(\\mathbf{u}_{k,R} \\in H^2(\\Omega_\\Sigma\\cap U_k)^2\\), where \\(U_k,\\, k = 1,2\\) are open neighborhoods of \\(\\gamma_k\\) such that \\(\\partial L_1\\cap U_1 = \\gamma_1,\\, \\partial L_m\\cap U_2 = \\gamma_2\\), and\n\n\\[\\begin{split}\\begin{array}{rcl}\n    S^C_{k1}(\\theta_k) &  =  & \\frac 1 {4\\mu} \\frac 1 {(2\\pi)^{1/2}}\n        \\left[ \\begin{array}{c}\n        [2\\kappa-1]\\cos(\\theta_k/2)-\\cos(3\\theta_k/2)\\\\\n        -[2\\kappa+1]\\sin(\\theta_k/2)+\\sin(3\\theta_k/2)\n        \\end{array}\\right],\\\\\n    S^C_{k2}(\\theta_k) &  =  & \\frac 1 {4\\mu} \\frac 1 {(2\\pi)^{1/2}}\n        \\left[ \\begin{array}{c}\n        -[2\\kappa-1]\\sin(\\theta_k/2)+3\\sin(3\\theta_k/2)\\\\\n        -[2\\kappa+1]\\cos(\\theta_k/2)+\\cos(3\\theta_k/2)\n        \\end{array}\\right]. \\nonumber\n\\end{array}\\end{split}\\]\nwhere \\(\\mu\\) is the shear modulus of elasticity, \\(\\kappa = 3-4\\nu\\) (\\(\\nu\\) is the Poissons ratio) for plane strain and \\(\\kappa = \\frac {3-\\nu} {1+\\nu}\\) for plane stress.\nThe coefficients \\(K_1(\\gamma_i)\\) and \\(K_2(\\gamma_i),\\) which are important parameters in fracture mechanics, are called stress intensity factors of the opening mode (mode I) and the sliding mode (mode II), respectively.\nFor simplicity, we consider the following simple crack\n\n\\[\\Omega = \\{(x,y):\\; -1<x<1, -1<y<1\\},\\qquad\n\\Sigma = \\{(x,y):\\; -1\\le x\\le 0, y = 0\\}\\]\nwith only one crack tip \\(\\gamma = (0,0)\\).\nUnfortunately, FreeFEM cannot treat crack, so we use the modification of the domain with U-shape channel (see U-shape example, Fig. 85) with \\(d = 0.0001\\).\nThe undeformed crack \\(\\Sigma\\) is approximated by\n\n\\[\\Sigma_d  =  \\{(x,y):\\; -1\\le x\\le -10*d, -d\\le y\\le d\\} \\cup\\{(x,y):\\; -10*d\\le x\\le 0, -d+0.1*x\\le y\\le d-0.1*x\\}\\]\nand \\(\\Gamma_D = \\)R in U-shape example, Fig. 85.\nIn this example, we use three technique:\n\nFast Finite Element Interpolator from the mesh Th to Zoom for the scale-up of near \\(\\gamma\\).\nAfter obtaining the displacement vector \\(\\mathbf{u} = (u,v)\\), we shall watch the deformation of the crack near \\(\\gamma\\) as follows,\n1 mesh Plate  =  movemesh(Zoom, [x+u, y+v]);\n2 plot(Plate);\n\n\n\nAdaptivity is an important technique here, because a large singularity occurs at \\(\\gamma\\) as shown in (46).\n\nThe first example creates mode I deformation by the opposed surface force on B and T in the vertical direction of \\(\\Sigma\\), and the displacement is fixed on R.\nIn a laboratory, fracture engineers use photoelasticity to make stress field visible, which shows the principal stress difference\n\n\\[\\sigma_1-\\sigma_2 = \\sqrt{(\\sigma_{11}-\\sigma_{22})^2+4\\sigma_{12}^2}\\]\nwhere \\(\\sigma_1\\) and \\(\\sigma_2\\) are the principal stresses.\nIn opening mode, the photoelasticity make symmetric pattern concentrated at \\(\\gamma\\).\n\nTip\nCrack Opening, \\(K_2(\\gamma) = 0\\)\n 1 //Parameters\n 2 real d  =  0.0001; int n  =  5; real cb  =  1, ca  =  1, tip  =  0.0;\n 3 \n 4 real E  =  21.5;\n 5 real sigma  =  0.29;\n 6 \n 7 // Mesh\n 8 border L1(t = 0, ca-d){x = -cb; y = -d-t;}\n 9 border L2(t = 0, ca-d){x = -cb; y = ca-t;}\n10 border B(t = 0, 2){x = cb*(t-1); y = -ca;}\n11 border C1(t = 0, 1){x = -ca*(1-t)+(tip-10*d)*t; y = d;}\n12 border C21(t = 0, 1){x = (tip-10*d)*(1-t)+tip*t; y = d*(1-t);}\n13 border C22(t = 0, 1){x = (tip-10*d)*t+tip*(1-t); y = -d*t;}\n14 border C3(t = 0, 1){x = (tip-10*d)*(1-t)-ca*t; y = -d;}\n15 border C4(t = 0, 2*d){x = -ca; y = -d+t;}\n16 border R(t = 0, 2){x = cb; y = cb*(t-1);}\n17 border T(t = 0, 2){x = cb*(1-t); y = ca;}\n18 mesh Th  =  buildmesh(L1(n/2) + L2(n/2) + B(n)\n19     + C1(n) + C21(3) + C22(3) + C3(n) + R(n) + T(n));\n20 plot(Th, wait = true);\n21 \n22 cb = 0.1; ca = 0.1;\n23 mesh Zoom  =  buildmesh(L1(n/2) + L2(n/2) + B(n) + C1(n)\n24     + C21(3) + C22(3) + C3(n) + R(n) + T(n));\n25 plot(Zoom, wait = true);\n26 \n27 // Fespace\n28 fespace Vh(Th, [P2, P2]);\n29 Vh [u, v];\n30 Vh [w, s];\n31 \n32 fespace zVh(Zoom, P2);\n33 zVh Sx, Sy, Sxy, N;\n34 \n35 // Problem\n36 real mu  =  E/(2*(1+sigma));\n37 real lambda  =  E*sigma/((1+sigma)*(1-2*sigma));\n38 solve Problem ([u, v], [w, s])\n39      =  int2d(Th)(\n40           2*mu*(dx(u)*dx(w) + ((dx(v)+dy(u))*(dx(s)+dy(w)))/4)\n41         + lambda*(dx(u) + dy(v))*(dx(w) + dy(s))/2\n42     )\n43     -int1d(Th, T)(\n44           0.1*(1-x)*s\n45     )\n46     +int1d(Th, B)(\n47           0.1*(1-x)*s\n48     )\n49     +on(R, u = 0, v = 0)\n50     ;\n51 \n52 // Loop\n53 for (int i  =  1; i < =  5; i++){\n54     mesh Plate  =  movemesh(Zoom, [x+u, y+v]); //deformation near gamma\n55     Sx  =  lambda*(dx(u) + dy(v)) + 2*mu*dx(u);\n56     Sy  =  lambda*(dx(u) + dy(v)) + 2*mu*dy(v);\n57     Sxy  =  mu*(dy(u) + dx(v));\n58     N  =  0.1*1*sqrt((Sx-Sy)^2 + 4*Sxy^2); //principal stress difference\n59     if (i  =  =  1){\n60         plot(Plate, bw = 1);\n61         plot(N, bw = 1);\n62     }\n63     else if (i  =  =  5){\n64         plot(Plate, bw = 1);\n65         plot(N, bw = 1);\n66         break;\n67     }\n68 \n69     // Adaptmesh\n70     Th  =  adaptmesh(Th, [u, v]);\n71 \n72     // Solve\n73     Problem;\n74 }\n\n\n\n\n\n\nFig. 149 Crack open displacement (COD) on the first mesh\n\n\n\n\n\nFig. 150 Principal stress difference on the first mesh\n\n\n\n\n\nFig. 151 COD on the last adaptive mesh\n\n\n\n\n\nFig. 152 Principal stress difference on the last adaptive mesh\n\n\n\nIt is difficult to create mode II deformation by the opposed shear force on B and T that is observed in a laboratory.\nSo we use the body shear force along \\(\\Sigma\\), that is, the \\(x\\)-component \\(f_1\\) of the body force \\(\\mathbf{f}\\) is given by\n\n\\[f_1(x,y) = H(y-0.001)*H(0.1-y)-H(-y-0.001)*H(y+0.1)\\]\nwhere \\(H(t) = 1\\) if \\(t>0\\); \\( =  0\\) if \\(t<0\\).\n\nTip\nCrack Sliding, \\(K_2(\\gamma) = 0\\)\n 1 // Parameters\n 2 real d  =  0.0001; int n  =  5; real cb  =  1, ca  =  1, tip  =  0.0;\n 3 \n 4 real E  =  21.5;\n 5 real sigma  =  0.29;\n 6 \n 7 // Mesh\n 8 border L1(t = 0, ca-d){x = -cb; y = -d-t;}\n 9 border L2(t = 0, ca-d){x = -cb; y = ca-t;}\n10 border B(t = 0, 2){x = cb*(t-1); y = -ca;}\n11 border C1(t = 0, 1){x = -ca*(1-t)+(tip-10*d)*t; y = d;}\n12 border C21(t = 0, 1){x = (tip-10*d)*(1-t)+tip*t; y = d*(1-t);}\n13 border C22(t = 0, 1){x = (tip-10*d)*t+tip*(1-t); y = -d*t;}\n14 border C3(t = 0, 1){x = (tip-10*d)*(1-t)-ca*t; y = -d;}\n15 border C4(t = 0, 2*d){x = -ca; y = -d+t;}\n16 border R(t = 0, 2){x = cb; y = cb*(t-1);}\n17 border T(t = 0, 2){x = cb*(1-t); y = ca;}\n18 mesh Th  =  buildmesh(L1(n/2) + L2(n/2) + B(n)\n19     + C1(n) + C21(3) + C22(3) + C3(n) + R(n) + T(n));\n20 plot(Th, wait = true);\n21 \n22 cb = 0.1; ca = 0.1;\n23 mesh Zoom  =  buildmesh(L1(n/2) + L2(n/2) + B(n) + C1(n)\n24     + C21(3) + C22(3) + C3(n) + R(n) + T(n));\n25 plot(Zoom, wait = true);\n26 \n27 // Fespace\n28 fespace Vh(Th, [P2, P2]);\n29 Vh [u, v];\n30 Vh [w, s];\n31 \n32 fespace zVh(Zoom, P2);\n33 zVh Sx, Sy, Sxy, N;\n34 \n35 fespace Vh1(Th,P1);\n36 Vh1 fx  =  ((y>0.001)*(y<0.1))-((y<-0.001)*(y>-0.1));\n37 \n38 // Problem\n39 real mu  =  E/(2*(1+sigma));\n40 real lambda  =  E*sigma/((1+sigma)*(1-2*sigma));\n41 solve Problem ([u, v], [w, s])\n42      =  int2d(Th)(\n43           2*mu*(dx(u)*dx(w) + ((dx(v) + dy(u))*(dx(s)+ dy(w)))/4)\n44         + lambda*(dx(u) + dy(v))*(dx(w) + dy(s))/2\n45     )\n46     -int2d(Th)(\n47           fx*w\n48     )\n49     +on(R, u = 0, v = 0)\n50     ;\n51 \n52 // Loop\n53 for (int i  =  1; i < =  3; i++){\n54     mesh Plate  =  movemesh(Zoom, [x+u, y+v]); //deformation near gamma\n55     Sx  =  lambda*(dx(u) + dy(v)) + 2*mu*dx(u);\n56     Sy  =  lambda*(dx(u) + dy(v)) + 2*mu*dy(v);\n57     Sxy  =  mu*(dy(u) + dx(v));\n58     N  =  0.1*1*sqrt((Sx-Sy)^2 + 4*Sxy^2); //principal stress difference\n59     if (i  =  =  1){\n60         plot(Plate, bw = 1);\n61         plot(N, bw = 1);\n62     }\n63     else if (i  =  =  3) {\n64         plot(Plate, bw = 1);\n65         plot(N, bw = 1);\n66         break;\n67     }\n68 \n69     // Adaptmesh\n70     Th = adaptmesh(Th, [u, v]);\n71 \n72     // Solve\n73     Problem;\n74 }\n\n\n\n\n\n\nFig. 153 COD on the first mesh\n\n\n\n\n\nFig. 154 Principal stress difference in the first mesh\n\n\n\n\n\nFig. 155 COD on the last adaptive mesh\n\n\n\n\n\nFig. 156 Principal stress difference on the last adaptive mesh\n\n\n\n\n\n\n\n\t\t\n\t\t\t Previous topic: Static problems\n\t\t\tNext topic: Non-linear static problems \n\t\t\n\t","l":"models/elasticity.html"},"41":{"t":"Evolution problems","p":"\n\t\t\n   \nEvolution problems\nFreeFEM also solves evolution problems such as the heat equation:\n\n(47)\\[\\begin{split}\\begin{array}{rcll}\n    \\frac{\\p u}{\\p t}-\\mu\\Delta u & = & f & \\textrm{ in }\\Omega\\times ]0,T[\\\\\n    u(\\mathbf{x},0) & = & u_0(\\mathbf{x}) & \\textrm{ in }\\Omega\\\\\n    \\left(\\p u/\\p n\\right)(\\mathbf{x},t) & = & 0 & \\textrm{ on }\\p\\Omega\\times ]0,T[\n\\end{array}\\end{split}\\]\nwith a positive viscosity coefficient \\(\\mu\\) and homogeneous Neumann boundary conditions.\nWe solve (47) by FEM in space and finite differences in time.\nWe use the definition of the partial derivative of the solution in the time derivative:\n\n\\[\\frac{\\p u}{\\p t}(x,y,t)  =  \\lim_{\\tau \\to 0}\\frac{u(x,y,t)-u(x,y,t-\\tau )}{\\tau }\\]\nwhich indicates that \\(u^m(x,y) = u(x,y,m\\tau )\\) will satisfy approximatively:\n\n\\[\\frac{\\p u}{\\p t}(x,y,m\\tau )\\simeq \\frac{u^m(x,y)-u^{m-1}(x,y)}{\\tau }\\]\nThe time discretization of heat equation (47) is as follows, \\(\\forall m = 0,\\cdots,[T/\\tau ]\\):\n\n\\[\\begin{split}\\begin{array}{rcll}\n    \\frac{u^{m+1}-u^{m}}{\\tau }-\\mu\\Delta u^{m+1} & = & f^{m+1} & \\textrm{ in }\\Omega\\\\\n    u^0(\\mathbf{x}) & = & u_0(\\mathbf{x}) & \\textrm{ in }\\Omega\\\\\n    \\p u^{m+1}/\\p n(\\mathbf{x}) & = & 0 & \\textrm{ on }\\p\\Omega\n\\end{array}\\end{split}\\]\nwhich is so-called backward Euler method for (47).\nTo obtain the variational formulation, multiply with the test function \\(v\\) both sides of the equation:\n\n\\[\\int_{\\Omega}\\{u^{m+1}v-\\tau \\Delta u^{m+1}v\\} = \\int_{\\Omega}\\{u^m+\\tau f^{m+1}\\}v\\]\nBy the divergence theorem, we have:\n\n\\[\\int_{\\Omega}\\{u^{m+1}v+\\tau\\nabla u^{m+1}\\cdot \\nabla v\\}\n-\\int_{\\p\\Omega} \\tau \\left( \\p u^{m+1}/\\p n\\right) v\n = \\int_{\\Omega }\\{u^mv+\\tau f^{m+1}v\\}\\]\nBy the boundary condition \\(\\p u^{m+1}/\\p n = 0\\), it follows that:\n\n(48)\\[\\int_{\\Omega} \\{u^{m+1}v+\\tau \\nabla u^{m+1}\\cdot \\nabla v\\}\n-\\int_{\\Omega }\\{u^mv+\\tau f^{m+1}v\\}\n = 0\\]\nUsing the identity just above, we can calculate the finite element approximation \\(u_h^m\\) of \\(u^m\\) in a step-by-step manner with respect to \\(t\\).\n\nTip\nExample\nWe now solve the following example with the exact solution \\(u(x,y,t) = tx^4\\), \\(\\Omega  =  ]0,1[^2\\).\n\n\\[\\begin{split}\\begin{array}{rcll}\n    \\frac{{\\p u}}{{\\p t}} - \\mu \\Delta u & = & x^4 - \\mu 12tx^2 & \\textrm{ in }\\Omega\\times ]0,3[\\\\\n    u(x,y,0) & = & 0 & \\textrm{ on }\\Omega\\\\\n    \\left. u \\right|_{\\p\\Omega} & = & t*x^4\n\\end{array}\\end{split}\\]\n 1 // Parameters\n 2 real dt  =  0.1;\n 3 real mu  =  0.01;\n 4 \n 5 // Mesh\n 6 mesh Th  =  square(16, 16);\n 7 \n 8 // Fespace\n 9 fespace Vh(Th, P1);\n10 Vh u, v, uu, f, g;\n11 \n12 // Problem\n13 problem dHeat (u, v)\n14      =  int2d(Th)(\n15           u*v\n16         + dt*mu*(dx(u)*dx(v) + dy(u)*dy(v))\n17     )\n18     + int2d(Th)(\n19         - uu*v\n20         - dt*f*v\n21     )\n22     + on(1, 2, 3, 4, u = g)\n23     ;\n24 \n25 // Time loop\n26 real t  =  0;\n27 uu  =  0;\n28 for (int m  =  0; m < =  3/dt; m++){\n29     // Update\n30     t  =  t+dt;\n31     f  =  x^4 - mu*t*12*x^2;\n32     g  =  t*x^4;\n33     uu  =  u;\n34 \n35     // Solve\n36     dHeat;\n37 \n38     // Plot\n39     plot(u, wait = true);\n40     cout << \"t = \" << t << \" - L^2-Error = \" << sqrt(int2d(Th)((u-t*x^4)^2)) << endl;\n41 }\n\n\nIn the last statement, the \\(L^2\\)-error \\(\\left(\\int_{\\Omega}\\left| u-tx^4\\right|^2\\right)^{1/2}\\) is calculated at \\(t = m\\tau, \\tau  = 0.1\\). At \\(t = 0.1\\), the error is 0.000213269. The errors increase with \\(m\\) and 0.00628589 at \\(t = 3\\).\nThe iteration of the backward Euler (48) is made by for loop.\n\nNote\nThe stiffness matrix in the loop is used over and over again.\nFreeFEM support reuses of stiffness matrix.\n\n\n\nMathematical Theory on Time Difference Approximations.\nIn this section, we show the advantage of implicit schemes.\nLet \\(V, H\\) be separable Hilbert space and \\(V\\) is dense in \\(H\\).\nLet \\(a\\) be a continuous bilinear form over \\(V \\times V\\) with coercivity and symmetry.\nThen \\(\\sqrt{a(v,v)}\\) become equivalent to the norm \\(\\| v\\|\\) of \\(V\\).\nProblem Ev(f,Omega): For a given \\(f\\in L^2(0,T;V'),\\, u^0\\in H\\)\n\n\\[\\begin{split}\\begin{array}{rcl}\n    \\frac{d}{dt}(u(t),v)+a(u(t),v)& = &( f(t),v)\\qquad \\forall v\\in V,\\quad a.e. \\, t\\in [0,T]\\\\\n    u(0)& = &u^0\\nonumber\n\\end{array}\\end{split}\\]\nwhere \\(V'\\) is the dual space of \\(V\\).\nThen, there is an unique solution \\(u\\in L^{\\infty}(0,T;H)\\cap L^2(0,T;V)\\).\nLet us denote the time step by \\(\\tau>0\\), \\(N_T = [T/\\tau]\\).\nFor the discretization, we put \\(u^n  =  u(n\\tau)\\) and consider the time difference for each \\(\\theta\\in [0,1]\\)\n\n(49)\\[\\begin{split}\\begin{array}{rcl}\n    \\frac{1}{\\tau}\\left( u_h^{n+1}-u_h^n,\\phi_i\\right) +a\\left( u_h^{n+\\theta},\\phi_i\\right)& = &\\langle f^{n+\\theta},\\phi_i\\rangle\\\\\n    i = 1,&\\cdots&, m,\\quad n = 0,\\cdots, N_T\\nonumber\\\\\n    u_h^{n+\\theta}& = &\\theta u_h^{n+1}+(1-\\theta)u_h^n,\\\\\n    f^{n+\\theta}& = &\\theta f^{n+1}+(1-\\theta)f^n\\nonumber\n\\end{array}\\end{split}\\]\nFormula (49) is the forward Euler scheme if \\(\\theta = 0\\), Crank-Nicolson scheme if \\(\\theta = 1/2\\), the backward Euler scheme if \\(\\theta = 1\\).\nUnknown vectors \\(u^n = (u_h^1,\\cdots,u_h^M)^T\\) in\n\n\\[u_h^n(x) = u^n_1\\phi_1(x)+\\cdots+u^n_m\\phi_m(x),\\quad u^n_1,\\cdots,u^n_m\\in \\R\\]\nare obtained from solving the matrix\n\n(50)\\[\\begin{split}(M+\\theta\\tau A)u^{n+1} = \\{M-(1-\\theta)\\tau A\\}u^n\n+\\tau\\left\\{\\theta f^{n+1}+(1-\\theta)f^n\\right\\}\\\\\nM = (m_{ij}),\\quad m_{ij} = (\\phi_j,\\phi_i),\\qquad\nA = (a_{ij}),\\quad a_{ij} = a(\\phi_j,\\phi_i)\\nonumber\\end{split}\\]\nRefer [TABATA1994], pp.7075 for solvability of (50). The stability of (50) is in [TABATA1994], Theorem 2.13:\nLet \\(\\{\\mathcal{T}_h\\}_{h\\downarrow 0}\\) be regular triangulations (see Regular Triangulation).\nThen there is a number \\(c_0>0\\) independent of \\(h\\) such that,\n\n\\[\\begin{split}|u_h^n|^2\\le\n\\left\\{\n\\begin{array}{lr}\n\\frac{1}{\\delta}\\left\\{\n|u^0_h|^2+\\tau \\sum_{k = 0}^{n-1}\\|f^{k+\\theta}\\|^2_{V_h'}\n\\right\\}&\\theta\\in [0,1/2)\\\\\n|u^0_h|^2+\\tau \\sum_{k = 0}^{n-1}\\|f^{k+\\theta}\\|^2_{V_h'}&\\theta\\in [1/2,1]\n\\end{array}\n\\right.\\end{split}\\]\nif the following are satisfied:\n\nWhen \\(\\theta\\in [0,1/2)\\), then we can take a time step \\(\\tau\\) in such a way that\n\n\n\\[\\tau <\\frac{2(1-\\delta)}{(1-2\\theta)c_0^2}h^2\\]\nfor arbitrary \\(\\delta\\in (0,1)\\).\n\n\nWhen \\(1/2\\leq \\theta\\leq 1\\), we can take \\(\\tau\\) arbitrary.\n\n\nTip\nExample\n 1 // Parameters\n 2 real tau  =  0.1; real\n 3 theta  =  0.;\n 4 \n 5 // Mesh\n 6 mesh Th  =  square(12, 12);\n 7 \n 8 // Fespace\n 9 fespace Vh(Th, P1);\n10 Vh u, v, oldU;\n11 Vh f1, f0;\n12 \n13 fespace Ph(Th, P0);\n14 Ph h  =  hTriangle; // mesh sizes for each triangle\n15 \n16 // Function\n17 func real f (real t){\n18     return x^2*(x-1)^2 + t*(-2 + 12*x - 11*x^2 - 2*x^3 + x^4);\n19 }\n20 \n21 // File\n22 ofstream out(\"err02.csv\"); //file to store calculations\n23 out << \"mesh size  =  \" << h[].max << \", time step  =  \" << tau << endl;\n24 for (int n  =  0; n < 5/tau; n++)\n25     out << n*tau << \",\";\n26 out << endl;\n27 \n28 // Problem\n29 problem aTau (u, v)\n30      =  int2d(Th)(\n31           u*v\n32         + theta*tau*(dx(u)*dx(v) + dy(u)*dy(v) + u*v)\n33     )\n34     - int2d(Th)(\n35           oldU*v\n36         - (1-theta)*tau*(dx(oldU)*dx(v) + dy(oldU)*dy(v) + oldU*v)\n37     )\n38     - int2d(Th)(\n39           tau*(theta*f1 + (1-theta)*f0)*v\n40     )\n41     ;\n42 \n43 // Theta loop\n44 while (theta < =  1.0){\n45     real t  =  0;\n46     real T  =  3;\n47     oldU  =  0;\n48     out << theta << \",\";\n49     for (int n  =  0; n < T/tau; n++){\n50         // Update\n51         t  =  t + tau;\n52         f0  =  f(n*tau);\n53         f1  =  f((n+1)*tau);\n54 \n55         // Solve\n56         aTau;\n57         oldU  =  u;\n58 \n59         // Plot\n60         plot(u);\n61 \n62         // Error\n63         Vh uex  =  t*x^2*(1-x)^2; //exact solution  =  tx^2(1-x)^2\n64         Vh err  =  u - uex; // err  =  FE-sol - exact\n65         out << abs(err[].max)/abs(uex[].max) << \",\";\n66     }\n67     out << endl;\n68     theta  =  theta + 0.1;\n69 }\n\n\n\n\n\nFig. 159 \\(\\max_{x\\in\\Omega}\\vert u_h^n(\\theta)-u_{ex}(n\\tau)\\vert\\max_{x\\in\\Omega}\\vert u_{ex}(n\\tau)\\vert at n = 0,1,\\cdots,29\\)\n\n\nWe can see in Fig. 159 that \\(u_h^n(\\theta)\\) become unstable at \\(\\theta = 0.4\\), and figures are omitted in the case \\(\\theta<0.4\\).\n\n\n\nConvection\nThe hyperbolic equation\n\n(51)\\[\\p_t u +\\mathbf{\\alpha} \\cdot \\nabla u = f;\\ \\textrm{ for a vector-valued function }\\mathbf{\\alpha}\\]\nappears frequently in scientific problems, for example in the Navier-Stokes equations, in the Convection-Diffusion equation, etc.\nIn the case of 1-dimensional space, we can easily find the general solution \\((x,t)\\mapsto u(x,t) = u^0(x-\\alpha t)\\) of the following equation, if \\(\\alpha\\) is constant,\n\n(52)\\[\\begin{split}\\begin{array}{rcl}\n    \\p_t u +\\alpha\\p_x u & = & 0\\\\\n    u(x,0) & = & u^0(x),\n\\end{array}\\end{split}\\]\nbecause \\(\\p_t u +\\alpha\\p_x u = -\\alpha\\dot{u}^0+a\\dot{u}^0 = 0\\), where \\(\\dot{u}^0 = du^0(x)/dx\\).\nEven if \\(\\alpha\\) is not constant, the construction works on similar principles.\nOne begins with the ordinary differential equation (with the convention that \\(\\alpha\\) is prolonged by zero apart from \\((0,L)\\times (0,T)\\)):\n\n\\[\\dot{X}(\\tau ) = +\\alpha(X(\\tau ),\\tau ),\\ \\tau \\in (0,t)\\quad X(t) = x\\]\nIn this equation \\(\\tau\\) is the variable and \\(x,t\\) are parameters, and we denote the solution by \\(X_{x,t}(\\tau )\\).\nThen it is noticed that \\((x,t)\\rightarrow v(X(\\tau),\\tau)\\) in \\(\\tau = t\\) satisfies the equation\n\n\\[\\p _{t}v+\\alpha\\p _{x}v = \\p _{t}X\\dot{v}+a\\p _{x}X\\dot{v}%\n = 0\\]\nand by the definition \\(\\p _{t}X = \\dot{X} = +\\alpha\\) and \\(\\p_{x}X = \\p _{x}x\\) in \\(\\tau = t\\), because if \\(\\tau  = t\\) we have \\(X(\\tau ) = x\\).\nThe general solution of (52) is thus the value of the boundary condition in \\(X_{x, t}(0)\\), that is to say \\(u(x,t) = u^{0}(X_{x,t}(0))\\) where \\(X_{x,t}(0)\\) is on the \\(x\\) axis, \\(u(x,t) = u^{0}(X_{x,t}(0))\\) if \\(X_{x,t}(0)\\) is on the axis of \\(t\\).\nIn higher dimension \\(\\Omega \\subset R^{d},~d = 2,3\\), the equation for the convection is written\n\n\\[\\p _{t}u+\\mathbf{\\alpha}\\cdot \\nabla u = 0\\hbox{ in }\\Omega \\times (0,T)\\]\nwhere \\(\\mathbf{a}(x,t)\\in \\R^{d}\\).\nFreeFEM implements the Characteristic-Galerkin method for convection operators.\nRecall that the equation (51) can be discretized as\n\n\\[\\frac{Du}{Dt}  =  f\\;\\;\\textrm{i.e. }\\frac{du}{dt}\\left( {X(t),t} \\right)  =  f\\left(X( t ),t \\right)\\textrm{ where }\\frac{dX}{dt}( t )  =  \\mathbf{\\alpha}( {X(t),t})\\]\nwhere \\(D\\) is the total derivative operator.\nSo a good scheme is one step of backward convection by the method of Characteristics-Galerkin\n\n(53)\\[\\frac{1}{{\\tau }}\\left(u^{m + 1}(x) - u^m(X^m(x))\\right)  =  f^m (x)\\]\nwhere \\(X^m (x)\\) is an approximation of the solution at \\(t  =  m\\tau\\) of the ordinary differential equation\n\n\\[\\frac{d\\mathbf{X}}{dt}(t)  =  \\mathbf{\\alpha}^m(\\mathbf{X}(t)), \\mathbf{X}((m + 1)\\tau)  =  x.\\]\nwhere \\(\\mathbf{\\alpha}^m(x) = (\\alpha_1(x,m\\tau ),\\alpha_2(x,m\\tau))\\).\nBecause, by Taylors expansion, we have\n\n(54)\\[\\begin{split}\\begin{array}{rcl}\n    u^m(\\mathbf{X}(m\\tau ))& = &\n    u^m(\\mathbf{X}((m+1)\\tau )) -\n    \\tau \\sum_{i = 1}^d \\frac{\\p u^m}{\\p x_i}(\\mathbf{X}((m+1)\\tau ))\n    \\frac{\\p X_i}{\\p t}((m+1)\\tau )\n    +o(\\tau )\\nonumber\\\\\n    & = &u^m(x)-\\tau \\mathbf{\\alpha}^m(x)\\cdot \\nabla u^m(x)+o(\\tau )\n\\end{array}\\end{split}\\]\nwhere \\(X_i(t)\\) are the i-th component of \\(\\mathbf{X}(t)\\), \\(u^m(x) = u(x,m\\tau )\\) and we used the chain rule and \\(x = \\mathbf{X}((m+1)\\tau )\\).\nFrom (54), it follows that\n\n\\[u^m(X^m(x)) = u^m(x)-\\tau \\mathbf{\\alpha}^m(x)\\cdot \\nabla u^m(x)+o(\\tau )\\]\nAlso we apply Taylors expansion for \\(t \\rightarrow u^m(x-\\mathbf{\\alpha}^m(x)t),0\\le t\\le \\tau\\), then\n\n\\[u^m(x-\\mathbf{\\alpha}\\tau ) = u^m(x)-\\tau \\mathbf{\\alpha}^m(x)\\cdot \\nabla u^m(x)+o(\\tau ).\\]\nPutting\nconvect\\(\\left( {\\mathbf{\\alpha},-\\tau ,u^m } \\right)\\approx u^m \\left(x - \\mathbf{\\alpha}^m\\tau \\right)\\)\nwe can get the approximation\n\\(u^m \\left( {X^m( x )} \\right) \\approx\\) convect \\(\\left( {[a_1^m ,a_2^m],-\\tau ,u^m } \\right)\\) by \\(X^m \\approx x \\mapsto x- \\tau [a_1^m(x) ,a_2^m(x)]\\)\nA classical convection problem is that of the rotating bell (quoted from [LUCQUIN1998], p.16).\nLet \\(\\Omega\\) be the unit disk centered at 0, with its center rotating with speed \\(\\alpha_1  =  y,\\, \\alpha_2  =  -x\\).\nWe consider the problem (51) with \\(f = 0\\) and the initial condition \\(u(x,0) = u^0(x)\\), that is, from (53)\n\\(u^{m + 1}(x)  =  u^m(X^m(x))\\approx\\) convect\\((\\mathbf{\\alpha},-\\tau ,u^m)\\)\nThe exact solution is \\(u(x, t)  =  u(\\mathbf{X}(t))\\) where \\(\\mathbf{X}\\) equals \\(x\\) rotated around the origin by an angle \\(\\theta  =  -t\\) (rotate in clockwise).\nSo, if \\(u^0\\) in a 3D perspective looks like a bell, then \\(u\\) will have exactly the same shape, but rotated by the same amount.\nThe program consists in solving the equation until \\(T  =  2\\pi\\), that is for a full revolution and to compare the final solution with the initial one; they should be equal.\n\nTip\nConvect\n 1 // Parameters\n 2 real dt  =  0.17;\n 3 \n 4 // Mesh\n 5 border C(t = 0, 2*pi){x = cos(t); y = sin(t);}\n 6 mesh Th  =  buildmesh(C(70));\n 7 \n 8 // Fespace\n 9 fespace Vh(Th, P1);\n10 Vh u0;\n11 Vh a1  =  -y, a2  =  x; //rotation velocity\n12 Vh u;\n13 \n14 // Initialization\n15 u  =  exp(-10*((x-0.3)^2 +(y-0.3)^2));\n16 \n17 // Time loop\n18 real t  =  0.;\n19 for (int m  =  0; m < 2*pi/dt; m++){\n20     // Update\n21     t + =  dt;\n22     u0  =  u;\n23 \n24     // Convect\n25     u  =  convect([a1, a2], -dt, u0); //u^{m+1} = u^m(X^m(x))\n26 \n27     // Plot\n28     plot(u, cmm = \" t = \"+t+\", min = \"+u[].min+\", max = \"+u[].max);\n29 }\n\n\n\nNote\nThe scheme convect is unconditionally stable, then the bell become lower and lower (the maximum of \\(u^{37}\\) is \\(0.406\\) as shown in Fig. 160.\n\n\n\n\n\nFig. 160 \\(u^0 = e^{-10((x-0.3)^2 +(y-0.3)^2)}\\)\n\n\n\n\n\nFig. 161 The bell at \\(t = 6.29\\)\n\n\n\n\n\n2D Black-Scholes equation for an European Put option\nIn mathematical finance, an option on two assets is modeled by a Black-Scholes equations in two space variables, (see for example [WILMOTT1995] or [ACHDOU2005]).\n\n\\[\\begin{split}\\begin{array}{rcl}\n    \\p _t u &+& \\frac{{\\left( {\\sigma _1 x } \\right)^2 }}{2}\\frac{{\\p ^2 u}}{{\\p x^2 }} + \\frac{{\\left( {\\sigma _2 y } \\right)^2 }}{2}\\frac{{\\p ^2 u}}{{\\p y^2 }} \\\\\n    &&{\\rm{ }} + \\rho x y \\frac{{\\p ^2 u}}{{\\p x \\p y }} + rS_1 \\frac{{\\p u}}{{\\p x }} + rS_2 \\frac{{\\p u}}{{\\p y }} - rP  =  0 \\nonumber\n\\end{array}\\end{split}\\]\nwhich is to be integrated in \\(\\left( {0,T} \\right) \\times \\R^ + \\times \\R^ +\\) subject to, in the case of a put\n\n\\[u\\left( {x , y ,T} \\right)  =  \\left( {K - \\max \\left( {x ,y } \\right)} \\right)^+\\]\nBoundary conditions for this problem may not be so easy to device.\nAs in the one dimensional case the PDE contains boundary conditions on the axis \\(x_1  =  0\\) and on the axis \\(x_2  =  0\\), namely two one dimensional Black-Scholes equations driven respectively by the data \\(u\\left( {0, + \\infty ,T} \\right)\\) and \\(u\\left( { + \\infty ,0,T} \\right)\\).\nThese will be automatically accounted for because they are embedded in the PDE.\nSo if we do nothing in the variational form (i.e.if we take a Neumann boundary condition at these two axis in the strong form) there will be no disturbance to these.\nAt infinity in one of the variable, as in 1D, it makes sense to impose \\(u = 0\\).\nWe take\n\n\\[\\sigma _1   =  0.3,\\;\\;\\sigma _2   =  0.3,\\;\\;\\rho   =  0.3,\\;\\;r  =  0.05,\\;\\;K  =  40,\\;\\;T  =  0.5\\]\nAn implicit Euler scheme is used and a mesh adaptation is done every 10 time steps.\nTo have an unconditionally stable scheme, the first order terms are treated by the Characteristic Galerkin method, which, roughly, approximates\n\n\\[\\frac{{\\p u}}{{\\p t}} + a_1 \\frac{{\\p u}}{{\\p x}} + a_2 \\frac{{\\p u}}{{\\p y}} \\approx \\frac{1}{{\\tau }}\\left( {u^{n + 1} \\left( x \\right) - u^n \\left( {x - \\mathbf{\\alpha}\\tau } \\right)} \\right)\\]\n\nTip\nBlack-Scholes\n 1 // Parameters\n 2 int m  =  30; int L  =  80; int LL  =  80; int j  =  100; real sigx  =  0.3; real sigy  =  0.3; real rho  =  0.3; real r  =  0.05; real K  =  40; real dt  =  0.01;\n 3 \n 4 // Mesh\n 5 mesh th  =  square(m, m, [L*x, LL*y]);\n 6 \n 7 // Fespace\n 8 fespace Vh(th, P1);\n 9 Vh u  =  max(K-max(x,y),0.);\n10 Vh xveloc, yveloc, v, uold;\n11 \n12 // Time loop\n13 for (int n  =  0; n*dt < =  1.0; n++){\n14     // Mesh adaptation\n15     if (j > 20){\n16         th  =  adaptmesh(th, u, verbosity = 1, abserror = 1, nbjacoby = 2,\n17         err = 0.001, nbvx = 5000, omega = 1.8, ratio = 1.8, nbsmooth = 3,\n18         splitpbedge = 1, maxsubdiv = 5, rescaling = 1);\n19         j  =  0;\n20         xveloc  =  -x*r + x*sigx^2 + x*rho*sigx*sigy/2;\n21         yveloc  =  -y*r + y*sigy^2 + y*rho*sigx*sigy/2;\n22         u  =  u;\n23     }\n24 \n25     // Update\n26     uold  =  u;\n27 \n28     // Solve\n29     solve eq1(u, v, init = j, solver = LU)\n30          =  int2d(th)(\n31               u*v*(r+1/dt)\n32             + dx(u)*dx(v)*(x*sigx)^2/2\n33             + dy(u)*dy(v)*(y*sigy)^2/2\n34             + (dy(u)*dx(v) + dx(u)*dy(v))*rho*sigx*sigy*x*y/2\n35         )\n36         - int2d(th)(\n37               v*convect([xveloc, yveloc], dt, uold)/dt\n38         )\n39         + on(2, 3, u = 0)\n40         ;\n41 \n42     // Update\n43     j  =  j+1;\n44 };\n45 \n46 // Plot\n47 plot(u, wait = true, value = true);\n\n\nResults are shown on Fig. 162 and Fig. 163.\n\n\n\n\nFig. 162 The adapted triangulation\n\n\n\n\n\nFig. 163 The level line of the European basquet put option\n\n\n\n\n\n\n\n\t\t\n\t\t\t Previous topic: Eigen value problems\n\t\t\tNext topic: Navier-Stokes equations \n\t\t\n\t","l":"models/evolution-problems.html"},"42":{"t":"Fluid-structure coupled problem","p":"\n\t\t\n   \nFluid-structure coupled problem\nThis problem involves the Lam system of elasticity and the Stokes system for viscous fluids with velocity \\(\\mathbf{u}\\) and pressure \\(p\\):\n\n\\[\\begin{split}\\begin{array}{rcll}\n    -\\Delta\\mathbf{u} + \\mathbf{\\nabla} p & = & 0 & \\hbox{ in }\\Omega\\\\\n    \\nabla\\cdot\\mathbf{u} & = & 0 & \\hbox{ in }\\Omega\\\\\n    \\mathbf{u} & = & \\mathbf{u}_\\Gamma & \\hbox{ on }\\Gamma = \\partial\\Omega\n\\end{array}\\end{split}\\]\nwhere \\(u_\\Gamma\\) is the velocity of the boundaries.\nThe force that the fluid applies to the boundaries is the normal stress\n\n\\[\\mathbf{h}  = (\\nabla\\mathbf{u} +\\nabla\\mathbf{u}^T)\\mathbf{n} -p\\mathbf{n}\\]\nElastic solids subject to forces deform: a point in the solid at (x,y) goes to (X,Y) after.\nWhen the displacement vector \\(\\mathbf{v} = (v_1,v_2)  =  (X-x, Y-y)\\) is small, Hookes law relates the stress tensor \\(\\sigma\\) inside the solid to the deformation tensor \\(\\epsilon\\):\n\n\\[\\sigma_{ij}  =  \\lambda \\delta_{ij} \\nabla.\\mathbf{v} + 2\\mu\\epsilon_{ij},\n\\,\n\\epsilon_{ij}  =  {1\\over 2}({\\partial v_i\\over\\partial x_j} + {\\partial v_j\\over\\partial x_i} )\\]\nwhere \\(\\delta\\) is the Kronecker symbol and where \\(\\lambda\\), \\(\\mu\\) are two constants describing the material mechanical properties in terms of the modulus of elasticity, and Youngs modulus.\nThe equations of elasticity are naturally written in variational form for the displacement vector \\(v(x)\\in V\\) as:\n\n\\[\\int_\\Omega \\left[2\\mu\\epsilon_{ij}(\\mathbf{v})\\epsilon_{ij}(\\mathbf{w})\n+\\lambda \\epsilon_{ii}(v)\\epsilon_{jj}(\\mathbf{w})\\right]\n = \\int_\\Omega \\mathbf{g}\\cdot \\mathbf{w} +\\int_\\Gamma \\mathbf{h}\\cdot \\mathbf{w},%\\`{u}\n\\forall \\mathbf{w}\\in V\\]\nThe data are the gravity force \\(\\mathbf{g}\\) and the boundary stress \\(\\mathbf{h}\\).\n\nTip\nFluide-structure\nIn our example, the Lam system and the Stokes system are coupled by a common boundary on which the fluid stress creates a displacement of the boundary and hence changes the shape of the domain where the Stokes problem is integrated.\nThe geometry is that of a vertical driven cavity with an elastic lid.\nThe lid is a beam with weight so it will be deformed by its own weight and by the normal stress due to the fluid reaction.\nThe cavity is the \\(10 \\times 10\\) square and the lid is a rectangle of height \\(l = 2\\).\nA beam sits on a box full of fluid rotating because the left vertical side has velocity one.\nThe beam is bent by its own weight, but the pressure of the fluid modifies the bending.\nThe bending displacement of the beam is given by \\((uu, vv)\\) whose solution is given as follows.\n 1 // Parameters\n 2 int bottombeam  =  2; //label of bottombeam\n 3 real E  =  21.5;\n 4 real sigma  =  0.29;\n 5 real gravity  =  -0.05;\n 6 real coef  =  0.2;\n 7 \n 8 // Mesh (solid)\n 9 border a(t = 2, 0){x = 0; y = t; label = 1;}\n10 border b(t = 0, 10){x = t; y = 0; label = bottombeam;}\n11 border c(t = 0, 2){x = 10; y = t; label = 1;}\n12 border d(t = 0, 10){x = 10-t; y = 2; label = 3;}\n13 mesh th  =  buildmesh(b(20) + c(5) + d(20) + a(5));\n14 \n15 // Fespace (solid)\n16 fespace Vh(th, P1);\n17 Vh uu, w, vv, s;\n18 \n19 // Macro\n20 real sqrt2  =  sqrt(2.);\n21 macro epsilon(u1, u2) [dx(u1), dy(u2), (dy(u1)+dx(u2))/sqrt2] //\n22 macro div(u1, u2) (dx(u1) + dy(u2)) //\n23 \n24 // Problem (solid)\n25 real mu  =  E/(2*(1+sigma));\n26 real lambda  =  E*sigma/((1+sigma)*(1-2*sigma));\n27 solve Elasticity([uu, vv], [w, s])\n28      =  int2d(th)(\n29           lambda*div(w,s)*div(uu,vv)\n30         + 2.*mu*(epsilon(w,s)'*epsilon(uu,vv))\n31     )\n32     + int2d(th)(\n33         - gravity*s\n34     )\n35     + on(1, uu = 0, vv = 0)\n36     ;\n37 \n38 plot([uu, vv], wait = true);\n39 mesh th1  =  movemesh(th, [x+uu, y+vv]);\n40 plot(th1, wait = true);\n\n\nThen Stokes equation for fluids at low speed are solved in the box below the beam, but the beam has deformed the box (see border h):\n1 // Mesh (fluid)\n2 border e(t = 0, 10){x = t; y = -10; label =  1;}\n3 border f(t = 0, 10){x = 10; y = -10+t ; label =  1;}\n4 border g(t = 0, 10){x = 0; y = -t; label =  2;}\n5 border h(t = 0, 10){x = t; y = vv(t,0)*( t> = 0.001 )*(t < =  9.999); label = 3;}\n6 mesh sh  =  buildmesh(h(-20) + f(10) + e(10) + g(10));\n7 plot(sh, wait = true);\n\n\nWe use the Uzawa conjugate gradient to solve the Stokes problem like in Navier-Stokes equations.\n 1 // Fespace (fluid)\n 2 fespace Xh(sh, P2);\n 3 Xh u1, u2;\n 4 Xh bc1;\n 5 Xh brhs;\n 6 Xh bcx = 0, bcy = 1;\n 7 \n 8 fespace Mh(sh, P1);\n 9 Mh p, ppp;\n10 \n11 // Problem (fluid)\n12 varf bx (u1, q)  =  int2d(sh)(-(dx(u1)*q));\n13 varf by (u1, q)  =  int2d(sh)(-(dy(u1)*q));\n14 varf Lap (u1, u2)\n15      =  int2d(sh)(\n16           dx(u1)*dx(u2)\n17         + dy(u1)*dy(u2)\n18     )\n19     + on(2, u1 = 1)\n20     + on(1, 3, u1 = 0)\n21     ;\n22 \n23 bc1[]  =  Lap(0, Xh);\n24 \n25 matrix A  =  Lap(Xh, Xh, solver = CG);\n26 matrix Bx  =  bx(Xh, Mh);\n27 matrix By  =  by(Xh, Mh);\n28 \n29 \n30 func real[int] divup (real[int] & pp){\n31     int verb  =  verbosity;\n32     verbosity  =  0;\n33     brhs[]  =  Bx'*pp;\n34     brhs[] + =  bc1[] .*bcx[];\n35     u1[]  =  A^-1*brhs[];\n36     brhs[]  =  By'*pp;\n37     brhs[] + =  bc1[] .*bcy[];\n38     u2[]  =  A^-1*brhs[];\n39     ppp[]  =  Bx*u1[];\n40     ppp[] + =  By*u2[];\n41     verbosity  =  verb;\n42     return ppp[];\n43 }\n\n\ndo a loop on the two problems\n1 // Coupling loop\n2 for(int step  =  0; step < 10; ++step){\n3     // Solve (fluid)\n4     LinearCG(divup, p[], eps = 1.e-3, nbiter = 50);\n5     divup(p[]);\n\n\nNow the beam will feel the stress constraint from the fluid:\n1 // Forces\n2 Vh sigma11, sigma22, sigma12;\n3 Vh uu1 = uu, vv1 = vv;\n4 \n5 sigma11([x+uu, y+vv])  =  (2*dx(u1) - p);\n6 sigma22([x+uu, y+vv])  =  (2*dy(u2) - p);\n7 sigma12([x+uu, y+vv])  =  (dx(u1) + dy(u2));\n\n\nwhich comes as a boundary condition to the PDE of the beam:\n 1 // Solve (solid)\n 2 solve Elasticity2 ([uu, vv], [w, s], init = step)\n 3  =  int2d(th)(\n 4       lambda*div(w,s)*div(uu,vv)\n 5     + 2.*mu*(epsilon(w,s)'*epsilon(uu,vv))\n 6 )\n 7 + int2d(th)(\n 8     - gravity*s\n 9 )\n10 + int1d(th, bottombeam)(\n11     - coef*(sigma11*N.x*w + sigma22*N.y*s + sigma12*(N.y*w+N.x*s))\n12 )\n13 + on(1, uu = 0, vv = 0)\n14 ;\n15 \n16 // Plot\n17 plot([uu, vv], wait = 1);\n18 \n19 // Error\n20 real err  =  sqrt(int2d(th)((uu-uu1)^2 + (vv-vv1)^2));\n21 cout << \"Erreur L2  =  \" << err << endl;\n\n\nNotice that the matrix generated by Elasticity2 is reused (see init = i).\nFinally we deform the beam:\n1 // Movemesh\n2 th1  =  movemesh(th, [x+0.2*uu, y+0.2*vv]);\n3 plot(th1, wait = true);\n\n\nFluid velocity and pressure, displacement vector of the structure and displaced geometry in the fluid-structure interaction of a soft side and a driven cavity are shown Fig. 171, Fig. 172 and Fig. 173\n\n\n\nFig. 171 Velocity and pressure\n\n\n\n\n\n\nFig. 172 Displacement\n\n\n\n\n\nFig. 173 Moved mesh\n\n\n\n\n\n\n\t\t\n\t\t\t Previous topic: Domain decomposition\n\t\t\tNext topic: Transmission problem \n\t\t\n\t","l":"models/fluid-structure-coupled-problem.html"},"43":{"t":"Free boundary problems","p":"\n\t\t\n   \nFree boundary problems\nThe domain \\(\\Omega\\) is defined with:\n 1 // Parameters\n 2 real L  =  10; //length\n 3 real hl  =  2.1; //left height\n 4 real hr  =  0.35; //right height\n 5 int n  =  4;\n 6 \n 7 // Mesh\n 8 border a(t = 0, L){x = t; y = 0;}; //bottom: Gamma_a\n 9 border b(t = 0, hr){x = L; y = t;}; //right: Gamma_b\n10 border f(t = L, 0){x = t; y = t*(hr-hl)/L+hl;}; //free surface: Gamma_f\n11 border d(t = hl, 0){x = 0; y = t;}; // left: Gamma_d\n12 mesh Th  =  buildmesh(a(10*n) + b(6*n) + f(8*n) + d(3*n));\n13 plot(Th);\n\n\n\n\n\nFig. 177 The mesh of the domain \\(\\Omega\\)\n\n\nThe free boundary problem is:\nFind \\(u\\) and \\(\\Omega\\) such that:\n\n\\[\\begin{split}\\left\\{\n\\begin{array}{rcll}\n   -\\Delta u & = & 0 & \\mbox{ in }\\Omega\\\\\n   u & = & y & \\mbox{ on }\\Gamma_b\\\\\n   \\partial u \\over \\partial n & = & 0 & \\mbox{ on }\\Gamma_d\\cup\\Gamma_a\\\\\n   \\partial u \\over \\partial n & = & {q \\over K} n_x & \\mbox{ on }\\Gamma_f\\\\\n   u & = & y & \\mbox{ on }\\Gamma_f\n\\end{array}\n\\right.\\end{split}\\]\nWe use a fixed point method;\n\\(\\Omega^0  =  \\Omega\\)\nIn two step, fist we solve the classical following problem:\n\n\\[\\begin{split}\\left\\{\n\\begin{array}{rcll}\n    -\\Delta u & = & 0 & \\mbox{ in }\\Omega^n\\\\\n    u & = & y & \\mbox{ on }\\Gamma^n_b\\\\\n    \\partial u \\over \\partial n & = & 0 & \\mbox{ on }\\Gamma^n_d\\cup\\Gamma^n_a\\\\\n    u & = & y & \\mbox{ on }\\Gamma^n_f\n\\end{array}\n\\right.\\end{split}\\]\nThe variational formulation is:\nFind \\(u\\) on \\(V = H^1(\\Omega^n)\\), such than \\(u = y\\) on \\(\\Gamma^n_b\\) and \\(\\Gamma^n_f\\)\n\n\\[\\int_{\\Omega^n}\\nabla u \\nabla u'  =  0,\\ \\forall u' \\in V \\mbox{ with } u'  = 0 \\mbox{ on }\\Gamma^n_b \\cup \\Gamma^n_f\\]\nAnd secondly to construct a domain deformation \\(\\mathcal{F}(x,y) = [x,y-v(x,y)]\\) where \\(v\\) is solution of the following problem:\n\n\\[\\begin{split}\\left\\{\n\\begin{array}{rcll}\n    -\\Delta v & = & 0 & \\mbox{ in }\\Omega^n\\\\\n    v & = & 0 & \\mbox{ on }\\Gamma^n_a\\\\\n    \\partial v \\over \\partial n & = & 0 & \\mbox{ on }\\Gamma^n_b\\cup\\Gamma^n_d\\\\\n    \\partial v \\over \\partial n & = & {\\partial u \\over \\partial n} - {q\\over K} n_x & \\mbox{ on }\\Gamma^n_f\n\\end{array}\n\\right.\\end{split}\\]\nThe variational formulation is:\nFind \\(v\\) on \\(V\\), such than \\(v = 0\\) on \\(\\Gamma^n_a\\):\n\n\\[\\int_{\\Omega^n} \\nabla v \\nabla v'  =  \\int_{\\Gamma_f^n}({\\partial u \\over \\partial n} - { q\\over K} n_x )v',\\ \\quad \\forall v' \\in V \\mbox{ with } v'  = 0 \\mbox{ on }\\Gamma^n_a\\]\nFinally the new domain \\(\\Omega^{n+1}  =  \\mathcal{F}(\\Omega^n)\\)\n\nTip\nFree boundary\nThe FreeFEM implementation is:\n 1 // Parameters\n 2 real L  =  10; //length\n 3 real hr  =  2.1; //left height\n 4 real hl  =  0.35; //right height\n 5 int n  =  4;\n 6 \n 7 real q  =  0.02; //incoming flow\n 8 real K  =  0.5; //permeability\n 9 \n10 // Mesh\n11 border a(t = 0, L){x = t; y = 0;}; //bottom: Gamma_a\n12 border b(t = 0, hr){x = L; y = t;}; //right: Gamma_b\n13 border f(t = L, 0){x = t; y = t*(hr-hl)/L+hl;}; //free surface: Gamma_f\n14 border d(t = hl, 0){x = 0; y = t;}; // left: Gamma_d\n15 mesh Th  =  buildmesh(a(10*n) + b(6*n) + f(8*n) + d(3*n));\n16 plot(Th);\n17 \n18 // Fespace\n19 fespace Vh(Th, P1);\n20 Vh u, v;\n21 Vh uu, vv;\n22 \n23 // Problem\n24 problem Pu (u, uu, solver = CG)\n25      =  int2d(Th)(\n26           dx(u)*dx(uu)\n27         + dy(u)*dy(uu)\n28     )\n29     + on(b, f, u = y)\n30     ;\n31 \n32 problem Pv (v, vv, solver = CG)\n33      =  int2d(Th)(\n34           dx(v)*dx(vv)\n35         + dy(v)*dy(vv)\n36     )\n37     + on(a, v = 0)\n38     + int1d(Th, f)(\n39           vv*((q/K)*N.y - (dx(u)*N.x + dy(u)*N.y))\n40     )\n41     ;\n42 \n43 // Loop\n44 int j  =  0;\n45 real errv  =  1.;\n46 real erradap  =  0.001;\n47 while (errv > 1e-6){\n48     // Update\n49     j++;\n50 \n51     // Solve\n52     Pu;\n53     Pv;\n54 \n55     // Plot\n56     plot(Th, u, v);\n57 \n58     // Error\n59     errv  =  int1d(Th, f)(v*v);\n60 \n61     // Movemesh\n62     real coef  =  1.;\n63     real mintcc  =  checkmovemesh(Th, [x, y])/5.;\n64     real mint  =  checkmovemesh(Th, [x, y-v*coef]);\n65 \n66     if (mint < mintcc || j%10 =  = 0){ //mesh too bad  = > remeshing\n67         Th  =  adaptmesh(Th, u, err = erradap);\n68         mintcc  =  checkmovemesh(Th, [x, y])/5.;\n69     }\n70 \n71     while (1){\n72         real mint  =  checkmovemesh(Th, [x, y-v*coef]);\n73 \n74         if (mint > mintcc) break;\n75 \n76         cout << \"min |T|  =  \" << mint << endl;\n77         coef / =  1.5;\n78     }\n79 \n80     Th = movemesh(Th, [x, y-coef*v]);\n81 \n82     // Display\n83     cout << endl << j << \" - errv  =  \" << errv << endl;\n84 }\n85 \n86 // Plot\n87 plot(Th);\n88 plot(u, wait = true);\n\n\n\n\n\n\nFig. 178 The final solution on the new domain \\(\\Omega^{72}\\)\n\n\n\n\n\nFig. 179 The adapted mesh of the domain \\(\\Omega^{72}\\)\n\n\n\n\n\n\n\t\t\n\t\t\t Previous topic: Transmission problem\n\t\t\tNext topic: Non-linear elasticity \n\t\t\n\t","l":"models/free-boundary-problems.html"},"44":{"t":"Mathematical Models","p":"\n\t\t\n   \nMathematical Models\nSummary:\nThis chapter goes deeper into a number of problems that FreeFEM can solve.\nIt is a complement to the Tutorial part which was only an introduction.\nUsers are invited to contribute to make this models database grow.\n\n\n\n\n\t\t\n\t\t\t Previous topic: External libraries\n\t\t\tNext topic: Static problems \n\t\t\n\t","l":"models/index.html"},"45":{"t":"Navier-Stokes equations","p":"\n\t\t\n   \nNavier-Stokes equations\nThe Stokes equations are: for a given \\(\\mathbf{f}\\in L^2(\\Omega)^2\\):\n\n(55)\\[\\begin{split}\\left.\\begin{array}{cl}\n    -\\Delta \\mathbf{u}+\\nabla p &  = \\mathbf{f} \\\\\n    \\nabla\\cdot \\mathbf{u} & = 0\n\\end{array}\\right\\}\\quad \\hbox{ in }\\Omega\\end{split}\\]\nwhere \\(\\mathbf{u} = (u_1,u_2)\\) is the velocity vector and \\(p\\) the pressure.\nFor simplicity, let us choose Dirichlet boundary conditions on the velocity, \\(\\mathbf{u} = \\mathbf{u}_{\\Gamma}\\) on \\(\\Gamma\\).\nIn [TEMAM1977], Theorem 2.2, there is a weak form of (55):\nFind \\(\\mathbf{v} = (v_1,v_2)\\in \\mathbf{V}(\\Omega)\\):\n\n\\[\\mathbf{V}(\\Omega) = \\{\\mathbf{w}\\in H^1_0(\\Omega)^2|\\; \\textrm{div}\\mathbf{w} = 0\\}\\]\nwhich satisfy:\n\n\\[\\sum_{i = 1}^2\\int_{\\Omega}\\nabla u_i\\cdot \\nabla v_i = \\int_{\\Omega}\\mathbf{f}\\cdot \\mathbf{w}\n\\quad \\textrm{for all }v\\in V\\]\nHere it is used the existence \\(p\\in H^1(\\Omega)\\) such that \\(\\mathbf{u} = \\nabla p\\), if:\n\n\\[\\int_{\\Omega}\\mathbf{u}\\cdot \\mathbf{v} = 0\\quad \\textrm{for all }\\mathbf{v}\\in V\\]\nAnother weak form is derived as follows: We put:\n\n\\[\\mathbf{V} = H^1_0(\\Omega)^2;\\quad\nW = \\left\\{q\\in L^2(\\Omega)\\left|\\; \\int_{\\Omega}q = 0\\right.\\right\\}\\]\nBy multiplying the first equation in (55) with \\(v\\in V\\) and the second with \\(q\\in W\\), subsequent integration over \\(\\Omega\\), and an application of Greens formula, we have:\n\n\\[\\begin{split}\\begin{array}{rcl}\n    \\int_{\\Omega}\\nabla\\mathbf{u}\\cdot \\nabla\\mathbf{v}-\\int_{\\Omega}\\textrm{div}\\mathbf{v}\\, p\n    & = &\\int_{\\Omega}\\mathbf{f}\\cdot\\mathbf{v}\\\\\n    \\int_{\\Omega}\\textrm{div}\\mathbf{u}\\, q& = &0\n\\end{array}\\end{split}\\]\nThis yields the weak form of (55):\nFind \\((\\mathbf{u},p)\\in \\mathbf{V}\\times W\\) such that:\n\n\\[\\begin{split}\\begin{array}{rcl}\n    a(\\mathbf{u},\\mathbf{v})+b(\\mathbf{v},p)& = &(\\mathbf{f},\\mathbf{v})\\\\\n    b(\\mathbf{u},q)& = &0\n\\end{array}\\end{split}\\]\nfor all \\((\\mathbf{v},q)\\in V\\times W\\), where:\n\n\\[\\begin{split}\\begin{array}{rcl}\n    a(\\mathbf{u},\\mathbf{v})& = &\\int_{\\Omega}\\nabla \\mathbf{u}\\cdot \\nabla\\mathbf{v}\n     = \\sum_{i = 1}^2\\int_{\\Omega}\\nabla u_i\\cdot \\nabla v_i\\\\\n    b(\\mathbf{u},q)& = &-\\int_{\\Omega}\\textrm{div}\\mathbf{u}\\, q\n\\end{array}\\end{split}\\]\nNow, we consider finite element spaces \\(\\mathbf{V}_h\\subset \\mathbf{V}\\) and \\(W_h\\subset W\\), and we assume the following basis functions:\n\n\\[\\begin{split}\\begin{array}{rcl}\n    &&\\mathbf{V}_h = V_h\\times V_h,\\quad\n    V_h = \\{v_h|\\; v_h = v_1\\phi_1+\\cdots +v_{M_V}\\phi_{M_V}\\},\\\\\n    &&W_h = \\{q_h|\\; q_h = q_1\\varphi_1+\\cdots +q_{M_W}\\varphi_{M_W}\\}\n\\end{array}\\end{split}\\]\nThe discrete weak form is: Find \\((\\mathbf{u}_{h},p_{h}) \\in \\mathbf{V}_{h} \\times W_{h}\\) such that:\n\n(56)\\[\\begin{split}\\begin{array}{cll}\n    a(\\mathbf{u}_h,\\mathbf{v}_h)+b(\\mathbf{v}_h,p) & =  (\\mathbf{f},\\mathbf{v}_h) ,\n    &\\forall \\mathbf{v}_{h} \\in \\mathbf{V}_{h} \\\\\n    b(\\mathbf{u}_h,q_h)& =  0,\n    &\\forall q_{h} \\in W_{h}\n\\end{array}\\end{split}\\]\n\nNote\nAssume that:\n\nThere is a constant \\(\\alpha_h>0\\) such that:\n\n\n\\[a(\\mathbf{v}_h,\\mathbf{v}_h)\\ge \\alpha\\| \\mathbf{v}_h\\|_{1,\\Omega}^2\\quad \\textrm{for all }\\mathbf{v}_h\\in Z_h\\]\nwhere:\n\n\\[Z_h = \\{\\mathbf{v}_h\\in \\mathbf{V}_h|\\; b(\\mathbf{w}_h,q_h) = 0\\quad \\textrm{for all }q_h\\in W_h\\}\\]\n\n\nThere is a constant \\(\\beta_h>0\\) such that:\n\n\n\\[\\sup_{\\mathbf{v}_h\\in \\mathbf{V}_h}\\frac{b(\\mathbf{v}_h,q_h)}{\\| \\mathbf{v}_h\\|_{1,\\Omega}}\n\\ge \\beta_h\\| q_h\\|_{0,\\Omega}\\quad \\textrm{for all }q_h\\in W_h\\]\nThen we have an unique solution \\((\\mathbf{u}_h,p_h)\\) of (56) satisfying:\n\n\\[\\| \\mathbf{u}-\\mathbf{u}_h\\|_{1,\\Omega}+\\| p-p_h\\|_{0,\\Omega}\n\\le C\\left(\n\\inf_{\\mathbf{v}_h\\in \\mathbf{V}_h}\\| u-v_h\\|_{1,\\Omega}\n+\\inf_{q_h\\in W_h}\\| p-q_h\\|_{0,\\Omega}\\right)\\]\nwith a constant \\(C>0\\) (see e.g. [ROBERTS1993], Theorem 10.4).\n\n\n\n\nLet us denote that:\n\n\\[\\begin{split}\\begin{array}{rcl}\n    A& = &(A_{ij}),\\, A_{ij} = \\int_{\\Omega}\\nabla \\phi_j\\cdot \\nabla \\phi_i\\qquad\n    i,j = 1,\\cdots,M_{\\mathbf{V}}\\\\\n    \\mathbf{B}& = &(Bx_{ij},By_{ij}),\\,\n    Bx_{ij} = -\\int_{\\Omega}\\p \\phi_j/\\p x\\, \\varphi_i\\qquad\n    By_{ij} = -\\int_{\\Omega}\\p \\phi_j/\\p y\\, \\varphi_i\\nonumber\\\\\n    &&\\qquad i = 1,\\cdots,M_W;j = 1,\\cdots,M_V\\nonumber\n\\end{array}\\end{split}\\]\nthen (56) is written by:\n\n\\[\\begin{split}\\left(\n\\begin{array}{cc}\n    \\mathbf{A}&\\mathbf{\\mathbf{B}}^*\\\\\n    \\mathbf{B}&0\n\\end{array}\n\\right)\n\\left(\n\\begin{array}{cc}\n    \\mathbf{U}_h\\\\\n    \\{p_h\\}\n\\end{array}\n\\right)\n = \n\\left(\n\\begin{array}{cc}\n    \\mathbf{F}_h\\\\\n    0\n\\end{array}\n\\right)\\end{split}\\]\nwhere:\n\n\\[\\begin{split}&\\mathbf{A} = \\left(\n\\begin{array}{cc}\nA&0\\\\\n0&A\n\\end{array}\n\\right)\n\\qquad\n\\mathbf{B}^* = \\left\\{\n\\begin{array}{c}\nBx^T\\\\\nBy^T\n\\end{array}\n\\right\\}\n\\qquad\n\\mathbf{U}_h = \\left\\{\n\\begin{array}{c}\n\\{u_{1,h}\\}\\\\\n\\{u_{2,h}\\}\n\\end{array}\n\\right\\}\n\\qquad\n\\mathbf{F}_h = \\left\\{\n\\begin{array}{c}\n\\{\\textstyle{\\int_{\\Omega}f_1\\phi_i}\\}\\\\\n\\{\\textstyle{\\int_{\\Omega}f_2\\phi_i}\\}\n\\end{array}\n\\right\\}\\end{split}\\]\nPenalty method: This method consists of replacing (56) by a more regular problem:\nFind \\((\\mathbf{v}_h^{\\epsilon},p_h^{\\epsilon})\\in \\mathbf{V}_h\\times \\tilde{W}_{h}\\) satisfying:\n\n(57)\\[\\begin{split}\\begin{array}{cll}\n    a(\\mathbf{u}_h^\\epsilon,\\mathbf{v}_h)+b(\\mathbf{v}_h,p_h^{\\epsilon}) & =  (\\mathbf{f},\\mathbf{v}_h) ,\n    &\\forall \\mathbf{v}_{h} \\in \\mathbf{V}_{h} \\\\\n    b(\\mathbf{u}_h^{\\epsilon},q_h)-\\epsilon(p_h^{\\epsilon},q_h)& =  0,\n    &\\forall q_{h} \\in \\tilde{W}_{h}\n\\end{array}\\end{split}\\]\nwhere \\(\\tilde{W}_h\\subset L^2(\\Omega)\\).\nFormally, we have:\n\n\\[\\textrm{div}\\mathbf{u}_h^{\\epsilon} = \\epsilon p_h^{\\epsilon}\\]\nand the corresponding algebraic problem:\n\n\\[\\begin{split}\\left(\n\\begin{array}{cc}\n\\mathbf{A}&B^*\\\\\nB&-\\epsilon I\n\\end{array}\n\\right)\n\\left(\n\\begin{array}{cc}\n\\mathbf{U}_h^{\\epsilon}\\\\\n\\{p_h^{\\epsilon}\\}\n\\end{array}\n\\right)\n = \n\\left(\n\\begin{array}{cc}\n\\mathbf{F}_h\\\\\n0\n\\end{array}\n\\right)\\end{split}\\]\n\nNote\nWe can eliminate \\(p_h^\\epsilon = (1/\\epsilon)BU_h^{\\epsilon}\\) to obtain:\n\n(58)\\[(A+(1/\\epsilon)B^*B)\\mathbf{U}_h^{\\epsilon} = \\mathbf{F}_h^{\\epsilon}\\]\nSince the matrix \\(A+(1/\\epsilon)B^*B\\) is symmetric, positive-definite, and sparse, (58) can be solved by known technique.\nThere is a constant \\(C>0\\) independent of \\(\\epsilon\\) such that:\n\n\\[\\|\\mathbf{u}_h-\\mathbf{u}_h^\\epsilon\\|_{1,\\Omega}+\n\\|p_h-p_h^{\\epsilon}\\|_{0,\\Omega}\\le C\\epsilon\\]\n(see e.g. [ROBERTS1993], 17.2)\n\n\nTip\nCavity\nThe driven cavity flow problem is solved first at zero Reynolds number (Stokes flow) and then at Reynolds 100.\nThe velocity pressure formulation is used first and then the calculation is repeated with the stream function vorticity formulation.\nWe solve the driven cavity problem by the penalty method (57) where \\(\\mathbf{u}_{\\Gamma}\\cdot \\mathbf{n} = 0\\) and \\(\\mathbf{u}_{\\Gamma}\\cdot \\mathbf{s} = 1\\) on the top boundary and zero elsewhere (\\(\\mathbf{n}\\) is the unit normal to \\(\\Gamma\\), and \\(\\mathbf{s}\\) the unit tangent to \\(\\Gamma\\)).\nThe mesh is constructed by:\n1 mesh Th  =  square(8, 8);\n\n\nWe use a classical Taylor-Hood element technique to solve the problem:\nThe velocity is approximated with the \\(P_{2}\\) FE (\\(X_{h}\\) space), and the pressure is approximated with the \\(P_{1}\\) FE (\\(M_{h}\\) space), where:\n\n\\[X_{h}  =  \\left\\{ \\mathbf{v} \\in H^{1}(]0,1[^2) \\left|\\; \\forall K \\in \\mathcal{T}_{h}\\quad v_{|K} \\in P_{2}\\right.\\right\\}\\]\nand:\n\n\\[M_{h}  =  \\left\\{ v \\in H^{1}(]0,1[^2) \\left|\\; \\forall K \\in \\mathcal{T}_{h}\\quad v_{|K} \\in P_{1} \\right.\\right\\}\\]\nThe FE spaces and functions are constructed by:\n1 fespace Xh(Th, P2); //definition of the velocity component space\n2 fespace Mh(Th, P1); //definition of the pressure space\n3 Xh u2, v2;\n4 Xh u1, v1;\n5 Mh p, q;\n\n\nThe Stokes operator is implemented as a system-solve for the velocity \\((u1,u2)\\) and the pressure \\(p\\).\nThe test function for the velocity is \\((v1,v2)\\) and \\(q\\) for the pressure, so the variational form (56) in freefem language is:\n 1 solve Stokes (u1, u2, p, v1, v2, q, solver = Crout)\n 2      =  int2d(Th)(\n 3         (\n 4             dx(u1)*dx(v1)\n 5             + dy(u1)*dy(v1)\n 6             + dx(u2)*dx(v2)\n 7             + dy(u2)*dy(v2)\n 8         )\n 9         - p*q*(0.000001)\n10         - p*dx(v1) - p*dy(v2)\n11         - dx(u1)*q - dy(u2)*q\n12     )\n13     + on(3, u1 = 1, u2 = 0)\n14     + on(1, 2, 4, u1 = 0, u2 = 0)\n15     ;\n\n\nEach unknown has its own boundary conditions.\nIf the streamlines are required, they can be computed by finding \\(\\psi\\) such that \\(rot\\psi = u\\) or better:\n\n\\[-\\Delta\\psi = \\nabla\\times u\\]\n 1 Xh psi, phi;\n 2 \n 3 solve streamlines (psi, phi)\n 4      =  int2d(Th)(\n 5           dx(psi)*dx(phi)\n 6         + dy(psi)*dy(phi)\n 7     )\n 8     + int2d(Th)(\n 9         - phi*(dy(u1) - dx(u2))\n10     )\n11     + on(1, 2, 3, 4, psi = 0)\n12     ;\n\n\nNow the Navier-Stokes equations are solved:\n\n\\[{\\p {u}\\over\\p t} +u\\cdot\\nabla u-\\nu \\Delta u+\\nabla p = 0, \\nabla\\cdot u = 0\\]\nwith the same boundary conditions and with initial conditions \\(u = 0\\).\nThis is implemented by using the convection operator convect for the term \\({\\p u\\over\\p t} +u\\cdot\\nabla u\\), giving a discretization in time\n\n\\[\\begin{split}\\begin{array}{cl}\n    \\frac{1}{\\tau } (u^{n+1}-u^n\\circ X^n) -\\nu\\Delta u^{n+1} + \\nabla p^{n+1} & = 0,\\\\\n    \\nabla\\cdot u^{n+1} & =  0\n\\end{array}\\end{split}\\]\nThe term \\(u^n\\circ X^n(x)\\approx u^n(x-u^n(x)\\tau )\\) will be computed by the operator convect, so we obtain:\n 1 int i = 0;\n 2 real alpha = 1/dt;\n 3 problem NS (u1, u2, p, v1, v2, q, solver = Crout, init = i)\n 4      =  int2d(Th)(\n 5           alpha*(u1*v1 + u2*v2)\n 6         + nu * (\n 7               dx(u1)*dx(v1) + dy(u1)*dy(v1)\n 8             + dx(u2)*dx(v2) + dy(u2)*dy(v2)\n 9         )\n10         - p*q*(0.000001)\n11         - p*dx(v1) - p*dy(v2)\n12         - dx(u1)*q - dy(u2)*q\n13     )\n14     + int2d(Th)(\n15         - alpha*convect([up1,up2],-dt,up1)*v1\n16         - alpha*convect([up1,up2],-dt,up2)*v2\n17     )\n18     + on(3, u1 = 1, u2 = 0)\n19     + on(1, 2, 4,u1 = 0, u2 = 0)\n20     ;\n21 \n22 // Time loop\n23 for (i  =  0; i < =  10; i++){\n24     // Update\n25     up1  =  u1;\n26     up2  =  u2;\n27 \n28     // Solve\n29     NS;\n30 \n31     // Plot\n32     if (!(i % 10))\n33     plot(coef = 0.2, cmm = \"[u1,u2] and p\", p, [u1, u2]);\n34 }\n\n\nNotice that the stiffness matrices are reused (keyword init = i)\nThe complete script is available in cavity example.\n\n\nUzawa Algorithm and Conjugate Gradients\nWe solve Stokes problem without penalty.\nThe classical iterative method of Uzawa is described by the algorithm (see e.g. [ROBERTS1993], 17.3, [GLOWINSKI1979], 13 or [GLOWINSKI1985], 13):\n\nInitialize: Let \\(p_h^0\\) be an arbitrary chosen element of \\(L^2(\\Omega)\\).\nCalculate :math:`mathbf{u}_h`: Once \\(p_h^n\\) is known, \\(\\mathbf{v}_h^n\\) is the solution of:\n\n\n\\[\\mathbf{u}_h^n  =  A^{-1}(\\mathbf{f}_h-\\mathbf{B}^*p_h^n)\\]\n\n\nAdvance :math:`p_h`: Let \\(p_h^{n+1}\\) be defined by;\n\n\n\\[p_h^{n+1} = p_h^n+\\rho_n\\mathbf{B}\\mathbf{u}_h^n\\]\n\n\n\nThere is a constant \\(\\alpha>0\\) such that \\(\\alpha\\le \\rho_n\\le 2\\) for each \\(n\\), then \\(\\mathbf{u}_h^n\\) converges to the solution \\(\\mathbf{u}_h\\), and then \\(B\\mathbf{v}_h^n\\to 0\\) as \\(n\\to \\infty\\) from the Advance \\(p_h\\). This method in general converges quite slowly.\nFirst we define mesh, and the Taylor-Hood approximation.\nSo \\(X_{h}\\) is the velocity space, and \\(M_{h}\\) is the pressure space.\n\nTip\nStokes Uzawa\n 1 // Mesh\n 2 mesh Th  =  square(10, 10);\n 3 \n 4 // Fespace\n 5 fespace Xh(Th, P2);\n 6 Xh u1, u2;\n 7 Xh bc1, bc2;\n 8 Xh b;\n 9 \n10 fespace Mh(Th, P1);\n11 Mh p;\n12 Mh ppp; //ppp is a working pressure\n13 \n14 // Problem\n15 varf bx (u1, q)  =  int2d(Th)(-(dx(u1)*q));\n16 varf by (u1, q)  =  int2d(Th)(-(dy(u1)*q));\n17 varf a (u1, u2)\n18  =  int2d(Th)(\n19           dx(u1)*dx(u2)\n20         + dy(u1)*dy(u2)\n21     )\n22     + on(3, u1 = 1)\n23     + on(1, 2, 4, u1 = 0) ;\n24 //remark: put the on(3,u1 = 1) before on(1,2,4,u1 = 0)\n25 //because we want zero on intersection\n26 \n27 matrix A  =  a(Xh, Xh, solver = CG);\n28 matrix Bx  =  bx(Xh, Mh); //B = (Bx, By)\n29 matrix By  =  by(Xh, Mh);\n30 \n31 bc1[]  =  a(0,Xh); //boundary condition contribution on u1\n32 bc2  =  0; //no boundary condition contribution on u2\n33 \n34 //p_h^n -> B A^-1 - B^* p_h^n  =  -div u_h\n35 //is realized as the function divup\n36 func real[int] divup (real[int] & pp){\n37     //compute u1(pp)\n38     b[]  =  Bx'*pp;\n39     b[] * =  -1;\n40     b[] + =  bc1[];\n41     u1[]  =  A^-1*b[];\n42     //compute u2(pp)\n43     b[]  =  By'*pp;\n44     b[] * =  -1;\n45     b[] + =  bc2[];\n46     u2[]  =  A^-1*b[];\n47     //u^n  =  (A^-1 Bx^T p^n, By^T p^n)^T\n48     ppp[]  =  Bx*u1[]; //ppp  =  Bx u_1\n49     ppp[] + =  By*u2[]; //+ By u_2\n50 \n51     return ppp[] ;\n52 }\n53 \n54 // Initialization\n55 p = 0; //p_h^0  =  0\n56 LinearCG(divup, p[], eps = 1.e-6, nbiter = 50); //p_h^{n+1}  =  p_h^n + B u_h^n\n57 // if n> 50 or |p_h^{n+1} - p_h^n| < =  10^-6, then the loop end\n58 divup(p[]); //compute the final solution\n59 \n60 plot([u1, u2], p, wait = 1, value = true, coef = 0.1);\n\n\n\n\n\nNSUzawaCahouetChabart.edp\nIn this example we solve the Navier-Stokes equation past a cylinder with the Uzawa algorithm preconditioned by the Cahouet-Chabart method (see [GLOWINSKI2003] for all the details).\nThe idea of the preconditioner is that in a periodic domain, all differential operators commute and the Uzawa algorithm comes to solving the linear operator \\(\\nabla. ( (\\alpha Id + \\nu \\Delta)^{-1} \\nabla\\), where \\(Id\\) is the identity operator.\nSo the preconditioner suggested is \\(\\alpha \\Delta^{-1} + \\nu Id\\).\nTo implement this, we do:\n\nTip\nNS Uzawa Cahouet Chabart\n  1 // Parameters\n  2 verbosity  =  0;\n  3 real D  =  0.1;\n  4 real H  =  0.41;\n  5 real cx0  =  0.2;\n  6 real cy0  =  0.2; //center of cylinder\n  7 real xa  =  0.15;\n  8 real ya  =  0.2;\n  9 real xe  =  0.25;\n 10 real ye  =  0.2;\n 11 int nn  =  15;\n 12 \n 13 //TODO\n 14 real Um  =  1.5; //max velocity (Rey 100)\n 15 real nu  =  1e-3;\n 16 \n 17 func U1  =  4.*Um*y*(H-y)/(H*H); //Boundary condition\n 18 func U2  =  0.;\n 19 real T = 2;\n 20 real dt  =  D/nn/Um; //CFL  =  1\n 21 real epspq  =  1e-10;\n 22 real eps  =  1e-6;\n 23 \n 24 // Variables\n 25 func Ub  =  Um*2./3.;\n 26 real alpha  =  1/dt;\n 27 real Rey  =  Ub*D/nu;\n 28 real t  =  0.;\n 29 \n 30 // Mesh\n 31 border fr1(t = 0, 2.2){x = t; y = 0; label = 1;}\n 32 border fr2(t = 0, H){x = 2.2; y = t; label = 2;}\n 33 border fr3(t = 2.2, 0){x = t; y = H; label = 1;}\n 34 border fr4(t = H, 0){x = 0; y = t; label = 1;}\n 35 border fr5(t = 2*pi, 0){x = cx0+D*sin(t)/2; y = cy0+D*cos(t)/2; label = 3;}\n 36 mesh Th  =  buildmesh(fr1(5*nn) + fr2(nn) + fr3(5*nn) + fr4(nn) + fr5(-nn*3));\n 37 \n 38 // Fespace\n 39 fespace Mh(Th, [P1]);\n 40 Mh p;\n 41 \n 42 fespace Xh(Th, [P2]);\n 43 Xh u1, u2;\n 44 \n 45 fespace Wh(Th, [P1dc]);\n 46 Wh w; //vorticity\n 47 \n 48 // Macro\n 49 macro grad(u) [dx(u), dy(u)] //\n 50 macro div(u1, u2) (dx(u1) + dy(u2)) //\n 51 \n 52 // Problem\n 53 varf von1 ([u1, u2, p], [v1, v2, q])\n 54      =  on(3, u1 = 0, u2 = 0)\n 55     + on(1, u1 = U1, u2 = U2)\n 56     ;\n 57 \n 58 //remark : the value 100 in next varf is manualy fitted, because free outlet.\n 59 varf vA (p, q)  = \n 60     int2d(Th)(\n 61           grad(p)' * grad(q)\n 62     )\n 63     + int1d(Th, 2)(\n 64           100*p*q\n 65     )\n 66     ;\n 67 \n 68 varf vM (p, q)\n 69      =  int2d(Th, qft = qf2pT)(\n 70           p*q\n 71     )\n 72     + on(2, p = 0)\n 73     ;\n 74 \n 75 varf vu ([u1], [v1])\n 76      =  int2d(Th)(\n 77           alpha*(u1*v1)\n 78         + nu*(grad(u1)' * grad(v1))\n 79     )\n 80     + on(1, 3, u1 = 0)\n 81     ;\n 82 \n 83 varf vu1 ([p], [v1])  =  int2d(Th)(p*dx(v1));\n 84 varf vu2 ([p], [v1])  =  int2d(Th)(p*dy(v1));\n 85 \n 86 varf vonu1 ([u1], [v1])  =  on(1, u1 = U1) + on(3, u1 = 0);\n 87 varf vonu2 ([u1], [v1])  =  on(1, u1 = U2) + on(3, u1 = 0);\n 88 \n 89 matrix pAM  =  vM(Mh, Mh, solver = UMFPACK);\n 90 matrix pAA  =  vA(Mh, Mh, solver = UMFPACK);\n 91 matrix AU  =  vu(Xh, Xh, solver = UMFPACK);\n 92 matrix B1  =  vu1(Mh, Xh);\n 93 matrix B2  =  vu2(Mh, Xh);\n 94 \n 95 real[int] brhs1  =  vonu1(0, Xh);\n 96 real[int] brhs2  =  vonu2(0, Xh);\n 97 \n 98 varf vrhs1(uu, vv)  =  int2d(Th)(convect([u1, u2], -dt, u1)*vv*alpha) + vonu1;\n 99 varf vrhs2(v2, v1)  =  int2d(Th)(convect([u1, u2], -dt, u2)*v1*alpha) + vonu2;\n100 \n101 // Uzawa function\n102 func real[int] JUzawa (real[int] & pp){\n103     real[int] b1  =  brhs1; b1 + =  B1*pp;\n104     real[int] b2  =  brhs2; b2 + =  B2*pp;\n105     u1[]  =  AU^-1 * b1;\n106     u2[]  =  AU^-1 * b2;\n107     pp  =  B1'*u1[];\n108     pp + =  B2'*u2[];\n109     pp  =  -pp;\n110     return pp;\n111 }\n112 \n113 // Preconditioner function\n114 func real[int] Precon (real[int] & p){\n115     real[int] pa  =  pAA^-1*p;\n116     real[int] pm  =  pAM^-1*p;\n117     real[int] pp  =  alpha*pa + nu*pm;\n118     return pp;\n119 }\n120 \n121 // Initialization\n122 p  =  0;\n123 \n124 // Time loop\n125 int ndt  =  T/dt;\n126 for(int i  =  0; i < ndt; ++i){\n127     // Update\n128     brhs1  =  vrhs1(0, Xh);\n129     brhs2  =  vrhs2(0, Xh);\n130 \n131     // Solve\n132     int res  =  LinearCG(JUzawa, p[], precon = Precon, nbiter = 100, verbosity = 10, veps = eps);\n133     assert(res =  = 1);\n134     eps  =  -abs(eps);\n135 \n136     // Vorticity\n137     w  =  -dy(u1) + dx(u2);\n138     plot(w, fill = true, wait = 0, nbiso = 40);\n139 \n140     // Update\n141     dt  =  min(dt, T-t);\n142     t + =  dt;\n143     if(dt < 1e-10*T) break;\n144 }\n145 \n146 // Plot\n147 plot(w, fill = true, nbiso = 40);\n148 \n149 // Display\n150 cout << \"u1 max  =  \" << u1[].linfty\n151     << \", u2 max  =  \" << u2[].linfty\n152     << \", p max  =  \" << p[].max << endl;\n\n\n\nWarning\nStop test of the conjugate gradient\nBecause we start from the previous solution and the end the previous solution is close to the final solution, dont take a relative stop test to the first residual, take an absolute stop test (negative here).\n\n\n\n\nFig. 164 The vorticity at Reynolds number 100 a time 2s with the Cahouet-Chabart method.\n\n\n\n\n\n\n\n\t\t\n\t\t\t Previous topic: Evolution problems\n\t\t\tNext topic: Variational Inequality \n\t\t\n\t","l":"models/navier-stokes-equations.html"},"46":{"t":"Non-linear elasticity","p":"\n\t\t\n   \nNon-linear elasticity\nThe nonlinear elasticity problem is: find the displacement \\((u_{1},u_{2})\\) minimizing \\(J\\):\n\n\\[\\min J(u_{1},u_{2})  =  \\int_{\\Omega} f(F2) - \\int_{\\Gamma_{p}} P_{a} \\, u_{2}\\]\nwhere \\(F2(u_{1},u_{2})  =  A(E[u_{1},u_{2}],E[u_{1},u_{2}])\\) and \\(A(X,Y)\\) is bilinear symmetric positive form with respect two matrix \\(X,Y\\).\nwhere \\(f\\) is a given \\(\\mathcal{C}^2\\) function, and \\(E[u_{1},u_{2}]  =  (E_{ij})_{i = 1,2,\\,j = 1,2}\\) is the Green-Saint Venant deformation tensor defined with:\n\n\\[E_{ij}  =  0.5 \\big( ( \\p_i u_j + \\p_j u_i ) + \\sum_k \\p_i u_k {\\times} \\p_j u_k \\big)\\]\nDenote \\(\\mathbf{u} = (u_{1},u_{2})\\), \\(\\mathbf{v} = (v_{1},v_{2})\\), \\(\\mathbf{w} = (w_{1},w_{2})\\).\nSo, the differential of \\(J\\) is:\n\n\\[DJ(\\mathbf{u})(\\mathbf{v})  =  \\int DF2(\\mathbf{u})(\\mathbf{v}) \\;f'(F2(\\mathbf{u}))) - \\int_{\\Gamma_{p}} P_{a} v_{2}\\]\nwhere \\(DF2(\\mathbf{u})(\\mathbf{v})  =  2 \\; A(DE[\\mathbf{u}](\\mathbf{v}),E[\\mathbf{u}])\\) and \\(DE\\) is the first differential of \\(E\\).\nThe second order differential is:\n\n\\[\\begin{split}\\begin{array}{rcl}\n    D^2 J(\\mathbf{u})((\\mathbf{v}),(\\mathbf{w})) & = & \\displaystyle\\int DF2(\\mathbf{u})(\\mathbf{v}) \\; DF2(\\mathbf{u})(\\mathbf{w}) \\; f''(F2(\\mathbf{u}))) \\\\\n    &+& \\displaystyle\\int \\; D^2F2(\\mathbf{u})(\\mathbf{v},\\mathbf{w}) \\; f'(F2(\\mathbf{u})))\n\\end{array}\\end{split}\\]\nwhere:\n\n\\[D^2F2(\\mathbf{u})(\\mathbf{v},\\mathbf{w})  =  2 \\; A(\\;D^2E[\\mathbf{u}](\\mathbf{v},\\mathbf{w})\\;,\\;E[\\mathbf{u}]\\;) + 2 \\; A(\\;DE[\\mathbf{u}](\\mathbf{v})\\;,DE[\\mathbf{u}](\\mathbf{w})\\;) .\\]\nand \\(D^{2}E\\) is the second differential of \\(E\\).\nSo all notations can be define with macro:\n 1  macro EL(u, v) [dx(u), (dx(v)+dy(u)), dy(v)] //is [epsilon_11, 2epsilon_12, epsilon_22]\n 2 \n 3  macro ENL(u, v) [\n 4      (dx(u)*dx(u) + dx(v)*dx(v))*0.5,\n 5      (dx(u)*dy(u) + dx(v)*dy(v)),\n 6      (dy(u)*dy(u) + dy(v)*dy(v))*0.5\n 7  ] //\n 8 \n 9  macro dENL(u, v, uu, vv) [\n10      (dx(u)*dx(uu) + dx(v)*dx(vv)),\n11      (dx(u)*dy(uu) + dx(v)*dy(vv) + dx(uu)*dy(u) + dx(vv)*dy(v)),\n12      (dy(u)*dy(uu) + dy(v)*dy(vv))\n13  ] //\n14 \n15  macro E(u, v) (EL(u,v) + ENL(u,v)) //is [E_11, 2E_12, E_22]\n16  macro dE(u, v, uu, vv) (EL(uu, vv) + dENL(u, v, uu, vv)) //\n17  macro ddE(u, v, uu, vv, uuu, vvv) dENL(uuu, vvv, uu, vv) //\n18  macro F2(u, v) (E(u, v)'*A*E(u, v)) //\n19  macro dF2(u, v, uu, vv) (E(u, v)'*A*dE(u, v, uu, vv)*2.) //\n20  macro ddF2(u, v, uu, vv, uuu, vvv) (\n21      (dE(u, v, uu, vv)'*A*dE(u, v, uuu, vvv))*2.\n22      + (E(u, v)'*A*ddE(u, v, uu, vv, uuu, vvv))*2.\n23  ) //\n\n\nThe Newton Method is:\nchoose \\(n = 0\\),and \\(u_0,v_0\\) the initial displacement\n\nloop:\n\nfind \\((du,dv)\\) : solution of\n\n\\[D^2J(u_n,v_n)((w,s),(du,dv))  =  DJ(u_n,v_n)(w,s) , \\quad \\forall w,s\\]\n\n\\(un  =  un - du,\\quad vn  = vn - dv\\)\nuntil \\((du,dv)\\) small is enough\n\n\n\nThe way to implement this algorithm in FreeFEM is use a macro tool to implement \\(A\\) and \\(F2\\), \\(f\\), \\(f'\\),\\(f''\\).\nA macro is like in ccp preprocessor of C++, but this begin by macro and the end of the macro definition is before the comment //.\nIn this case the macro is very useful because the type of parameter can be change.\nAnd it is easy to make automatic differentiation.\n\n\n\nFig. 180 The deformed domain\n\n\n  1 // Macro\n  2 macro EL(u, v) [dx(u), (dx(v)+dy(u)), dy(v)] //is [epsilon_11, 2epsilon_12, epsilon_22]\n  3 \n  4 macro ENL(u, v) [\n  5     (dx(u)*dx(u) + dx(v)*dx(v))*0.5,\n  6     (dx(u)*dy(u) + dx(v)*dy(v)),\n  7     (dy(u)*dy(u) + dy(v)*dy(v))*0.5\n  8     ] //\n  9 \n 10 macro dENL(u, v, uu, vv) [\n 11     (dx(u)*dx(uu) + dx(v)*dx(vv)),\n 12     (dx(u)*dy(uu) + dx(v)*dy(vv) + dx(uu)*dy(u) + dx(vv)*dy(v)),\n 13     (dy(u)*dy(uu) + dy(v)*dy(vv))\n 14     ] //\n 15 \n 16 macro E(u, v) (EL(u,v) + ENL(u,v)) //is [E_11, 2E_12, E_22]\n 17 macro dE(u, v, uu, vv) (EL(uu, vv) + dENL(u, v, uu, vv)) //\n 18 macro ddE(u, v, uu, vv, uuu, vvv) dENL(uuu, vvv, uu, vv) //\n 19 macro F2(u, v) (E(u, v)'*A*E(u, v)) //\n 20 macro dF2(u, v, uu, vv) (E(u, v)'*A*dE(u, v, uu, vv)*2.) //\n 21 macro ddF2(u, v, uu, vv, uuu, vvv) (\n 22       (dE(u, v, uu, vv)'*A*dE(u, v, uuu, vvv))*2.\n 23     + (E(u, v)'*A*ddE(u, v, uu, vv, uuu, vvv))*2.\n 24     ) //\n 25 \n 26 macro f(u) ((u)*(u)*0.25) //\n 27 macro df(u) ((u)*0.5) //\n 28 macro ddf(u) (0.5) //\n 29 \n 30 // Parameters\n 31 real mu  =  0.012e5; //kg/cm^2\n 32 real lambda  =  0.4e5; //kg/cm^2\n 33 real Pa  =  1e2;\n 34 \n 35 // sigma  =  2 mu E + lambda tr(E) Id\n 36 // A(u,v)  =  sigma(u):E(v)\n 37 //\n 38 // ( a b )\n 39 // ( b c )\n 40 //\n 41 // tr*Id : (a,b,c) -> (a+c,0,a+c)\n 42 // so the associed matrix is:\n 43 // ( 1 0 1 )\n 44 // ( 0 0 0 )\n 45 // ( 1 0 1 )\n 46 \n 47 real a11  =  2*mu + lambda;\n 48 real a22  =  mu; //because [0, 2*t12, 0]' A [0, 2*s12,0]  =  2*mu*(t12*s12 + t21*s21)  =  4*mu*t12*s12\n 49 real a33  =  2*mu + lambda;\n 50 real a12  =  0;\n 51 real a13  =  lambda;\n 52 real a23  =  0;\n 53 // symetric part\n 54 real a21  =  a12;\n 55 real a31  =  a13;\n 56 real a32  =  a23;\n 57 \n 58 //the matrix A\n 59 func A  =  [[a11, a12, a13], [a21, a22, a23], [a31, a32, a33]];\n 60 \n 61 // Mesh\n 62 int n  =  30;\n 63 int m  =  10;\n 64 mesh Th  =  square(n, m, [x, .3*y]); //label: 1 bottom, 2 right, 3 up, 4 left;\n 65 int bottom  =  1, right  =  2, upper  =  3, left  =  4;\n 66 plot(Th);\n 67 \n 68 // Fespace\n 69 fespace Wh(Th, P1dc);\n 70 Wh e2, fe2, dfe2, ddfe2;\n 71 \n 72 fespace Vh(Th, [P1, P1]);\n 73 Vh [uu, vv]  =  [0, 0], [w, s], [un, vn]  =  [0, 0];\n 74 \n 75 fespace Sh(Th, P1);\n 76 Sh u1, v1;\n 77 \n 78 // Problem\n 79 varf vmass ([uu, vv], [w, s], solver = CG)  =  int2d(Th)(uu*w + vv*s);\n 80 matrix M  =  vmass(Vh, Vh);\n 81 problem NonLin([uu, vv], [w, s], solver = LU)\n 82      =  int2d(Th, qforder = 1)( //(D^2 J(un))\n 83            dF2(un, vn, uu, vv)*dF2(un, vn, w, s)*ddfe2\n 84         + ddF2(un, vn, uu, vv, w, s)*ddfe2\n 85     )\n 86     - int1d(Th, upper)(\n 87           Pa*s\n 88     )\n 89     - int2d(Th, qforder = 1)( //(D J(un))\n 90           dF2(un, vn, w, s)*dfe2\n 91     )\n 92     + on(right, left, uu = 0, vv = 0)\n 93     ;\n 94 \n 95 // Newton's method\n 96 for (int i  =  0; i < 10; i++){\n 97     cout << \"Loop \" << i << endl;\n 98 \n 99     // Update\n100     e2  =  F2(un, vn);\n101     dfe2  =  df(e2) ;\n102     ddfe2  =  ddf(e2);\n103     cout << \"e2 max  =  \" <<e2[].max << \", min  =  \" << e2[].min << endl;\n104     cout << \"de2 max  =  \"<< dfe2[].max << \", min  =  \" << dfe2[].min << endl;\n105     cout << \"dde2 max  =  \"<< ddfe2[].max << \", min  =  \" << ddfe2[].min << endl;\n106 \n107     // Solve\n108     NonLin;\n109     w[]   =  M*uu[];\n110 \n111     // Residual\n112     real res  =  sqrt(w[]' * uu[]); //L^2 norm of [uu, vv]\n113     cout << \" L^2 residual  =  \" << res << endl;\n114 \n115     // Update\n116     v1  =  vv;\n117     u1  =  uu;\n118     cout << \"u1 min  =  \" <<u1[].min << \", u1 max  =  \" << u1[].max << endl;\n119     cout << \"v1 min  =  \" <<v1[].min << \", v2 max  =  \" << v1[].max << endl;\n120 \n121     // Plot\n122     plot([uu, vv], wait = true, cmm = \"uu, vv\");\n123 \n124     // Update\n125     un[] - =  uu[];\n126     plot([un, vn], wait = true, cmm = \"displacement\");\n127 \n128     if (res < 1e-5) break;\n129 }\n130 \n131 // Plot\n132 plot([un, vn], wait = true);\n133 \n134 // Movemesh\n135 mesh th1  =  movemesh(Th, [x+un, y+vn]);\n136 \n137 // Plot\n138 plot(th1, wait = true);\n\n\n\n\n\n\t\t\n\t\t\t Previous topic: Free boundary problems\n\t\t\tNext topic: Compressible Neo-Hookean materials \n\t\t\n\t","l":"models/non-linear-elasticity.html"},"47":{"t":"Non-linear static problems","p":"\n\t\t\n   \nNon-linear static problems\nHere we propose to solve the following non-linear academic problem of minimization of a functional:\n\n\\[J(u)  =  \\int_\\Omega \\frac{1}{2} f(|\\nabla u|^2) - u*b\\]\nwhere \\(u\\) is function of \\(H^1_0(\\Omega)\\) and \\(f\\) defined by:\n\n\\[f(x)  =  a*x + x-ln(1+x),\\ f'(x)  =  a+\\frac{x}{1+x},\\ f''(x)  =  \\frac{1}{(1+x)^2}\\]\n\nNewton-Raphson algorithm\nNow, we solve the Euler problem \\(\\nabla J (u)  =  0\\) with Newton-Raphson algorithm, that is:\n\n\\[u^{n+1}  =  u^n - ( \\nabla^2 J (u^{n}))^{-1}*\\nabla J(u^n)\\]\n 1 // Parameters\n 2 real a  =  0.001;\n 3 func b  =  1.;\n 4 \n 5 // Mesh\n 6 mesh Th  =  square(10, 10);\n 7 Th  =  adaptmesh(Th, 0.05, IsMetric = 1, splitpbedge = 1);\n 8 plot(Th, wait = true);\n 9 \n10 // Fespace\n11 fespace Vh(Th, P1);\n12 Vh u = 0;\n13 Vh v, w;\n14 \n15 fespace Ph(Th, P1dc);\n16 Ph alpha; //to store |nabla u|^2\n17 Ph dalpha ; //to store 2f''(|nabla u|^2)\n18 \n19 // Function\n20 func real f (real u){\n21     return u*a + u - log(1.+u);\n22 }\n23 func real df (real u){\n24     return a +u/(1.+u);\n25 }\n26 func real ddf (real u){\n27     return 1. / ((1.+u)*(1.+u));\n28 }\n29 \n30 // Problem\n31 //the variational form of evaluate dJ  =  nabla J\n32 //dJ  =  f'()*(dx(u)*dx(vh) + dy(u)*dy(vh))\n33 varf vdJ (uh, vh)\n34      =  int2d(Th)(\n35           alpha*(dx(u)*dx(vh) + dy(u)*dy(vh))\n36         - b*vh\n37     )\n38     + on(1, 2, 3, 4, uh = 0)\n39     ;\n40 \n41 //the variational form of evaluate ddJ  =  nabla^2 J\n42 //hJ(uh,vh)  =  f'()*(dx(uh)*dx(vh) + dy(uh)*dy(vh))\n43 //  + 2*f''()(dx(u)*dx(uh) + dy(u)*dy(uh)) * (dx(u)*dx(vh) + dy(u)*dy(vh))\n44 varf vhJ (uh, vh)\n45      =  int2d(Th)(\n46           alpha*(dx(uh)*dx(vh) + dy(uh)*dy(vh))\n47         + dalpha*(dx(u)*dx(vh) + dy(u)*dy(vh))*(dx(u)*dx(uh) + dy(u)*dy(uh))\n48     )\n49     + on(1, 2, 3, 4, uh = 0)\n50     ;\n51 \n52 // Newton algorithm\n53 for (int i  =  0; i < 100; i++){\n54     // Compute f' and f''\n55     alpha  =  df(dx(u)*dx(u) + dy(u)*dy(u));\n56     dalpha  =  2*ddf(dx(u)*dx(u) + dy(u)*dy(u));\n57 \n58     // nabla J\n59     v[] =  vdJ(0, Vh);\n60 \n61     // Residual\n62     real res  =  v[]'*v[];\n63     cout << i << \" residu^2  =  \" << res << endl;\n64     if( res < 1e-12) break;\n65 \n66     // HJ\n67     matrix H  =  vhJ(Vh, Vh, factorize = 1, solver = LU);\n68 \n69     // Newton\n70     w[]  =  H^-1*v[];\n71     u[] - =  w[];\n72 }\n73 \n74 // Plot\n75 plot (u, wait = true, cmm = \"Solution with Newton-Raphson\");\n\n\n\n\n\n\n\t\t\n\t\t\t Previous topic: Elasticity\n\t\t\tNext topic: Eigen value problems \n\t\t\n\t","l":"models/non-linear-static-problems.html"},"48":{"t":"Static problems","p":"\n\t\t\n   \nStatic problems\n\nSoap Film\nOur starting point here will be the mathematical model to find the shape of soap film which is glued to the ring on the \\(xy-\\)plane:\n\n\\[C = \\{(x,y);\\;x = \\cos t,\\,y = \\sin t,\\,0\\leq t\\leq 2\\pi \\}\\]\nWe assume the shape of the film is described by the graph \\((x,y,u(x,y))\\) of the vertical displacement \\(u(x,y)\\, (x^2+y^2<1)\\) under a vertical pressure \\(p\\) in terms of force per unit area and an initial tension \\(\\mu\\) in terms of force per unit length.\nConsider the small plane ABCD, A:\\((x,y,u(x,y))\\), B:\\((x,y,u(x+\\delta x,y))\\), C:\\((x,y,u(x+\\delta x,y+\\delta y))\\) and D:\\((x,y,u(x,y+\\delta y))\\).\nDenote by \\(\\vec{n}(x,y) = (n_x(x,y),n_y(x,y),n_z(x,y))\\) the normal vector of the surface \\(z = u(x,y)\\).\nWe see that the vertical force due to the tension \\(\\mu\\) acting along the edge AD is \\(-\\mu n_x(x,y)\\delta y\\) and the the vertical force acting along the edge AD is:\n\n\\[\\mu n_x(x+\\delta x,y)\\delta y\\simeq \\mu\\left(n_x(x,y)+\\frac{\\p n_x}{\\p x}\\delta x\\right)(x,y)\\delta y\\]\n\n\n\nSimilarly, for the edges AB and DC we have:\n\n\\[-\\mu n_y(x,y)\\delta x,\\quad\\mu\\left(n_y(x,y)+\\p n_y/\\p y\\right)(x,y)\\delta x\\]\nThe force in the vertical direction on the surface ABCD due to the tension \\(\\mu\\) is given by:\n\n\\[\\mu\\left(\\p n_x/\\p x\\right)\\delta x\\delta y+T\\left(\\p n_y/\\p y\\right)\\delta y\\delta x\\]\nAssuming small displacements, we have:\n\n\\[\\begin{split}\\begin{array}{rcccl}\n    \\nu_x& = &(\\p u/\\p x)/\\sqrt{1+(\\p u/\\p x)^2+(\\p u/\\p y)^2}&\\simeq& \\p u/\\p x,\\\\\n    \\nu_y& = &(\\p u/\\p y)/\\sqrt{1+(\\p u/\\p x)^2+(\\p u/\\p y)^2}&\\simeq& \\p u/\\p y\n\\end{array}\\end{split}\\]\nLetting \\(\\delta x\\to dx,\\, \\delta y\\to dy\\), we have the equilibrium of the vertical displacement of soap film on ABCD by \\(p\\):\n\n\\[\\mu dx dy\\p^2 u/\\p x^2 +\\mu dx dy\\p^2 u/\\p y^2 + p dx dy  =  0\\]\nUsing the Laplace operator \\(\\Delta  =  \\p^2 /\\p x^2 + \\p^2 /\\p y^2\\), we can find the virtual displacement write the following:\n\n\\[-\\Delta u  =  f\\quad \\mbox{in }\\Omega\\]\nwhere \\(f = p/\\mu\\), \\(\\Omega  = \\{(x,y);\\;x^{2}+y^{2}<1\\}\\).\nPoissons equation appears also in electrostatics taking the form of \\(f = \\rho / \\epsilon\\) where \\(\\rho\\) is the charge density, \\(\\epsilon\\) the dielectric constant and \\(u\\) is named as electrostatic potential.\nThe soap film is glued to the ring \\(\\p \\Omega  = C\\), then we have the boundary condition:\n\n\\[u = 0\\quad \\mbox{on }\\p \\Omega\\]\nIf the force is gravity, for simplify, we assume that \\(f = -1\\).\n 1 // Parameters\n 2 int nn  =  50;\n 3 func f  =  -1;\n 4 func ue  =  (x^2+y^2-1)/4; //ue: exact solution\n 5 \n 6 // Mesh\n 7 border a(t = 0, 2*pi){x = cos(t); y = sin(t); label = 1;}\n 8 mesh disk  =  buildmesh(a(nn));\n 9 plot(disk);\n10 \n11 // Fespace\n12 fespace femp1(disk, P1);\n13 femp1 u, v;\n14 \n15 // Problem\n16 problem laplace (u, v)\n17      =  int2d(disk)( //bilinear form\n18         dx(u)*dx(v)\n19         + dy(u)*dy(v)\n20     )\n21     - int2d(disk)( //linear form\n22         f*v\n23     )\n24     + on(1, u = 0) //boundary condition\n25     ;\n26 \n27 // Solve\n28 laplace;\n29 \n30 // Plot\n31 plot (u, value = true, wait = true);\n32 \n33 // Error\n34 femp1 err  =  u - ue;\n35 plot(err, value = true, wait = true);\n36 \n37 cout << \"error L2  =  \" << sqrt( int2d(disk)(err^2) )<< endl;\n38 cout << \"error H10  =  \" << sqrt( int2d(disk)((dx(u)-x/2)^2) + int2d(disk)((dy(u)-y/2)^2) )<< endl;\n39 \n40 /// Re-run with a mesh adaptation ///\n41 \n42 // Mesh adaptation\n43 disk  =  adaptmesh(disk, u, err = 0.01);\n44 plot(disk, wait = true);\n45 \n46 // Solve\n47 laplace;\n48 plot (u, value = true, wait = true);\n49 \n50 // Error\n51 err  =  u - ue; //become FE-function on adapted mesh\n52 plot(err, value = true, wait = true);\n53 \n54 cout << \"error L2  =  \" << sqrt( int2d(disk)(err^2) )<< endl;\n55 cout << \"error H10  =  \" << sqrt( int2d(disk)((dx(u)-x/2)^2) + int2d(disk)((dy(u)-y/2)^2) )<< endl;\n\n\n\n\n\nFig. 134 Isovalue of \\(u\\)\n\n\n\n\n\nFig. 135 A side view of \\(u\\)\n\n\nIn the 37th line, the \\(L^2\\)-error estimation between the exact solution \\(u_e\\),\n\n\\[\\|u_h - u_e\\|_{0,\\Omega} = \\left(\\int_{\\Omega}|u_h-u_e|^2\\, \\d x\\d y\\right)^{1/2}\\]\nand in the following line, the \\(H^1\\)-error seminorm estimation:\n\n\\[|u_h - u_e|_{1,\\Omega} = \\left(\\int_{\\Omega}|\\nabla u_h-\\nabla u_e|^2\\, \\d x\\d y\\right)^{1/2}\\]\nare done on the initial mesh.\nThe results are \\(\\|u_h - u_e\\|_{0,\\Omega} = 0.000384045,\\, |u_h - u_e|_{1,\\Omega} = 0.0375506\\).\nAfter the adaptation, we have \\(\\|u_h - u_e\\|_{0,\\Omega} = 0.000109043,\\, |u_h - u_e|_{1,\\Omega} = 0.0188411\\).\nSo the numerical solution is improved by adaptation of mesh.\n\n\nElectrostatics\nWe assume that there is no current and a time independent charge distribution.\nThen the electric field \\(\\mathbf{E}\\) satisfies:\n\n(42)\\[\\begin{split}\\begin{array}{rcl}\n    \\mathrm{div}\\mathbf{E} & = & \\rho/\\epsilon\\\\\n    \\mathrm{curl}\\mathbf{E} & = & 0\n\\end{array}\\end{split}\\]\nwhere \\(\\rho\\) is the charge density and \\(\\epsilon\\) is called the permittivity of free space.\nFrom the equation (42) We can introduce the electrostatic potential such that \\(\\mathbf{E} = -\\nabla \\phi\\).\nThen we have Poissons equation \\(-\\Delta \\phi = f\\), \\(f = -\\rho/\\epsilon\\).\nWe now obtain the equipotential line which is the level curve of \\(\\phi\\), when there are no charges except conductors \\(\\{C_i\\}_{1,\\cdots,K}\\).\nLet us assume \\(K\\) conductors \\(C_1,\\cdots,C_K\\) within an enclosure \\(C_0\\).\nEach one is held at an electrostatic potential \\(\\varphi_i\\).\nWe assume that the enclosure \\(C0\\) is held at potential 0.\nIn order to know \\(\\varphi(x)\\) at any point \\(x\\) of the domain \\(\\Omega\\), we must solve:\n\n\\[-\\Delta \\varphi  = 0\\quad \\textrm{ in }\\Omega\\]\nwhere \\(\\Omega\\) is the interior of \\(C_0\\) minus the conductors \\(C_i\\), and \\(\\Gamma\\) is the boundary of \\(\\Omega\\), that is \\(\\sum_{i = 0}^N C_i\\).\nHere \\(g\\) is any function of \\(x\\) equal to \\(\\varphi_i\\) on \\(C_i\\) and to 0 on \\(C_0\\).\nThe boundary equation is a reduced form for:\n\n\\[\\varphi  = \\varphi_{i}\\;\\text{on }C_{i},\\;i = 1...N,\\varphi  = 0\\;\\text{on }C_{0}.\\]\nFirst we give the geometrical informations; \\(C_0 = \\{(x,y);\\; x^2+y^2 = 5^2\\}\\), \\(C_1 = \\{(x,y):\\;\\frac{1}{0.3^2}(x-2)^2+\\frac{1}{3^2}y^2 = 1\\}\\), \\(C_2 = \\{(x,y):\\; \\frac{1}{0.3^2}(x+2)^2+\\frac{1}{3^2}y^2 = 1\\}\\).\nLet \\(\\Omega\\) be the disk enclosed by \\(C_0\\) with the elliptical holes enclosed by \\(C_1\\) and \\(C_2\\).\nNote that \\(C_0\\) is described counterclockwise, whereas the elliptical holes are described clockwise, because the boundary must be oriented so that the computational domain is to its left.\n 1 // Mesh\n 2 border C0(t = 0, 2*pi){x = 5*cos(t); y = 5*sin(t);}\n 3 border C1(t = 0, 2*pi){x = 2+0.3*cos(t); y = 3*sin(t);}\n 4 border C2(t = 0, 2*pi){x = -2+0.3*cos(t); y = 3*sin(t);}\n 5 \n 6 mesh Th  =  buildmesh(C0(60) + C1(-50) + C2(-50));\n 7 plot(Th);\n 8 \n 9 // Fespace\n10 fespace Vh(Th, P1);\n11 Vh uh, vh;\n12 \n13 // Problem\n14 problem Electro (uh, vh)\n15      =  int2d(Th)( //bilinear\n16         dx(uh)*dx(vh)\n17         + dy(uh)*dy(vh)\n18     )\n19     + on(C0, uh = 0) //boundary condition on C_0\n20     + on(C1, uh = 1) //+1 volt on C_1\n21     + on(C2, uh = -1) //-1 volt on C_2\n22     ;\n23 \n24 // Solve\n25 Electro;\n26 plot(uh);\n\n\n\n\n\n\nFig. 136 Disk with two elliptical holes\n\n\n\n\n\nFig. 137 Equipotential lines where \\(C_1\\) is located in right hand side\n\n\n\n\nAerodynamics\nLet us consider a wing profile \\(S\\) in a uniform flow.\nInfinity will be represented by a large circle \\(\\Gamma_{\\infty}\\).\nAs previously, we must solve:\n\n(43)\\[\\Delta \\varphi = 0\\quad\\textrm{in }\\Omega,\n\\quad \\varphi|_S = c,\\quad\n\\varphi|_{\\Gamma_{\\infty}} = u_{\\infty 1x}-u_{\\infty2x}\\]\nwhere \\(\\Omega\\) is the area occupied by the fluid, \\(u_{\\infty}\\) is the air speed at infinity, \\(c\\) is a constant to be determined so that \\(\\p_n\\varphi\\) is continuous at the trailing edge \\(P\\) of \\(S\\) (so-called Kutta-Joukowski condition).\nLift is proportional to \\(c\\).\nTo find \\(c\\) we use a superposition method.\nAs all equations in (43) are linear, the solution \\(\\varphi_c\\) is a linear function of \\(c\\)\n\n\\[\\varphi_c  =  \\varphi_0 + c\\varphi_1\\]\nwhere \\(\\varphi_0\\) is a solution of (43) with \\(c  =  0\\) and \\(\\varphi_1\\) is a solution with \\(c  =  1\\) and zero speed at infinity.\nWith these two fields computed, we shall determine \\(c\\) by requiring the continuity of \\(\\p \\varphi /\\p n\\) at the trailing edge.\nAn equation for the upper surface of a NACA0012 (this is a classical wing profile in aerodynamics; the rear of the wing is called the trailing edge) is:\n\n\\[y  =  0.17735\\sqrt{x} - 0.075597x - 0.212836x^2 + 0.17363x^3 - 0.06254x^4\\]\nTaking an incidence angle \\(\\alpha\\) such that \\(\\tan \\alpha  =  0.1\\), we must solve:\n\n\\[-\\Delta\\varphi  =  0\\qquad \\textrm{in }\\Omega, \\quad \\varphi|_{\\Gamma_1}  =  y - 0.1x,\\quad \\varphi |_{\\Gamma_2}  =  c\\]\nwhere \\(\\Gamma_2\\) is the wing profile and \\(\\Gamma_1\\) is an approximation of infinity.\nOne finds \\(c\\) by solving:\n\n\\[\\begin{split}\\begin{array}{ccccccc}\n    -\\Delta\\varphi_0 & =  0 &\\textrm{in }\\Omega&,\\qquad \\varphi_0|_{\\Gamma_1} & =  y - 0.1x&, \\quad \\varphi_0|_{\\Gamma_2} & =  0,\\\\\n    -\\Delta\\varphi_1 & =  0 &\\textrm{in }\\Omega&, \\qquad \\varphi_1|_{\\Gamma_1} & =  0&, \\quad \\varphi_1|_{\\Gamma_2} & =  1\n\\end{array}\\end{split}\\]\nThe solution \\(\\varphi  =  \\varphi_0+c\\varphi_1\\) allows us to find \\(c\\) by writing that \\(\\p_n\\varphi\\) has no jump at the trailing edge \\(P  =  (1, 0)\\).\nWe have \\(\\p n\\varphi -(\\varphi (P^+)-\\varphi (P))/\\delta\\) where \\(P^+\\) is the point just above \\(P\\) in the direction normal to the profile at a distance \\(\\delta\\).\nThus the jump of \\(\\p_n\\varphi\\) is \\((\\varphi_0|_{P^+} +c(\\varphi_1|_{P^+} -1))+(\\varphi_0|_{P^-} +c(\\varphi_1|_{P^-} -1))\\) divided by \\(\\delta\\) because the normal changes sign between the lower and upper surfaces. Thus\n\n\\[c  =  -\\frac{\\varphi_0|_{P^+} + \\varphi_0|_{P^-}}\n{(\\varphi_1|_{P^+} + \\varphi_1|_{P^-} - 2)} ,\\]\nwhich can be programmed as:\n\n\\[c  =  -\\frac{\\varphi_0(0.99, 0.01) + \\varphi_0(0.99,-0.01)}\n{(\\varphi_1(0.99, 0.01) + \\varphi_1(0.99,-0.01) - 2)} .\\]\n 1 // Mesh\n 2 border a(t = 0, 2*pi){x = 5*cos(t); y = 5*sin(t);}\n 3 border upper(t = 0, 1) {\n 4     x = t;\n 5     y = 0.17735*sqrt(t)-0.075597*t - 0.212836*(t^2) + 0.17363*(t^3) - 0.06254*(t^4);\n 6 }\n 7 border lower(t = 1, 0) {\n 8     x = t;\n 9     y = -(0.17735*sqrt(t) - 0.075597*t - 0.212836*(t^2) + 0.17363*(t^3) - 0.06254*(t^4));\n10 }\n11 border c(t = 0, 2*pi){x = 0.8*cos(t)+0.5; y = 0.8*sin(t);}\n12 \n13 mesh Zoom  =  buildmesh(c(30) + upper(35) + lower(35));\n14 mesh Th  =  buildmesh(a(30) + upper(35) + lower(35));\n15 \n16 // Fespace\n17 fespace Vh(Th, P2);\n18 Vh psi0, psi1, vh;\n19 \n20 fespace ZVh(Zoom, P2);\n21 \n22 // Problem\n23 solve Joukowski0(psi0, vh)\n24      =  int2d(Th)(\n25         dx(psi0)*dx(vh)\n26         + dy(psi0)*dy(vh)\n27     )\n28     + on(a, psi0 = y-0.1*x)\n29     + on(upper, lower, psi0 = 0)\n30     ;\n31 \n32 plot(psi0);\n33 \n34 solve Joukowski1(psi1,vh)\n35      =  int2d(Th)(\n36         dx(psi1)*dx(vh)\n37         + dy(psi1)*dy(vh)\n38     )\n39     + on(a, psi1 = 0)\n40     + on(upper, lower, psi1 = 1);\n41 \n42 plot(psi1);\n43 \n44 //continuity of pressure at trailing edge\n45 real beta  =  psi0(0.99,0.01) + psi0(0.99,-0.01);\n46 beta  =  -beta / (psi1(0.99,0.01) + psi1(0.99,-0.01)-2);\n47 \n48 Vh psi  =  beta*psi1 + psi0;\n49 plot(psi);\n50 \n51 ZVh Zpsi  =  psi;\n52 plot(Zpsi, bw = true);\n53 \n54 ZVh cp  =  -dx(psi)^2 - dy(psi)^2;\n55 plot(cp);\n56 \n57 ZVh Zcp  =  cp;\n58 plot(Zcp, nbiso = 40);\n\n\n\n\n\n\nFig. 138 Isovalue of \\(cp  =  -(\\p_x\\psi)^2 - (\\p_y\\psi)^2\\)\n\n\n\n\n\nFig. 139 Zooming of \\(cp\\)\n\n\n\n\nError estimation\nThere are famous estimation between the numerical result \\(u_h\\) and the exact solution \\(u\\) of the Poissons problem:\nIf triangulations \\(\\{\\mathcal{T}_h\\}_{h\\downarrow 0}\\) is regular (see Regular Triangulation), then we have the estimates:\n\n(44)\\[\\begin{split}\\begin{array}{rcl}\n    |\\nabla u - \\nabla u_h|_{0,\\Omega} &\\le& C_1h \\\\\n    \\|u - u_h\\|_{0,\\Omega} &\\le& C_2h^2\n\\end{array}\\end{split}\\]\nwith constants \\(C_1,\\, C_2\\) independent of \\(h\\), if \\(u\\) is in \\(H^2(\\Omega)\\).\nIt is known that \\(u\\in H^2(\\Omega)\\) if \\(\\Omega\\) is convex.\nIn this section we check (44).\nWe will pick up numericall error if we use the numerical derivative, so we will use the following for (44).\n\n\\[\\begin{split}\\begin{array}{rcl}\n    \\int_{\\Omega}|\\nabla u - \\nabla u_h|^2\\, \\d x\\d y & = &\\int_{\\Omega}\\nabla u\\cdot \\nabla(u - 2u_h)\\, \\d x\\d y+ \\int_{\\Omega}\\nabla u_h\\cdot \\nabla u_h\\, \\d x\\d y\\\\\n    & = &\\int_{\\Omega}f(u-2u_h)\\, \\d x\\d y+\\int_{\\Omega}fu_h\\, \\d x\\d y\n\\end{array}\\end{split}\\]\nThe constants \\(C_1,\\, C_2\\) are depend on \\(\\mathcal{T}_h\\) and \\(f\\), so we will find them by FreeFEM.\nIn general, we cannot get the solution \\(u\\) as a elementary functions even if spetical functions are added.\nInstead of the exact solution, here we use the approximate solution \\(u_0\\) in \\(V_h(\\mathcal{T}_h,P_2),\\, h\\sim 0\\).\n 1 // Parameters\n 2 func f  =  x*y;\n 3 \n 4 //Mesh\n 5 mesh Th0  =  square(100, 100);\n 6 \n 7 // Fespace\n 8 fespace V0h(Th0, P2);\n 9 V0h u0, v0;\n10 \n11 // Problem\n12 solve Poisson0 (u0, v0)\n13      =  int2d(Th0)(\n14         dx(u0)*dx(v0)\n15         + dy(u0)*dy(v0)\n16     )\n17     - int2d(Th0)(\n18         f*v0\n19     )\n20     + on(1, 2, 3, 4, u0 = 0)\n21     ;\n22 plot(u0);\n23 \n24 // Error loop\n25 real[int] errL2(10), errH1(10);\n26 for (int i  =  1; i < =  10; i++){\n27     // Mesh\n28     mesh Th  =  square(5+i*3,5+i*3);\n29 \n30     // Fespace\n31     fespace Vh(Th, P1);\n32     Vh u, v;\n33     fespace Ph(Th, P0);\n34     Ph h  =  hTriangle; //get the size of all triangles\n35 \n36     // Problem\n37     solve Poisson (u, v)\n38          =  int2d(Th)(\n39             dx(u)*dx(v)\n40             + dy(u)*dy(v)\n41         )\n42         - int2d(Th)(\n43             f*v\n44         )\n45         + on(1, 2, 3, 4, u = 0)\n46         ;\n47 \n48     // Error\n49     V0h uu  =  u; //interpolate solution on first mesh\n50     errL2[i-1]  =  sqrt( int2d(Th0)((uu - u0)^2) )/h[].max^2;\n51     errH1[i-1]  =  sqrt( int2d(Th0)(f*(u0 - 2*uu + uu)) )/h[].max;\n52 }\n53 \n54 // Display\n55 cout << \"C1  =  \" << errL2.max << \"(\"<<errL2.min<<\")\" << endl;\n56 cout << \"C2  =  \" << errH1.max << \"(\"<<errH1.min<<\")\" << endl;\n\n\nWe can guess that \\(C_1 = 0.0179253(0.0173266)\\) and \\(C_2 = 0.0729566(0.0707543)\\), where the numbers inside the parentheses are minimum in calculation.\n\n\nPeriodic Boundary Conditions\nWe now solve the Poisson equation:\n\n\\[-\\Delta u  =  sin(x+\\pi/4.)*cos(y+\\pi/4.)\\]\non the square \\(]0,2\\pi[^2\\) under bi-periodic boundary condition \\(u(0,y) = u(2\\pi,y)\\) for all \\(y\\) and \\(u(x,0) = u(x,2\\pi)\\) for all \\(x\\).\nThese boundary conditions are achieved from the definition of the periodic finite element space.\n 1 // Parameters\n 2 func f  =  sin(x+pi/4.)*cos(y+pi/4.); //right hand side\n 3 \n 4 // Mesh\n 5 mesh Th  =  square(10, 10, [2*x*pi, 2*y*pi]);\n 6 \n 7 // Fespace\n 8 //defined the fespace with periodic condition\n 9 //label: 2 and 4 are left and right side with y the curve abscissa\n10 //       1 and 2 are bottom and upper side with x the curve abscissa\n11 fespace Vh(Th, P2, periodic = [[2, y], [4, y], [1, x], [3, x]]);\n12 Vh uh, vh;\n13 \n14 // Problem\n15 problem laplace (uh, vh)\n16      =  int2d(Th)(\n17         dx(uh)*dx(vh)\n18         + dy(uh)*dy(vh)\n19     )\n20     + int2d(Th)(\n21         - f*vh\n22     )\n23     ;\n24 \n25 // Solve\n26 laplace;\n27 \n28 // Plot\n29 plot(uh, value = true);\n\n\n\n\n\nFig. 140 The isovalue of solution \\(u\\) with periodic boundary condition\n\n\nThe periodic condition does not necessarily require parallel boundaries.\nThe following example give such example.\n\nTip\nPeriodic boundary conditions - non-parallel boundaries\n 1 // Parameters\n 2 int n  =  10;\n 3 real r  =  0.25;\n 4 real r2  =  1.732;\n 5 func f  =  (y+x+1)*(y+x-1)*(y-x+1)*(y-x-1);\n 6 \n 7 // Mesh\n 8 border a(t = 0, 1){x = -t+1; y = t; label = 1;};\n 9 border b(t = 0, 1){x = -t; y = 1-t; label = 2;};\n10 border c(t = 0, 1){x = t-1; y = -t; label = 3;};\n11 border d(t = 0, 1){x = t; y = -1+t; label = 4;};\n12 border e(t = 0, 2*pi){x = r*cos(t); y = -r*sin(t); label = 0;};\n13 mesh Th  =  buildmesh(a(n) + b(n) + c(n) + d(n) + e(n));\n14 plot(Th, wait = true);\n15 \n16 // Fespace\n17 //warning for periodic condition:\n18 //side a and c\n19 //on side a (label 1) $ x \\in [0,1] $ or $ x-y\\in [-1,1] $\n20 //on side c (label 3) $ x \\in [-1,0]$ or $ x-y\\in[-1,1] $\n21 //so the common abscissa can be respectively $x$ and $x+1$\n22 //or you can can try curviline abscissa $x-y$ and $x-y$\n23 //1 first way\n24 //fespace Vh(Th, P2, periodic = [[2, 1+x], [4, x], [1, x], [3, 1+x]]);\n25 //2 second way\n26 fespace Vh(Th, P2, periodic = [[2, x+y], [4, x+y], [1, x-y], [3, x-y]]);\n27 Vh uh, vh;\n28 \n29 // Problem\n30 real intf  =  int2d(Th)(f);\n31 real mTh  =  int2d(Th)(1);\n32 real k  =   intf / mTh;\n33 problem laplace (uh, vh)\n34      =  int2d(Th)(\n35         dx(uh)*dx(vh)\n36         + dy(uh)*dy(vh)\n37     )\n38     + int2d(Th)(\n39         (k-f)*vh\n40     )\n41     ;\n42 \n43 // Solve\n44 laplace;\n45 \n46 // Plot\n47 plot(uh, wait = true);\n\n\n\n\n\nFig. 141 The isovalue of solution \\(u\\) for \\(\\Delta u  =  ((y+x)^{2}+1)((y-x)^{2}+1) - k\\), in \\(\\Omega\\) and \\(\\p_{n} u  = 0\\) on hole, and with two periodic boundary condition on external border\n\n\n\nAn other example with no equal border, just to see if the code works.\n\nTip\nPeriodic boundary conditions - non-equal border\n 1 // Macro\n 2 //irregular boundary condition to build border AB\n 3 macro LINEBORDER(A, B, lab)\n 4     border A#B(t = 0,1){ real t1 = 1.-t;\n 5     x = A#x*t1+B#x*t;\n 6     y = A#y*t1+B#y*t;\n 7     label = lab; } //EOM\n 8 // compute \\||AB|\\| A = (ax,ay) et B  = (bx,by)\n 9 macro dist(ax, ay, bx, by)\n10     sqrt(square((ax)-(bx)) + square((ay)-(by))) //EOM\n11 macro Grad(u) [dx(u), dy(u)] //EOM\n12 \n13 // Parameters\n14 int n  =  10;\n15 real Ax  =  0.9, Ay  =  1;\n16 real Bx  =  2, By  =  1;\n17 real Cx  =  2.5, Cy  =  2.5;\n18 real Dx  =  1, Dy  =  2;\n19 real gx  =  (Ax+Bx+Cx+Dx)/4.;\n20 real gy  =  (Ay+By+Cy+Dy)/4.;\n21 \n22 // Mesh\n23 LINEBORDER(A,B,1)\n24 LINEBORDER(B,C,2)\n25 LINEBORDER(C,D,3)\n26 LINEBORDER(D,A,4)\n27 mesh Th = buildmesh(AB(n)+BC(n)+CD(n)+DA(n),fixedborder = 1);\n28 \n29 // Fespace\n30 real l1  =  dist(Ax,Ay,Bx,By);\n31 real l2  =  dist(Bx,By,Cx,Cy);\n32 real l3  =  dist(Cx,Cy,Dx,Dy);\n33 real l4  =  dist(Dx,Dy,Ax,Ay);\n34 func s1  =  dist(Ax,Ay,x,y)/l1; //absisse on AB  =  ||AX||/||AB||\n35 func s2  =  dist(Bx,By,x,y)/l2; //absisse on BC  =  ||BX||/||BC||\n36 func s3  =  dist(Cx,Cy,x,y)/l3; //absisse on CD  =  ||CX||/||CD||\n37 func s4  =  dist(Dx,Dy,x,y)/l4; //absisse on DA  =  ||DX||/||DA||\n38 verbosity  =  6; //to see the abscisse value of the periodic condition\n39 fespace Vh(Th, P1, periodic = [[1, s1], [3, s3], [2, s2], [4, s4]]);\n40 verbosity  =  1; //reset verbosity\n41 Vh u, v;\n42 \n43 real cc  =  0;\n44 cc  =  int2d(Th)((x-gx)*(y-gy)-cc)/Th.area;\n45 cout << \"compatibility  =  \" << int2d(Th)((x-gx)*(y-gy)-cc) <<endl;\n46 \n47 // Problem\n48 solve Poisson (u, v)\n49      =  int2d(Th)(\n50         Grad(u)'*Grad(v)\n51         + 1e-10*u*v\n52     )\n53     -int2d(Th)(\n54         10*v*((x-gx)*(y-gy)-cc)\n55     )\n56     ;\n57 \n58 // Plot\n59 plot(u, value = true);\n\n\n\n\nTip\nPeriodic boundry conditions - Poisson cube-balloon\n 1 load \"msh3\" load \"tetgen\" load \"medit\"\n 2 \n 3 // Parameters\n 4 real hs  =  0.1; //mesh size on sphere\n 5 int[int] N  =  [20, 20, 20];\n 6 real [int,int] B  =  [[-1, 1], [-1, 1], [-1, 1]];\n 7 int [int,int] L  =  [[1, 2], [3, 4], [5, 6]];\n 8 \n 9 real x0  =  0.3, y0  =  0.4, z0  =  06;\n10 func f  =  sin(x*2*pi+x0)*sin(y*2*pi+y0)*sin(z*2*pi+z0);\n11 \n12 // Mesh\n13 bool buildTh  =  0;\n14 mesh3 Th;\n15 try { //a way to build one time the mesh or read it if the file exist\n16     Th  =  readmesh3(\"Th-hex-sph.mesh\");\n17 }\n18 catch (...){\n19     buildTh  =  1;\n20 }\n21 \n22 if (buildTh){\n23     include \"MeshSurface.idp\"\n24 \n25     // Surface Mesh\n26     mesh3 ThH  =  SurfaceHex(N, B, L, 1);\n27     mesh3 ThS  =  Sphere(0.5, hs, 7, 1);\n28 \n29     mesh3 ThHS  =  ThH + ThS;\n30 \n31     real voltet  =  (hs^3)/6.;\n32     real[int] domain  =  [0, 0, 0, 1, voltet, 0, 0, 0.7, 2, voltet];\n33     Th  =  tetg(ThHS, switch = \"pqaAAYYQ\", nbofregions = 2, regionlist = domain);\n34 \n35     savemesh(Th, \"Th-hex-sph.mesh\");\n36 }\n37 \n38 // Fespace\n39 fespace Ph(Th, P0);\n40 Ph reg  =  region;\n41 cout << \" centre  =  \" << reg(0,0,0) << endl;\n42 cout << \" exterieur  =  \" << reg(0,0,0.7) << endl;\n43 \n44 verbosity  =  50;\n45 fespace Vh(Th, P1, periodic = [[3, x, z], [4, x, z], [1, y, z], [2, y, z], [5, x, y], [6, x, y]]);\n46 verbosity  =  1;\n47 Vh uh,vh;\n48 \n49 // Macro\n50 macro Grad(u) [dx(u),dy(u),dz(u)] // EOM\n51 \n52 // Problem\n53 problem Poisson (uh, vh)\n54      =  int3d(Th, 1)(\n55         Grad(uh)'*Grad(vh)*100\n56     )\n57     + int3d(Th, 2)(\n58         Grad(uh)'*Grad(vh)*2\n59     )\n60     + int3d(Th)(\n61         vh*f\n62     )\n63     ;\n64 \n65 // Solve\n66 Poisson;\n67 \n68 // Plot\n69 plot(uh, wait = true, nbiso = 6);\n70 medit(\"uh\", Th, uh);\n\n\n\n\n\n\nFig. 142 View of the surface isovalue of periodic solution \\(uh\\)\n\n\n\n\n\nFig. 143 View a the cut of the solution \\(uh\\) with ffmedit\n\n\n\n\n\nPoisson Problems with mixed boundary condition\nHere we consider the Poisson equation with mixed boundary conditions:\nFor given functions \\(f\\) and \\(g\\), find \\(u\\) such that:\n\n\\[\\begin{split}\\begin{array}{rcll}\n    -\\Delta u & = & f & \\textrm{ in }\\Omega\\\\\n    u & = & g &\\textrm{ on }\\Gamma_D\\\\\n    \\p u/\\p n & = & 0 &\\textrm{ on }\\Gamma_N\n\\end{array}\\end{split}\\]\nwhere \\(\\Gamma_D\\) is a part of the boundary \\(\\Gamma\\) and \\(\\Gamma_N = \\Gamma\\setminus \\overline{\\Gamma_D}\\).\nThe solution \\(u\\) has the singularity at the points \\(\\{\\gamma_1,\\gamma_2\\} = \\overline{\\Gamma_D}\\cap\\overline{\\Gamma_N}\\).\nWhen \\(\\Omega = \\{(x,y);\\; -1<x<1,\\, 0<y<1\\}\\), \\(\\Gamma_N = \\{(x,y);\\; -1\\le x<0,\\, y = 0\\}\\), \\(\\Gamma_D = \\p \\Omega\\setminus \\Gamma_N\\), the singularity will appear at \\(\\gamma_1 = (0,0),\\, \\gamma_2(-1,0)\\), and \\(u\\) has the expression:\n\n\\[u = K_iu_S + u_R,\\, u_R\\in H^2(\\textrm{near }\\gamma_i),\\, i = 1,2\\]\nwith a constants \\(K_i\\).\nHere \\(u_S  =  r_j^{1/2}\\sin(\\theta_j/2)\\) by the local polar coordinate \\((r_j,\\theta_j\\) at \\(\\gamma_j\\) such that \\((r_1,\\theta_1) = (r,\\theta)\\).\nInstead of polar coordinate system \\((r,\\theta)\\), we use that \\(r\\)  =  sqrt (\\(x^2+y^2\\)) and \\(\\theta\\)  =  atan2 (\\(y,x\\)) in FreeFEM.\nAssume that \\(f = -2\\times 30(x^2+y^2)\\) and \\(g = u_e = 10(x^2+y^2)^{1/4}\\sin\\left([\\tan^{-1}(y/x)]/2\\right)+30(x^2y^2)\\), where \\(u_e\\)S is the exact solution.\n 1 // Parameters\n 2 func f  =  -2*30*(x^2+y^2); //given function\n 3 //the singular term of the solution is K*us (K: constant)\n 4 func us  =  sin(atan2(y,x)/2)*sqrt( sqrt(x^2+y^2) );\n 5 real K  =  10.;\n 6 func ue  =  K*us + 30*(x^2*y^2);\n 7 \n 8 // Mesh\n 9 border N(t = 0, 1){x = -1+t; y = 0; label = 1;};\n10 border D1(t = 0, 1){x = t; y = 0; label = 2;};\n11 border D2(t = 0, 1){x = 1; y = t; label = 2;};\n12 border D3(t = 0, 2){x = 1-t; y = 1; label = 2;};\n13 border D4(t = 0, 1){x = -1; y = 1-t; label = 2;};\n14 \n15 mesh T0h  =  buildmesh(N(10) + D1(10) + D2(10) + D3(20) + D4(10));\n16 plot(T0h, wait = true);\n17 \n18 // Fespace\n19 fespace V0h(T0h, P1);\n20 V0h u0, v0;\n21 \n22 //Problem\n23 solve Poisson0 (u0, v0)\n24      =  int2d(T0h)(\n25         dx(u0)*dx(v0)\n26         + dy(u0)*dy(v0)\n27     )\n28     - int2d(T0h)(\n29         f*v0\n30     )\n31     + on(2, u0 = ue)\n32     ;\n33 \n34 // Mesh adaptation by the singular term\n35 mesh Th  =  adaptmesh(T0h, us);\n36 for (int i  =  0; i < 5; i++)\n37 mesh Th  =  adaptmesh(Th, us);\n38 \n39 // Fespace\n40 fespace Vh(Th, P1);\n41 Vh u, v;\n42 \n43 // Problem\n44 solve Poisson (u, v)\n45      =  int2d(Th)(\n46         dx(u)*dx(v)\n47         + dy(u)*dy(v)\n48     )\n49     - int2d(Th)(\n50         f*v\n51     )\n52     + on(2, u = ue)\n53     ;\n54 \n55 // Plot\n56 plot(Th);\n57 plot(u, wait = true);\n58 \n59 // Error in H1 norm\n60 Vh uue  =  ue;\n61 real H1e  =  sqrt( int2d(Th)(dx(uue)^2 + dy(uue)^2 + uue^2) );\n62 Vh err0  =  u0 - ue;\n63 Vh err  =  u - ue;\n64 Vh H1err0  =  int2d(Th)(dx(err0)^2 + dy(err0)^2 + err0^2);\n65 Vh H1err  =  int2d(Th)(dx(err)^2 + dy(err)^2 + err^2);\n66 cout << \"Relative error in first mesh  =  \"<< int2d(Th)(H1err0)/H1e << endl;\n67 cout << \"Relative error in adaptive mesh  =  \"<< int2d(Th)(H1err)/H1e << endl;\n\n\nFrom line 35 to 37, mesh adaptations are done using the base of singular term.\nIn line 61, H1e  =  \\(|u_e|_{1,\\Omega}\\) is calculated.\nIn lines 64 and 65, the relative errors are calculated, that is:\n\n\\[\\begin{split}\\begin{array}{rcl}\n    \\|u^0_h-u_e\\|_{1,\\Omega}/H1e& = &0.120421\\\\\n    \\|u^a_h-u_e\\|_{1,\\Omega}/H1e& = &0.0150581\n\\end{array}\\end{split}\\]\nwhere \\(u^0_h\\) is the numerical solution in T0h and \\(u^a_h\\) is u in this program.\n\n\nPoisson with mixed finite element\nHere we consider the Poisson equation with mixed boundary value problems:\nFor given functions \\(f\\) , \\(g_d\\), \\(g_n\\), find \\(p\\) such that\n\n\\[\\begin{split}\\begin{array}{rcll}\n    -\\Delta p & = & 1 & \\textrm{ in }\\Omega\\\\\n    p & = & g_d & \\textrm{ on }\\Gamma_D\\\\\n    \\p p/\\p n & = & g_n & \\textrm{ on }\\Gamma_N\n\\end{array}\\end{split}\\]\nwhere \\(\\Gamma_D\\) is a part of the boundary \\(\\Gamma\\) and \\(\\Gamma_N = \\Gamma\\setminus \\overline{\\Gamma_D}\\).\nThe mixed formulation is: find \\(p\\) and \\(\\mathbf{u}\\) such that:\n\n\\[\\begin{split}\\begin{array}{rcll}\n    \\nabla p + \\mathbf{u} & = & \\mathbf{0} & \\textrm{ in }\\Omega\\\\\n    \\nabla. \\mathbf{u} & = & f & \\textrm{ in }\\Omega\\\\\n    p & = & g_d & \\textrm{ on }\\Gamma_D\\\\\n    \\p u. n & = & \\mathbf{g}_n.n & \\textrm{ on }\\Gamma_N\n\\end{array}\\end{split}\\]\nwhere \\(\\mathbf{g}_n\\) is a vector such that \\(\\mathbf{g}_n.n  =  g_n\\).\nThe variational formulation is:\n\n\\[\\begin{split}\\begin{array}{rcl}\n    \\forall \\mathbf{v} \\in \\mathbb{V}_0: & \\int_\\Omega p \\nabla.v + \\mathbf{v} \\mathbf{v} & =  \\int_{\\Gamma_d} g_d \\mathbf{v}.n\\\\\n    \\forall {q} \\in \\mathbb{P}: & \\int_\\Omega q \\nabla.u & =  \\int_\\Omega q f\\nonumber\\\\\n    & \\p u. n & =  \\mathbf{g}_n.n \\quad \\textrm{on }\\Gamma_N\n\\end{array}\\end{split}\\]\nwhere the functional space are:\n\n\\[\\mathbb{P} =  L^2(\\Omega),\n\\qquad\\mathbb{V} =  H(div) = \\{\\mathbf{v}\\in L^2(\\Omega)^2,\\nabla.\\mathbf{v}\\in L^2(\\Omega)\\}\\]\nand:\n\n\\[\\mathbb{V}_0  =  \\{\\mathbf{v}\\in \\mathbb{V};\\quad\\mathbf{v}. n  =  0 \\quad\\mathrm{on }\\;\\;\\Gamma_N\\}\\]\nTo write the FreeFEM example, we have just to choose the finites elements spaces.\nHere \\(\\mathbb{V}\\) space is discretize with Raviart-Thomas finite element RT0 and \\(\\mathbb{P}\\) is discretize by constant finite element P0.\nExample 9.10 LaplaceRT.edp\n 1 // Parameters\n 2 func gd  =  1.;\n 3 func g1n  =  1.;\n 4 func g2n  =  1.;\n 5 \n 6 // Mesh\n 7 mesh Th  =  square(10, 10);\n 8 \n 9 // Fespace\n10 fespace Vh(Th, RT0);\n11 Vh [u1, u2];\n12 Vh [v1, v2];\n13 \n14 fespace Ph(Th, P0);\n15 Ph p, q;\n16 \n17 // Problem\n18 problem laplaceMixte ([u1, u2, p], [v1, v2, q], solver = GMRES, eps = 1.0e-10, tgv = 1e30, dimKrylov = 150)\n19      =  int2d(Th)(\n20         p*q*1e-15 //this term is here to be sure\n21         // that all sub matrix are inversible (LU requirement)\n22         + u1*v1\n23         + u2*v2\n24         + p*(dx(v1)+dy(v2))\n25         + (dx(u1)+dy(u2))*q\n26     )\n27     + int2d(Th) (\n28         q\n29     )\n30     - int1d(Th, 1, 2, 3)(\n31         gd*(v1*N.x +v2*N.y)\n32     )\n33     + on(4, u1 = g1n, u2 = g2n)\n34     ;\n35 \n36 // Solve\n37 laplaceMixte;\n38 \n39 // Plot\n40 plot([u1, u2], coef = 0.1, wait = true, value = true);\n41 plot(p, fill = 1, wait = true, value = true);\n\n\n\n\nMetric Adaptation and residual error indicator\nWe do metric mesh adaption and compute the classical residual error indicator \\(\\eta_{T}\\) on the element \\(T\\) for the Poisson problem.\nFirst, we solve the same problem as in a previous example.\n 1 // Parameters\n 2 real[int] viso(21);\n 3 for (int i  =  0; i < viso.n; i++)\n 4 viso[i]  =  10.^(+(i-16.)/2.);\n 5 real error  =  0.01;\n 6 func f  =  (x-y);\n 7 \n 8 // Mesh\n 9 border ba(t = 0, 1.0){x = t; y = 0; label = 1;}\n10 border bb(t = 0, 0.5){x = 1; y = t; label = 2;}\n11 border bc(t = 0, 0.5){x = 1-t; y = 0.5; label = 3;}\n12 border bd(t = 0.5, 1){x = 0.5; y = t; label = 4;}\n13 border be(t = 0.5, 1){x = 1-t; y = 1; label = 5;}\n14 border bf(t = 0.0, 1){x = 0; y = 1-t; label = 6;}\n15 mesh Th  =  buildmesh(ba(6) + bb(4) + bc(4) + bd(4) + be(4) + bf(6));\n16 \n17 // Fespace\n18 fespace Vh(Th, P2);\n19 Vh u, v;\n20 \n21 fespace Nh(Th, P0);\n22 Nh rho;\n23 \n24 // Problem\n25 problem Probem1 (u, v, solver = CG, eps = 1.0e-6)\n26      =  int2d(Th, qforder = 5)(\n27         u*v*1.0e-10\n28         + dx(u)*dx(v)\n29         + dy(u)*dy(v)\n30     )\n31     + int2d(Th, qforder = 5)(\n32         - f*v\n33     )\n34     ;\n\n\nNow, the local error indicator \\(\\eta_{T}\\) is:\n\n\\[\\eta_{T}  = \\left( h_{T}^{2} || f + \\Delta u_{{h}} ||_{L^{2}(T)}^{2} +\\sum_{e\\in \\mathcal{E}_{K}} h_{e} \\,||\\, [ \\frac{\\p u_{h}}{\\p n_{k}}] \\,||^{2}_{L^{2}(e)} \\right)^{\\frac{1}{2}}\\]\nwhere \\(h_{T}\\) is the longest edge of \\(T\\), \\({\\cal E}_T\\) is the set of \\(T\\) edge not on \\(\\Gamma = \\p \\Omega\\), \\(n_{T}\\) is the outside unit normal to \\(K\\), \\(h_{e}\\) is the length of edge \\(e\\), \\([ g ]\\) is the jump of the function \\(g\\) across edge (left value minus right value).\nOf course, we can use a variational form to compute \\(\\eta_{T}^{2}\\), with test function constant function in each triangle.\n 1 // Error\n 2 varf indicator2 (uu, chiK)\n 3      =  intalledges(Th)(\n 4         chiK*lenEdge*square(jump(N.x*dx(u) + N.y*dy(u)))\n 5     )\n 6     + int2d(Th)(\n 7         chiK*square(hTriangle*(f + dxx(u) + dyy(u)))\n 8     )\n 9     ;\n10 \n11 // Mesh adaptation loop\n12 for (int i  =  0; i < 4; i++){\n13     // Solve\n14     Probem1;\n15     cout << u[].min << \" \" << u[].max << endl;\n16     plot(u, wait = true);\n17 \n18     // Error\n19     rho[]  =  indicator2(0, Nh);\n20     rho  =  sqrt(rho);\n21     cout << \"rho  =  min \" << rho[].min << \" max = \" << rho[].max << endl;\n22     plot(rho, fill = true, wait = true, cmm = \"indicator density\", value = true, viso = viso, nbiso = viso.n);\n23 \n24     // Mesh adaptation\n25     plot(Th, wait = true, cmm = \"Mesh (before adaptation)\");\n26     Th  =  adaptmesh(Th, [dx(u), dy(u)], err = error, anisomax = 1);\n27     plot(Th, wait = true, cmm = \"Mesh (after adaptation)\");\n28     u  =  u;\n29     rho  =  rho;\n30     error  =  error/2;\n31 }\n\n\nIf the method is correct, we expect to look the graphics by an almost constant function \\(\\eta\\) on your computer as in Fig. 144 and Fig. 145.\n\n\n\n\nFig. 144 Density of the error indicator with isotropic \\(P_{2}\\) metric\n\n\n\n\n\nFig. 145 Density of the error indicator with isotropic \\(P_{2}\\) metric\n\n\n\n\nAdaptation using residual error indicator\nIn the previous example we compute the error indicator, now we use it, to adapt the mesh.\nThe new mesh size is given by the following formulae:\n\n\\[h_{n+1}(x)  =  \\frac{h_{n}(x)}{f_{n}(\\eta_K(x))}\\]\nwhere \\(\\eta_n(x)\\) is the level of error at point \\(x\\) given by the local error indicator, \\(h_n\\) is the previous mesh size field, and \\(f_n\\) is a user function define by \\(f_n  =  min(3,max(1/3,\\eta_n / \\eta_n^* ))\\) where \\(\\eta_n^*  =  mean(\\eta_n) c\\), and \\(c\\) is an user coefficient generally close to one.\nFirst a macro MeshSizecomputation is defined to get a \\(P_1\\) mesh size as the average of edge length.\n 1 // macro the get the current mesh size parameter\n 2 // in:\n 3 // Th the mesh\n 4 // Vh P1 fespace on Th\n 5 // out :\n 6 // h: the Vh finite element finite set to the current mesh size\n 7 macro MeshSizecomputation (Th, Vh, h)\n 8 {\n 9     real[int] count(Th.nv);\n10     /*mesh size (lenEdge  =  integral(e) 1 ds)*/\n11     varf vmeshsizen (u, v)  =  intalledges(Th, qfnbpE = 1)(v);\n12     /*number of edges per vertex*/\n13     varf vedgecount (u, v)  =  intalledges(Th, qfnbpE = 1)(v/lenEdge);\n14     /*mesh size*/\n15     count  =  vedgecount(0, Vh);\n16     h[]  =  0.;\n17     h[]  =  vmeshsizen(0, Vh);\n18     cout << \"count min  =  \" << count.min << \" max  =  \" << count.max << endl;\n19     h[]  =  h[]./count;\n20     cout << \"-- bound meshsize  =  \" << h[].min << \" \" << h[].max << endl;\n21 } //\n\n\nA second macro to re-mesh according to the new mesh size.\n 1 // macro to remesh according the de residual indicator\n 2 // in:\n 3 // Th the mesh\n 4 // Ph P0 fespace on Th\n 5 // Vh P1 fespace on Th\n 6 // vindicator the varf to evaluate the indicator\n 7 // coef on etameam\n 8 macro ReMeshIndicator (Th, Ph, Vh, vindicator, coef)\n 9 {\n10     Vh h = 0;\n11     /*evaluate the mesh size*/\n12     MeshSizecomputation(Th, Vh, h);\n13     Ph etak;\n14     etak[]  =  vindicator(0, Ph);\n15     etak[]  =  sqrt(etak[]);\n16     real etastar =  coef*(etak[].sum/etak[].n);\n17     cout << \"etastar  =  \" << etastar << \" sum  =  \" << etak[].sum << \" \" << endl;\n18 \n19     /*etaK is discontinous*/\n20     /*we use P1 L2 projection with mass lumping*/\n21     Vh fn, sigma;\n22     varf veta(unused, v)  =  int2d(Th)(etak*v);\n23     varf vun(unused, v)  =  int2d(Th)(1*v);\n24     fn[]  =  veta(0, Vh);\n25     sigma[]  =  vun(0, Vh);\n26     fn[]  =  fn[]./ sigma[];\n27     fn  =  max(min(fn/etastar,3.),0.3333);\n28 \n29     /*new mesh size*/\n30     h  =  h / fn;\n31     /*build the mesh*/\n32     Th  =  adaptmesh(Th, IsMetric = 1, h, splitpbedge = 1, nbvx = 10000);\n33 } //\n\n\n 1 // Parameters\n 2 real hinit  =  0.2; //initial mesh size\n 3 func f = (x-y);\n 4 \n 5 // Mesh\n 6 border ba(t = 0, 1.0){x = t; y = 0; label = 1;}\n 7 border bb(t = 0, 0.5){x = 1; y = t; label = 2;}\n 8 border bc(t = 0, 0.5){x = 1-t; y = 0.5; label = 3;}\n 9 border bd(t = 0.5, 1){x = 0.5; y = t; label = 4;}\n10 border be(t = 0.5, 1){x = 1-t; y = 1; label = 5;}\n11 border bf(t = 0.0, 1){x = 0; y = 1-t; label = 6;}\n12 mesh Th  =  buildmesh(ba(6) + bb(4) + bc(4) + bd(4) + be(4) + bf(6));\n13 \n14 // Fespace\n15 fespace Vh(Th, P1); //for the mesh size and solution\n16 Vh h  =  hinit; //the FE function for the mesh size\n17 Vh u, v;\n18 \n19 fespace Ph(Th, P0); //for the error indicator\n20 \n21 //Build a mesh with the given mesh size hinit\n22 Th  =  adaptmesh(Th, h, IsMetric = 1, splitpbedge = 1, nbvx = 10000);\n23 plot(Th, wait = 1);\n24 \n25 // Problem\n26 problem Poisson (u, v)\n27      =  int2d(Th, qforder = 5)(\n28         u*v*1.0e-10\n29         + dx(u)*dx(v)\n30         + dy(u)*dy(v)\n31     )\n32     - int2d(Th, qforder = 5)(\n33         f*v\n34     )\n35     ;\n36 \n37 varf indicator2 (unused, chiK)\n38      =  intalledges(Th)(\n39         chiK*lenEdge*square(jump(N.x*dx(u) + N.y*dy(u)))\n40     )\n41     + int2d(Th)(\n42         chiK*square(hTriangle*(f + dxx(u) + dyy(u)))\n43     )\n44     ;\n45 \n46 // Mesh adaptation loop\n47 for (int i  =  0; i < 10; i++){\n48     u  =  u;\n49 \n50     // Solve\n51     Poisson;\n52     plot(Th, u, wait = true);\n53 \n54     real cc  =  0.8;\n55     if (i > 5) cc = 1;\n56     ReMeshIndicator(Th, Ph, Vh, indicator2, cc);\n57     plot(Th, wait = true);\n58 }\n\n\n\n\n\n\nFig. 146 The error indicator with isotropic \\(P_{1}\\)\n\n\n\n\n\nFig. 147 The mesh and isovalue of the solution\n\n\n\n\n\n\n\t\t\n\t\t\t Previous topic: Mathematical Models\n\t\t\tNext topic: Elasticity \n\t\t\n\t","l":"models/static-problems.html"},"49":{"t":"Transmission problem","p":"\n\t\t\n   \nTransmission problem\nConsider an elastic plate whose displacement change vertically, which is made up of three plates of different materials, welded on each other.\nLet \\(\\Omega_i\\), \\(i = 1,2,3\\) be the domain occupied by \\(i\\)-th material with tension \\(\\mu_i\\) (see Soap film).\nThe computational domain \\(\\Omega\\) is the interior of \\(\\overline{\\Omega_1}\\cup \\overline{\\Omega_2}\\cup \\overline{\\Omega_3}\\).\nThe vertical displacement \\(u(x,y)\\) is obtained from:\n\n(59)\\[\\begin{split}\\begin{array}{rcll}\n    -\\mu_i\\Delta u & = & f & \\textrm{ in }\\Omega_i\\\\\n    \\mu_i\\p_n u|_{\\Gamma_{i}} & = & -\\mu_j\\p_n u|_{\\Gamma_{j}} & \\textrm{ on }\\overline{\\Omega_{i}}\\cap\\overline{\\Omega_{j}} \\textrm{ if }1\\le i< j\\le 3\n\\end{array}\\end{split}\\]\nwhere \\(\\p_n u|_{\\Gamma_{i}}\\) denotes the value of the normal derivative \\(\\p_n u\\) on the boundary \\(\\Gamma_i\\) of the domain \\(\\Omega_i\\).\nBy introducing the characteristic function \\(\\chi_i\\) of \\(\\Omega_i\\), that is:\n\n\\[\\chi_i(x) = 1\\ \\textrm{ if }x\\in\\Omega_i;\\\n\\chi_i(x) = 0\\ \\textrm{ if }x\\not\\in\\Omega_i\\]\nwe can easily rewrite (59) to the weak form.\nHere we assume that \\(u = 0\\) on \\(\\Gamma = \\p\\Omega\\).\nTransmission problem: For a given function \\(f\\), find \\(u\\) such that:\n\n\\[a(u,v)  =  \\ell(f,v) \\textrm{ for all }v\\in H^1_0(\\Omega)\\]\n\n\\[\\begin{split}\\begin{array}{rcl}\n    a(u,v) & = & \\int_{\\Omega}\\mu \\nabla u\\cdot \\nabla v\\nonumber\\\\\n    \\ell(f,v) & = & \\int_{\\Omega}fv\\nonumber\n\\end{array}\\end{split}\\]\nwhere \\(\\mu = \\mu_1\\chi_1+\\mu_2\\chi_2+\\mu_3\\chi_3\\).\nHere we notice that \\(\\mu\\) become the discontinuous function.\nThis example explains the definition and manipulation of region, i.e.sub-domains of the whole domain.\nConsider this L-shaped domain with 3 diagonals as internal boundaries, defining 4 sub-domains:\n 1 // Mesh\n 2 border a(t = 0, 1){x = t; y = 0;};\n 3 border b(t = 0, 0.5){x = 1; y = t;};\n 4 border c(t = 0, 0.5){x = 1-t; y = 0.5;};\n 5 border d(t = 0.5, 1){x = 0.5; y = t;};\n 6 border e(t = 0.5, 1){x = 1-t; y = 1;};\n 7 border f(t = 0, 1){x = 0; y = 1-t;};\n 8 border i1(t = 0, 0.5){x = t; y = 1-t;};\n 9 border i2(t = 0, 0.5){x = t; y = t;};\n10 border i3(t = 0, 0.5){x = 1-t; y = t;};\n11 mesh th  =  buildmesh(a(6) + b(4) + c(4) +d(4) + e(4)\n12     + f(6) + i1(6) + i2(6) + i3(6));\n13 \n14 // Fespace\n15 fespace Ph(th, P0); //constant discontinuous functions / element\n16 Ph reg = region; //defined the P0 function associated to region number\n17 \n18 // Plot\n19 plot(reg, fill = true, wait = true, value = true);\n\n\n\n\n\nFig. 174 The function reg\n\n\nregion is a keyword of FreeFEM which is in fact a variable depending of the current position (is not a function today, use Ph reg = region; to set a function).\nThis variable value returned is the number of the sub-domain of the current position.\nThis number is defined by buildmesh which scans while building the mesh all its connected component.\nSo to get the number of a region containing a particular point one does:\n1 // Characteristic function\n2 int nupper  =  reg(0.4, 0.9); //get the region number of point (0.4,0.9)\n3 int nlower  =  reg(0.9, 0.1); //get the region number of point (0.4,0.1)\n4 cout << \"nlower  =  \" <<  nlower << \", nupper  =  \" << nupper<< endl;\n5 Ph nu  =  1 + 5*(region =  = nlower) + 10*(region =  = nupper);\n6 \n7 // Plot\n8 plot(nu, fill = true,wait = true);\n\n\n\n\n\nFig. 175 The function nu\n\n\nThis is particularly useful to define discontinuous functions such as might occur when one part of the domain is copper and the other one is iron, for example.\nWe this in mind we proceed to solve a Laplace equation with discontinuous coefficients (\\(\\nu\\) is 1, 6 and 11 below).\n 1 // Problem\n 2 solve lap (u, v)\n 3      =  int2d(th)(\n 4           nu*(dx(u)*dx(v) + dy(u)*dy(v))\n 5     )\n 6     + int2d(th)(\n 7         - 1*v\n 8     )\n 9     + on(a, b, c, d, e, f, u = 0)\n10     ;\n11 \n12 // Plot\n13 plot(u);\n\n\n\n\n\nFig. 176 The isovalue of the solution \\(u\\)\n\n\n\n\n\n\t\t\n\t\t\t Previous topic: Fluid-structure coupled problem\n\t\t\tNext topic: Free boundary problems \n\t\t\n\t","l":"models/transmission-problem.html"},"50":{"t":"Variational Inequality","p":"\n\t\t\n   \nVariational Inequality\nWe present, a classical example of variational inequality.\nLet us denote \\(\\mathcal{C}  =  \\{ u\\in H^1_0(\\Omega), u \\le g \\}\\)\nThe problem is:\n\n\\[u  =  arg \\min_{u\\in \\mathcal{C}} J(u)  =  \\frac{1}{2} \\int_\\Omega \\nabla u . \\nabla u - \\int_\\Omega f u\\]\nwhere \\(f\\) and \\(g\\) are given function.\nThe solution is a projection on the convex \\(\\mathcal{C}\\) of \\(f^\\star\\) for the scalar product \\(((v,w))  =  \\int_\\Omega \\nabla v . \\nabla w\\) of \\(H^1_0(\\Omega)\\) where \\(f^\\star\\) is solution of:\n\n\\[(f^\\star, v )  =  \\int_{\\Omega}{f v}, \\forall v \\in H^1_0(`\\Omega)\\]\nThe projection on a convex satisfy clearly \\(\\forall v \\in \\mathcal{C}, \\quad (( u -v , u - \\tilde{f} )) \\leq 0\\), and after expanding, we get the classical inequality:\n\n\\[\\forall v \\in \\mathcal{C}, \\quad \\int_\\Omega \\nabla(u -v) \\nabla u \\leq \\int_\\Omega (u-v) f\\]\nWe can also rewrite the problem as a saddle point problem:\nFind \\(\\lambda, u\\) such that:\n\n\\[\\max_{\\lambda\\in L^2(\\Omega), \\lambda\\geq 0} \\min_{u\\in H^1_0(\\Omega)} \\mathcal{L}(u,\\lambda)  =  \\frac{1}{2} \\int_\\Omega \\nabla u . \\nabla u - \\int_\\Omega f u + \\int_{\\Omega} \\lambda (u-g)^+\\]\nwhere \\(((u-g)^+  =  max(0,u-g)\\).\nThis saddle point problem is equivalent to find \\(u, \\lambda\\) such that:\n\n\\[\\left\\{\n\\begin{array}{cc}\n    \\displaystyle \\int_\\Omega \\nabla u . \\nabla v + \\lambda v^+ \\,d\\omega =  \\int_\\Omega f u , &\\forall v \\in H^1_0(\\Omega) \\cr\n    \\displaystyle \\int_\\Omega \\mu (u-g)^+  =  0 , & \\forall \\mu \\in L^2(\\Omega) , \\mu \\geq 0, \\lambda \\geq 0,\n\\end{array}\\right.\\]\nAn algorithm to solve the previous problem is:\n\nk = 0, and choose \\(\\lambda_0\\) belong \\(H^{-1}(\\Omega)\\)\nLoop on \\(k  =  0, .....\\)\n\nset \\(\\mathcal{I}_{k}  =  \\{ x \\in \\Omega / \\lambda_{k} + c * ( u_{k+1} - g) \\leq 0 \\}\\)\n\\(V_{g,k+1}  =  \\{ v\\in H^1_0(\\Omega) / v  =  g\\) on \\({I}_{k} \\}\\),\n\\(V_{0,k+1}  =  \\{ v\\in H^1_0(\\Omega) / v  =  0\\) on \\({I}_{k} \\}\\),\nFind \\(u_{k+1} \\in V_{g,k+1}\\) and \\(\\lambda_{k+1} \\in H^{-1}(\\Omega)\\) such that\n\n\\[\\left\\{\\begin{array}{cc}\n   \\displaystyle \\int_\\Omega \\nabla u_{k+1}. \\nabla v_{k+1} \\,d\\omega  =  \\int_\\Omega f v_{k+1} , &\\forall v_{k+1} \\in V_{0,k+1} \\cr\n   \\displaystyle <\\lambda_{k+1},v>  =  \\int_\\Omega \\nabla u_{k+1}. \\nabla v - f v \\,d\\omega &\n\\end{array}\\right.\\]\nwhere \\(<,>\\) is the duality bracket between \\(H^{1}_0(\\Omega)\\) and \\(H^{-1}(\\Omega)\\), and \\(c\\) is a penalty constant (large enough).\n\n\n\n\nYou can find all the mathematics about this algorithm in [ITO2003] [HINTERMULLER2002].\nNow how to do that in FreeFEM? The full example is:\n\nTip\nVariational inequality\n 1 load \"medit\"\n 2 \n 3 // Parameters\n 4 real eps  =  1e-5;\n 5 real c  =  1000; //penalty parameter of the algoritm\n 6 real tgv  =  1e30; //a huge value for exact penalization\n 7 func f  =  1; //right hand side function\n 8 func fd  =  0; //Dirichlet boundary condition function\n 9 \n10 // Mesh\n11 mesh Th  =  square(20, 20);\n12 \n13 // Fespace\n14 fespace Vh(Th, P1);\n15 int n  =  Vh.ndof; //number of degree of freedom\n16 Vh uh, uhp; //u^n+1 and u^n\n17 Vh Ik; //to define the set where the containt is reached.\n18 Vh g  =  0.05; //discret function g\n19 Vh lambda  =  0;\n20 \n21 // Problem\n22 varf a (uh, vh)\n23      =  int2d(Th)(\n24           dx(uh)*dx(vh)\n25         + dy(uh)*dy(vh)\n26     )\n27     - int2d(Th)(\n28           f*vh\n29     )\n30     + on(1, 2, 3, 4, uh = fd)\n31     ;\n32 \n33 //the mass Matrix construction\n34 varf vM (uh, vh)  =  int2d(Th)(uh*vh);\n35 \n36 //two versions of the matrix of the problem\n37 matrix A  =  a(Vh, Vh, tgv = tgv, solver = CG); //one changing\n38 matrix AA  =  a(Vh, Vh, solver = CG); //one for computing residual\n39 \n40 matrix M  =  vM(Vh, Vh); //to do a fast computing of L^2 norm : sqrt(u'*(w = M*u))\n41 \n42 real[int] Aiin(n);\n43 real[int] Aii  =  A.diag; //get the diagonal of the matrix\n44 real[int] rhs  =  a(0, Vh, tgv = tgv);\n45 \n46 // Initialization\n47 Ik  =  0;\n48 uhp  =  -tgv;\n49 \n50 // Loop\n51 for(int iter  =  0; iter < 100; ++iter){\n52     // Update\n53     real[int] b  =  rhs; //get a copy of the Right hand side\n54     real[int] Ak(n); //the complementary of Ik ( !Ik  =  (Ik-1))\n55     Ak  =  1.; Ak - =  Ik[];\n56     //adding new locking condition on b and on the diagonal if (Ik  =  = 1 )\n57     b  =  Ik[] .* g[]; b * =  tgv; b - =  Ak .* rhs;\n58     Aiin  =  Ik[] * tgv; Aiin + =  Ak .* Aii; //set Aii =  tgv i in Ik\n59     A.diag  =  Aiin; //set the matrix diagonal\n60     set(A, solver = CG); //important to change preconditioning for solving\n61 \n62     // Solve\n63     uh[]  =  A^-1* b; //solve the problem with more locking condition\n64 \n65     // Residual\n66     lambda[]  =  AA * uh[]; //compute the residual (fast with matrix)\n67     lambda[] + =  rhs; //remark rhs  =  -\\int f v\n68 \n69     Ik  =  (lambda + c*( g- uh)) < 0.; //the new locking value\n70 \n71     // Plot\n72     plot(Ik, wait = true, cmm = \" lock set \", value = true, fill = true);\n73     plot(uh, wait = true, cmm = \"uh\");\n74 \n75     // Error\n76     //trick to compute L^2 norm of the variation (fast method)\n77     real[int] diff(n), Mdiff(n);\n78     diff  =  uh[] - uhp[];\n79     Mdiff  =  M*diff;\n80     real err  =  sqrt(Mdiff'*diff);\n81     cout << \"|| u_{k = 1} - u_{k} ||_2  =  \" << err << endl;\n82 \n83     // Stop test\n84     if(err < eps) break;\n85 \n86     // Update\n87     uhp[]  =  uh[];\n88 }\n89 \n90 // Plot\n91 medit(\"uh\", Th, uh);\n\n\n\nNote\nAs you can see on this example, some vector, or matrix operator are not implemented so a way is to skip the expression and we use operator + = ,  - =  to merge the result.\n\n\n\n\n\n\t\t\n\t\t\t Previous topic: Navier-Stokes equations\n\t\t\tNext topic: Domain decomposition \n\t\t\n\t","l":"models/variational-inequality.html"},"51":{"t":"Whispering gallery modes","p":"\n\t\t\n   \nWhispering gallery modes\nAuthor: I. S. Grudinin\nIn whispering gallery mode (WGM) resonators, which are typically spheres or disks, electromagnetic field is trapped by total internal reflections from the boundary.\nModes of such resonators are distinguished by compact volume and record high quality factors (Q) in a broad range of frequencies.\nModern applications of such resonators include microwave and optical cavities for atomic clocks, cavity optomechanics, nonlinear and quantum optics.\nAnalytical solutions for WG modes are only available for a limited number of idealized geometries, such as sphere or ellipsoid.\nSince resonator dimensions are typically much larger than optical wavelength, direct application of numerical 3D finite difference time domain (FDTD) or finite element methods (FEM) is not practical.\nIts possible to solve the vectorial wave equation by reducing it to a two dimensional case by taking axial symmetry into account.\nSuch reduction leads to a system of 3 equations to be solved in a 2D \\(\\rho-z\\) section of a resonator.\nPlease refer to [OXBORROW2007] for a detailed derivation and to [GRUDININ2012] for an example of using FreeFEM to compute WGMs.\n\nWave equation for the WGMs\nSince electric field is discontinuous on the surface of a dielectric and magnetic field is typically not, we derive our equations for the magnetic field.\nThe electric field can be easily derived at a later stage from \\(\\vec{E} = \\frac{i}{\\omega\\epsilon_0}\\hat{\\epsilon}^{-1}\\nabla\\times\\vec{H}\\).\nFollowing a standard procedure starting with Maxwell equations we derive a wave equation in a single-axis anisotropic medium such as an optical crystal:\n\n(60)\\[\\nabla\\times\\left(\\hat{\\epsilon}^{-1}\\nabla\\times\\vec{H}\\right)-k_0^2\\vec{H}-\\alpha\\nabla\\left(\\nabla\\cdot\\vec{H}\\right) = 0\\]\nHere \\(k_0 = \\omega/c\\) is the wavenumber, \\(\\alpha\\) is the penalty term added to fight spurious FEM solutions.\nFor anisotropic single-axis medium with \\(\\partial\\hat{\\epsilon}/\\partial\\phi = 0\\) in cylindrical system of coordinates we have:\n\n\\[\\begin{split}\\hat{\\epsilon} = \\begin{pmatrix} \\epsilon_{\\rho} & 0 & 0 \\\\ 0 & \\epsilon_{\\rho} & 0 \\\\ 0 & 0 & \\epsilon_z \\end{pmatrix}. \\nonumber\\end{split}\\]\nWe now assume axial symmetry of our electromagnetic fields and insert an imaginary unity in front of the \\(H_{\\phi}\\) to allow all field components to be real numbers and also to account for the phase shift of this component \\(\\vec{H}(\\rho,\\phi,z) = \\left\\{H_{\\rho}(\\rho,z),iH_{\\phi}(\\rho,z),H_z(\\rho,z)\\right\\}\\times e^{im\\phi}\\).\nWe write the wave equation (60) explicitly in cylindrical coordinates, thus obtaining a set of three differential equations for the domain \\(\\Omega\\) given by the resonators cross section and some space outside:\n\n(61)\\[\\begin{split}\\begin{array}{rcl}\n    A_1\\{{H}_{\\rho}^t,{H}_{\\phi}^t,{H}_{z}^t\\}& = &0\\\\ \\nonumber\n    A_2\\{{H}_{\\rho}^t,{H}_{\\phi}^t,{H}_{z}^t\\}& = &0\\\\ \\nonumber\n    A_3\\{{H}_{\\rho}^t,{H}_{\\phi}^t,{H}_{z}^t\\}& = &0\n\\end{array}\\end{split}\\]\nThe numerical solutions of these equations and boundary conditions can be found with FreeFEM if we write the system in the weak, or integral form.\n\n\nWeak formulation\nIn general, to obtain the integral or weak statements equivalent to system (61) and boundary conditions we form a scalar dot product between an arbitrary magnetic field test function \\(\\mathbf{H}^t = \\{{H}_{\\rho}^t,{H}_{\\phi}^t,{H}_{z}^t\\}\\) and the components of our vectorial equation \\(A_1,A_2,A_3\\), and integrate over the resonators cross section domain \\(\\Omega\\) (and its boundary for the boundary conditions):\n\n\\[\\int\\limits_{\\Omega}(H^t_{\\rho}A_1+H^t_{\\phi}A_2+H^t_{z}A_3)d\\Omega\\]\nWe can reduce the order of partial derivatives in this integral by using the Greens formula for integration by parts.\nFor example:\n\n\\[\\int\\limits_{\\Omega}H_z^t \\frac{\\partial^2 H_z}{\\partial \\rho^2 }d\\Omega = \n-\\int\\limits_{\\Omega}\\frac{\\partial H_z^t}{\\partial \\rho}\\frac{\\partial H_z}{\\partial \\rho }d\\Omega+\\oint H_z^t\\frac{\\partial H_z}{\\partial \\rho}n_{\\rho}d\\Gamma\\]\nThus converting equations (61) we obtain a large expression for the weak form.\n\n\nA dielectric sphere example with FreeFEM\nWe now compute the fundamental mode frequency for a fused silica sphere.\nThe sphere is 36 micrometer in diameter, the refractive index is 1.46, the boundary condition is the magnetic wall (which can actually be omitted as it holds automatically).\n  1 // Parameters\n  2 real radius  =  36; //approximate radius of the cavity\n  3 real yb  =  -10, yt  =  -yb; //window yb = bottom and yt = top coordinates\n  4 real xl  =  radius-5, xr  =  radius+3; //window xl = left and xr = right coordinates\n  5 real angle  =  asin((yt)/radius); //angle of the sphere segment to model in radians\n  6 int Nm  =  60; //number of mesh vertices per border\n  7 real ne  =  1.46; //n_e-extraordinary refractive index (root of permittivity parallel to z-axis, epara)\n  8 real no  =  1.46; //n_o-ordinary refractive index (root of permittivity orthogonal to z-axis, eorto)\n  9 real nm  =  1; //refractive index of surrounding medium (air)\n 10 \n 11 int nev  =  4; // number of eigen values to find\n 12 \n 13 int M  =  213; //azimuthal mode order ~ 2Pi*n*R/lambda\n 14 real alpha  =  1; //penalty term\n 15 \n 16 // Mesh\n 17 border W1l(t = 0, 1){x = xl+(radius*cos(angle)-xl)*(1-t); y = yt; label = 1;}\n 18 border W1r(t = 0, 1){x = xr-(xr-radius*cos(angle))*(t); y = yt; label = 1;}\n 19 border W2(t = 0, 1){x = xr; y = yb+(yt-yb)*t; label = 1;}\n 20 border W3l(t = 0, 1){x = xl+(radius*cos(angle)-xl)*(t); y = yb; label = 1;}\n 21 border W3r(t = 0, 1){x = xr-(xr-radius*cos(angle))*(1-t); y = yb; label = 1;}\n 22 border W4(t = 0, 1){x = xl; y = yt-(yt-yb)*t; label = 1;}\n 23 border S(t = 0, 1){x = radius*cos((t-0.5)*2*angle); y = radius*sin((t-0.5)*2*angle); label = 2;}\n 24 mesh Th  =  buildmesh(W1r(Nm/4) + W1l(Nm/4) + W4(Nm) + W3l(Nm/4) + W3r(Nm/4) + W2(Nm) + S(Nm));\n 25 plot(Th, WindowIndex = 0);\n 26 \n 27 // Fespace\n 28 fespace Ph(Th, P0);\n 29 Ph reg  =  region;\n 30 \n 31 int ncav  =  reg(xl+1, 0); // cavity\n 32 int nair  =  reg(xr-1, 0); //air\n 33 Ph eorto  =  no^2*(region =  = ncav) + nm^2*(region =  = nair); //subdomains for epsilon values inside and outside the resonators\n 34 Ph epara  =  ne^2*(region =  = ncav) + nm^2*(region =  = nair); //subdomains for epsilon values inside and outside the resonators\n 35 \n 36 //supplementary variables to store eigenvectors, defined on mesh Th with P2 elements - Largange quadratic.\n 37 fespace Supp(Th, P2);\n 38 Supp eHsqr;\n 39 \n 40 //3d vector FE space\n 41 fespace Vh(Th, [P2, P2, P2]);\n 42 Vh [Hr, Hphi, Hz], [vHr, vHphi, vHz]; //magnetic field components on Vh space and test functions vH\n 43 \n 44 // Macro\n 45 //boundary condition macros\n 46 macro EWall(Hr, Hphi, Hz) (\n 47       dy(Hr) - dx(Hz) + Hr*N.x + Hz*N.y\n 48     - epara*(Hz*M - dy(Hphi)*x)*N.y\n 49     + eorto*(Hphi - Hr*M+dx(Hphi)*x)*N.x) //\n 50 macro MWall(Hr, Hphi, Hz) (\n 51       Hphi + Hz*N.x - Hr*N.y\n 52     + epara*(Hz*M - dy(Hphi)*x)*N.x\n 53     + eorto*(Hphi - Hr*M+dx(Hphi)*x)*N.y ) //\n 54 \n 55 // Problem\n 56 real sigma  = (M/(ne*radius))^2+2; // value of the shift (k^2), where the modes will be found\n 57 varf b ([Hr, Hphi, Hz], [vHr, vHphi, vHz])\n 58      =  int2d(Th)(\n 59           x*(Hr*vHr+Hphi*vHphi+Hz*vHz)\n 60     )\n 61     ;\n 62 // OP  =  A - sigma B ; // the shifted matrix\n 63 varf op ([Hr, Hphi, Hz], [vHr, vHphi, vHz]) = \n 64     int2d(Th)(\n 65           (\n 66               (eorto*(vHphi*Hphi - M*(vHphi*Hr + Hphi*vHr) + M^2*vHr*Hr) + epara*M^2*vHz*Hz)/x //A/r\n 67             + eorto*(dx(vHphi)*(Hphi - M*Hr) + dx(Hphi)*(vHphi - M*vHr)) - epara*M*(vHz*dy(Hphi) + Hz*dy(vHphi)) //B\n 68             + x*(eorto*dx(vHphi)*dx(Hphi) + epara*((dx(vHz) - dy(vHr))*(dx(Hz) - dy(Hr)) + dy(vHphi)*dy(Hphi))) //C\n 69         )/(eorto*epara)\n 70         + alpha*(\n 71               (vHr*Hr - M*(vHphi*Hr + Hphi*vHr) + M^2*vHphi*Hphi)/x //D/r\n 72             + (dx(vHr) + dy(vHz))*(Hr - M*Hphi) + (vHr - M*vHphi)*(dx(Hr) + dy(Hz)) //E\n 73             + x*(dx(vHr) + dy(vHz))*(dx(Hr) + dy(Hz)) //F\n 74         )\n 75         -sigma*x*(vHr*Hr + vHphi*Hphi + vHz*Hz)\n 76     )\n 77     //electric wall boundary condition on the boundary of computation domain\n 78     +int1d(Th, 1)(\n 79           EWall(Hr, Hphi, Hz)*EWall(vHr, vHphi, vHz)\n 80     )\n 81     ;\n 82 //setting sparce matrices and assigning the solver UMFPACK to solve eigenvalue problem\n 83 matrix B  =  b(Vh, Vh, solver = UMFPACK);\n 84 matrix OP  =  op(Vh, Vh, solver = UMFPACK);\n 85 \n 86 // Solve\n 87 real[int] ev(nev); //to store the nev eigenvalue\n 88 Vh[int] [eHr, eHphi, eHz](nev); //to store the nev eigenvector\n 89 //calling ARPACK on sparce matrices with the assigned solver UMFPACK:\n 90 int k  =  EigenValue(OP, B, sym = true, sigma = sigma, value = ev, vector = eHr, tol = 1e-10, maxit = 0, ncv = 0);\n 91 \n 92 k  =  min(k, nev); //sometimes the number of converged eigen values\n 93                  //can be greater than nev\n 94 \n 95 //file to output mode values\n 96 ofstream f(\"modes.txt\");\n 97 //setting number of digits in the file output\n 98 int nold  =  f.precision(11);\n 99 \n100 // Plot & Save\n101 for (int i  =  0; i < k; i++){\n102     real lambda  =  2*pi/sqrt(ev[i]);\n103     eHsqr  =  (sqrt(eHr[i]^2 + eHphi[i]^2 + eHz[i]^2)); //intensity from magnetic field components\n104     plot(eHsqr, WindowIndex = i, value = 1, nbiso = 20,LabelColors = 1, aspectratio = 1, cmm = \"Mode \"+i+\", lambda = \"+lambda+\", F = \"+(299792.458/lambda));\n105     f << \"Mode \"<< i << \", ka = \" << sqrt(ev[i])*radius << endl;\n106 }\n\n\n\n\n\n\n\t\t\n\t\t\t Previous topic: Compressible Neo-Hookean materials\n\t\t\tNext topic: Examples \n\t\t\n\t","l":"models/whispering-gallery-modes.html"},"52":{"t":"I/O","p":"\n\t\t\n   \nI/O\nSee I/O example\nSee File stream example.\n\ncout\nStandard C++ output device (default: console).\n1 cout << \"Some text\" << endl;\n\n\n\n\ncin\nStandard C++ input device (default: keyboard).\n1 cin >> var;\n\n\n\n\nendl\nEnd of line.\n1 cout << \"Some text\" << endl;\n\n\n\n\nifstream\nOpen a file in read mode.\n1 ifstream file(\"file.txt\");\n\n\n\nNote\nA file is closed at the end of a block.\n\n\n\nofstream\nOpen a file in write mode.\n1 ofstream file(\"file.txt\");\n\n\n\nNote\nA file is closed at the end of a block.\n\n\n\nappend\nAppend data to an existing file.\n1 ofstream file(\"file.txt\", append);\n\n\n\n\nbinary\nWrite a file in binary.\n1 ofstream file(\"file.btxt\", binary);\n\n\n\n\nseekg\nSet the file position.\n1 file.seekg(Pos);\n\n\n\n\ntellg\nGet the file position.\n1 int Pos  =  file.tellg();\n\n\n\n\nflush\nFlush the buffer of the file.\n1 file.flush\n\n\n\n\ngetline\nGet the current line.\n1 string s;\n2 getline(file, s);\n\n\n\n\nOutput format\nIn the descriptions below, f is an output stream, for example cout or a ofstream.\nAll this methods, excepted the first, return a stream, so they can be chained:\n1 cout.scientific.showpos << 3 << endl;\n\n\n\nprecision\nSet the number of digits printed to the right of the decimal point.\nThis applies to all subsequent floating point numbers written to that output stream.\nHowever, this wont make floating-point integers print with a decimal point.\nIts necessary to use fixed for that effect.\n1 int np  =  f.precision(n)\n\n\n\n\nscientific\nFormats floating-point numbers in scientific notation\n1 f.scientific\n\n\n\n\nfixed\nUsed fixed point notation for floating-point numbers.\nOpposite of scientific.\n1 f.fixed\n\n\n\n\nshowbase\nConverts insertions to an external form that can be read according to the C++ lexical conventions for integral constants.\nBy default, showbase is not set.\n1 f.showbase\n\n\n\n\nnoshowbase\nUnset showbase flags.\n1 f.noshowbase\n\n\n\n\nshowpos\nInserts a plus sign (+) into a decimal conversion of a positive integral value.\n1 f.showpos\n\n\n\n\nnoshowpos\nUnset showpos flags.\n1 f.noshowpos\n\n\n\n\ndefault\nReset all the previous flags to the default expect precision.\n1 f.default\n\n\n\n\nsetw\nBehaves as if member width were called with n as argument on the stream on which it is inserted as a manipulator (it can be inserted on output streams).\n1 f.setw(n)\n\n\n\n\n\n\n\n\t\t\n\t\t\t Previous topic: Loops\n\t\t\tNext topic: Functions \n\t\t\n\t","l":"references/IO.html"},"53":{"t":"External libraries","p":"\n\t\t\n   \nExternal libraries\n\naniso\n\nboun